(14,	4,	7,	'There is no BIOS in FOSSEE Laptop.<br>However, if you are using a dual boot device, you may look  into <a target=\"\" title=\"\" href=\"https://github.com/FOSSEE/FOSSEE-netbook-uboot-source\">u-boot source</a> code and modify it to obtain alternate boot order. You may also need support from vendor to re-flash u-boot to  NAND. We haven\'t changed the u-boot at FOSSEE. <br><br>Optionally, you may also boot from 8GB sdcard, without worrying about NAND installation. In an GNU/Linux operating system, perform the following:<br><br><div dir=\"ltr\"><div style=\"font-size:12.8000001907349px\">1)&nbsp; Get an 8GB or above <span class=\"il\">sdcard</span>, create first 50MB VFAT(<span class=\"il\">boot</span>) and remaining as ext4(rootfs) partition<br></div><div style=\"font-size:12.8000001907349px\">2) &nbsp;Download and extract&nbsp;<a href=\"http://www.it.iitb.ac.in/AakashApps/repo/netbook/fossee-os-sdcard-boot/rootfs/fossee-os.tar.gz\" target=\"_blank\">fossee-os.tar.gz</a>&nbsp;to ext4 partition (use sudo or root to extract)<br></div><div style=\"font-size:12.8000001907349px\">3) &nbsp;Download and extract <span class=\"il\">boot</span>.tar to&nbsp;<a href=\"http://www.it.iitb.ac.in/AakashApps/repo/netbook/fossee-os-sdcard-boot/boot/boot.tar\" target=\"_blank\"><span class=\"il\">boot</span></a>&nbsp;partition<br>4)&nbsp; Insert the sdcard to FOSSEE-Laptop, and restart. FOSSEE-OS shall now boot from external SDCARD.<br></div><div style=\"font-size:12.8000001907349px\"><br><span class=\"il\"></span></div></div><br>',	'2015-07-20 05:56:47',	'2015-07-20 05:56:47',	0,	0),
(15,	28,	8,	'Hello Ashwini,<br><br>Please follow the steps:<br>1. In the directory \"gr-D\" run the following command gr_modtooladd sub1<br>2. change the code for sub1<br>3. change your directory to \"build\" -- cd build (no need to create build directory everytime)<br>4. run -- cmake ../<br>5. run -- make<br>6. run -- make install<br><br>Please make sure not to use \"sudo\" for any of the commands above.<br><br>',	'2015-07-23 09:32:56',	'2015-07-23 09:32:56',	0,	0),
