(17,	36,	10,	'If serial ports are n\'t closed properly in scilab-arduino toolbox, then run the the below program :<br><br>ok=open_serial(1,2,115200)\\r\\n<br>if ok~=0 then\\r\\n<br>&nbsp;&nbsp;&nbsp; error([\'Unable to open serial port\' ; \'Please reload the firmware and restart\'; \'\']);\\r\\n<br>else close_serial(1);\\r\\n<br>&nbsp;&nbsp;&nbsp; disp(\'Serial port seems to be working\');\\r\\n<br>end;<br><br>I think you are trying to use scilab-arduino toolbox based experiments and some independent arduino sketches simultaneously. <br>It will be good either you use firmware for the toolbox first, perform some particular experiments and then use your independent arduino sketches or vice-versa.<br><br><br><br>',	'2015-07-28 05:29:42',	'2015-07-29 07:48:14',	0,	0),
