alse\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\\r\\n </w:LatentStyles>\\r\\n</xml><![endif]--><!--[if gte mso 10]>\\r\\n<style>\\r\\n /* Style Definitions */\\r\\n table.MsoNormalTable\\r\\n\\t{mso-style-name:\"Table Normal\";\\r\\n\\tmso-tstyle-rowband-size:0;\\r\\n\\tmso-tstyle-colband-size:0;\\r\\n\\tmso-style-noshow:yes;\\r\\n\\tmso-style-priority:99;\\r\\n\\tmso-style-qformat:yes;\\r\\n\\tmso-style-parent:\"\";\\r\\n\\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\\r\\n\\tmso-para-margin-top:0cm;\\r\\n\\tmso-para-margin-right:0cm;\\r\\n\\tmso-para-margin-bottom:10.0pt;\\r\\n\\tmso-para-margin-left:0cm;\\r\\n\\tline-height:115%;\\r\\n\\tmso-pagination:widow-orphan;\\r\\n\\tfont-size:11.0pt;\\r\\n\\tfont-family:\"Calibri\",\"sans-serif\";\\r\\n\\tmso-ascii-font-family:Calibri;\\r\\n\\tmso-ascii-theme-font:minor-latin;\\r\\n\\tmso-hansi-font-family:Calibri;\\r\\n\\tmso-hansi-theme-font:minor-latin;\\r\\n\\tmso-bidi-font-family:\"Times New Roman\";\\r\\n\\tmso-bidi-theme-font:minor-bidi;\\r\\n\\tmso-fareast-language:EN-US;}\\r\\n</style>\\r\\n<![endif]-->\\r\\n\\r\\n<p class=\"MsoNormal\">There are 2 sides of this problem:</p>\\r\\n\\r\\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">1.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\\r\\n</span></span></span><b>Beginning of the problem: </b></p><b>\\r\\n\\r\\n</b><p class=\"MsoListParagraphCxSpMiddle\"><b>I</b>f some error is in the .sce file which is\\r\\nrun, then the mentioned problem comes.</p>\\r\\n\\r\\n<p class=\"MsoListParagraphCxSpLast\">I feel there is some issue with the firmware.</p>\\r\\n\\r\\n<p class=\"MsoNormal\" style=\"text-indent:36.0pt\"><span style=\"mso-spacerun:yes\">&nbsp;</span>Size of the program affects the execution time\\r\\n(directly proportional). <span style=\"mso-spacerun:yes\">&nbsp;</span></p>\\r\\n\\r\\n<p class=\"MsoListParagraphCxSpFirst\" style=\"text-indent:-18.0pt;mso-list:l0 level1 lfo1\"><span style=\"mso-bidi-font-family:Calibri;mso-bidi-theme-font:minor-latin\"><span style=\"mso-list:Ignore\">2.<span style=\"font:7.0pt &quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\\r\\n</span></span></span><b>Quick Mitigation</b></p><b>\\r\\n\\r\\n</b><p class=\"MsoListParagraphCxSpMiddle\">Unplug Arduino from the system. Close all\\r\\nthe programs both Scilab and Arduino environment. And start fresh. </p>\\r\\n\\r\\n<p class=\"MsoListParagraphCxSpLast\">This idea is not good if the Arduino is used\\r\\nin some project remotely installed and working independently.</p>\\r\\n\\r\\n<p class=\"MsoNormal\">Please enlighten.</p>\\r\\n\\r\\n',	'2015-07-29 07:46:53',	'2015-07-29 07:46:53',	0,	0),
(19,	36,	10,	'<br>Dear Navdeep,<br>The problem occurs only if the serial port isn\'t closed properly from scilab part and not from the arduino part.<br>And this issue occurs if you forcefully closes any program during the simulation.As far as my knowledge,there is no such issue from the firmware part.Anyway, i will go through it and let you know.But, it will be good if you also can find if any such bug exists in the firmware.<br><br>I didn\'t suggest you to perform toolbox related experiments and pure arduino experiments independently on different boards.First you perform all the related set of experiments either to toolbox or pure arduino sketches then other set of experiments.&nbsp; <br><br>Thanks,<br>',	'2015-07-30 10:44:23',	'2015-07-30 10:44:23',	0,	0),
(20,	36,	10,	'<br>Dear Navdeep,<br>The problem occurs only if the serial port isn\'t closed properly from scilab part and not from the arduino part.<br>And this issue occurs if you forcefully closes any program during the simulation.As far as my knowledge,there is no such issue from the firmware part.Anyway, i will go through it and let you know.But, it will be good if you also can find if any such bug exists in the firmware.<br><br>I didn\'t suggest you to perform toolbox related experiments and pure arduino experiments independently on different boards.First you perform all the related set of experiments either to toolbox or pure arduino sketches then other set of experiments.&nbsp; <br><br>Thanks,<br>',	'2015-07-30 10:45:06',	'2015-07-30 10:45:06',	0,	0),
(21,	28,	11,	'Yes you can, since Sandhi is an open source software. Please use grep command to locate code of any block. More information on grep command can be got from this link: spoken-tutorial.org/watch/Linux/The%2Bgrep%2Bcommand/English/',	'2015-07-30 17:29:47',	'2015-07-30 17:29:47',	0,	0),
(22,	29,	11,	'&nbsp;hi&nbsp;<div>i tried grep command to search implementation code for constant source block. i am unable to locate code.Can you please tell me how to do it step wise.If possible please share screenshots.</div>',	'2015-08-03 10:26:20',	'2015-08-03 10:26:20',	0,	0),
(23,	38,	10,	'Hi Navdeep,<div><br></div><div>&nbsp;\"<span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\"><i>While working with the Arduino-Scilab toolbox, same issue come up everytime.</i></span></div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\"><i>Serial port does not close properly and I am unable to upload any program.</i>\"</span><br style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px;\"><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">--- I think Arduino-Scilab toolbox is developed so that you need not \'Upload any program\' in Arduino.</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\"><br></span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">Also as manas correctly said,&nbsp;</span><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">serial port is not closed&nbsp;</span><span style=\"line-height: 21.4285717010498px; color: rgb(38, 25, 189); background-color: rgb(249, 246, 246);\">from scilab side(i.e. your computer machine/laptop). W</span><span style=\"line-height: 21.4285717010498px; color: rgb(38, 25, 189); background-color: rgb(249, 246, 246);\">hen we have any error in .sce file while working with scilab-arduino toolbox, code terminates in between so the <i>close_serial</i>&nbsp;(1) does not get executed. It happens quite a lot especially when you are learning new experiments.&nbsp;</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\"><br></span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">If one wants full-proof solution, we need to perform close_serial(1) every time scilab code terminates (because of whatever reason).&nbsp;</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">So we need to catch the event of termination and run our function which has close_serial(1) written. I will post if it works.&nbsp;</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\"><br></span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">For the temporary solution we can perform following troubleshooting&nbsp;</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">1. use command abort and close_serial(1)</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">2. remove and re-plug USB cable in laptop</span></div><div><span style=\"color: rgb(38, 25, 189); line-height: 21.4285717010498px; background-color: rgb(249, 246, 246);\">3. reset Arduino</span></div><div><br></div>',	'2015-08-04 09:45:45',	'2015-08-04 09:45:45',	0,	0),
(24,	35,	12,	'1. Arduino Uno can be purchased from flipkart for Rs 540-Rs600<br>2. You can get the opensource board layout from IIT Mumbai and get this fabricated from PCBPower. They charge Rs2500-Rs3000 for fabricating 20 bare boards(depending on number of days for delivery greater than 7 days).. Components cost varies/availibility from place to place. You may need to solder components on the bareboard.<br><br><br>',	'2015-08-05 12:06:18',	'2015-08-05 12:06:18',	0,	0),
(25,	36,	17,	'Dear Rajaneesh,<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Right now it supports only serial communication.But you can very well update the firmware for ethernet or any other type of communication protocol you wish.<br><br>Thanks,<br>Manas<br>',	'2015-08-05 14:17:45',	'2015-08-05 14:17:45',	0,	0),
(26,	36,	16,	'In scilab-arduino toolbox .bin is compiled version of .sci macros.When you execute any example it actually uses .bin.<br>',	'2015-08-05 14:21:27',	'2015-08-05 14:21:27',	0,	0),
(27,	35,	16,	'Hi<br><br>Thank you... On a similar line, could I convert .sce files or .zcos file to .bin files to speed up my performance?<br><br><br>Regards<br>Rajaneesh<br>',	'2015-08-05 14:32:50',	'2015-08-05 14:32:50',	0,	0),
