(52,	56,	38,	'Hi Jonathan,<br><br>Kicad has lots of library and all of them can\'t be simulate using ngspice hence we&nbsp; have created our own library in Kicad which can be simulated.<br><br>While drawing schematic please make sure to take the components from esim\'s library. The library starts with name esim_* .<br><br>About your second queries,yes you have to run it as administrator to set the PATH properly.<br><br>Let me check about HKLM and&nbsp; HKCU. I think you are right we don\'t have to run it as administrator.<br><br><br><br>',	'2015-09-22 12:58:33',	'2015-09-22 12:58:33',	0,	0),
