(59,	56,	44,	'Hi Sameer,<br><br>If you want to plot branch current then you can directly use python plotting window to plot branch current.<br><br>If you want to do it in NgSpice window then you can use below command.<br><br>1. This will plot all the branch current in your circuit.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; plot alli&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br><br>2. Also if you want to measure a current from any specific branch then you use<br>&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp; plot i(v1)<br>&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp; where v1 is voltage source of that branch.<br><br>3. If the branch do not contain any voltage source then you can add any dc voltage source of 0 value and then plot current with command given in 2nd point.<br><br>Hope this answer your question<br><br>Thanks.<br>',	'2015-10-16 11:35:54',	'2015-10-16 11:35:54',	0,	0),
(60,	60,	45,	'Hi ,<div><br><div>You can\'t measure resistance in eSim. You can measure only voltage and current.</div></div>',	'2015-10-19 06:42:26',	'2015-10-19 06:42:26',	0,	0),
