(64,	60,	49,	'Hi,<div>To plot voltage vs current, you can use following command in ngspice terminal-</div><div><br></div><div>plot v(node name) vs i(branch current)</div><div><br></div><div>eg: plot v(out) vs i(v_iout1)</div><div><br></div><div>For more ngspice commands go to this link -&nbsp;<a href=\"http://esim.fossee.in/ngspicecmd\" title=\"\" target=\"\">http://esim.fossee.in/ngspicecmd</a></div>',	'2015-10-23 06:01:20',	'2015-10-23 06:01:20',	0,	0),
(65,	60,	49,	'Hi,<div>can you send me that example, so i can check that issue.</div>',	'2015-10-23 06:19:16',	'2015-10-23 06:32:27',	0,	0),
(66,	60,	49,	'Hi,<div>You have to give some source details value, if you keep blank then it takes as 0v dc source. You also have to use proper diode model to get expected values. I have tried your example it gives me linear graph using diode model D1N750.</div>',	'2015-10-23 06:58:56',	'2015-10-23 06:58:56',	0,	0),
(67,	68,	46,	'<div>Hi following are the answers to your questions.</div><div><br></div><div>1. DWSIM is a steady simulation solver.</div><div>2. Yes, one can obtain stream wise material and energy balance report. Just click on the Results menu and click on build report, after that DWSIM will ask which all streams and stream properties you want in your report. The generated report will be in .pdf format.</div><div><br></div><div>Regards,</div><div>Rahul</div>',	'2015-10-23 09:49:28',	'2015-10-23 09:49:28',	0,	0),
(68,	56,	50,	'Hi,<br><br>Please make sure that you have not enter any space in your project name. So for example if you are using project name as \"Bridge Rectifier\" (without quotes) then it won\'t work as it contain space in between name. Instead you can use \"BridgeRectifier\" (without quotes).<br><br>If it doesn\'t solve your problem then please check whether your project path contain any space in between.To be on safer side , you can use the default esim-worspace where all your project files will be stored.<br><br>Do let us know if you still face the same issue.<br><br>',	'2015-10-24 05:18:48',	'2015-10-24 05:18:48',	0,	0),
(69,	56,	51,	'Hi,<br><br>Were you able to install it properly ? <br><br>Can you please let us know the exact error you are getting ? This will help us to find the proper solution.<br><br><br>',	'2015-10-24 05:23:58',	'2015-10-24 05:23:58',	0,	0),
