(75,	80,	49,	'It is very easy to draw the 2D plot. There are simple commands for this purpose.<br>You have to use the plot command and the your variable in the braces with this.<br>In one plot command mention the both variables which are voltage and current in your case.<br>In those variables you must store the same length of the values for two dimension plot.<br>',	'2015-11-05 17:26:10',	'2015-11-05 17:26:10',	0,	0),
