(82,	60,	58,	'Hello Kavya,<div><span style=\"line-height: 1.42857;\"><br></span></div><div><span style=\"line-height: 1.42857;\">The left pane in footprint editor contains all the footprints of the components and right pane contains the selected component footprints. The middle pane contains the components which are used in schematic. You have to select proper footprint for the component in schematic. There are 3 component icons in tool bar to list footprint in right pane.</span></div><div><span style=\"line-height: 1.42857;\"><br></span></div><div><span style=\"line-height: 1.42857;\">Note : &nbsp;Creating PCB designing in eSim is similar to PCB designing in Kicad.&nbsp;</span></div>',	'2015-11-26 06:42:12',	'2015-11-26 06:42:12',	0,	0),
(83,	68,	61,	'<div>Hi Aravind,</div>Unfortunately these compounds are not available in the databases supported by DWSIM. You will have to create these compounds by using the <b>Compound Creator Study,</b> facility available in DWSIM. You will have to provide various physical properties of the new compound which you want to add. You can get these properties from literature.<div><br></div><div>Regards,</div><div>Rahul Jain.</div>',	'2015-12-25 05:03:14',	'2015-12-26 05:11:26',	0,	1),
