(91,	94,	68,	'It is possible to display the output in table format.<br><br>See the below example:<br>----------------------------------------------------------------------------------------------------------------------------<br><i>// Include an editable table into a figure:<br>// Building a table of data:<br>params = [\" \" \"Country\" \"Population [Mh]\" \"Temp.[\\xc2\\xb0C]\" ];<br>towns = [\"Mexico\" \"Paris\" \"Tokyo\" \"Singapour\"]\';<br>country = [\"Mexico\" \"France\" \"Japan\" \"Singapour\"]\';<br>pop&nbsp; = string([22.41 11.77 33.41 4.24]\');<br>temp = string([26 19 22 17]\');<br>table = [params; [ towns country pop temp ]]<br><br>f = gcf();<br>clf<br>as = f.axes_size;&nbsp; // [width height]<br>ut = uicontrol(\"style\",\"table\",..<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"string\",table,..<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"position\",[5 as(2)-100 300 87],.. // =&gt; @top left corner of figure<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \"tooltipstring\",\"Data from majors towns\")<br><br>// Modify by hand some values in the table. Then get them back from the ui:<br>matrix(ut.string,size(table)</i>)<br><br>---------------------------------------------------------------------------------------------------------------------------------<br>Type <b>\'help table\'</b> on the Scilab console to read the documentation. <br>',	'2016-01-11 04:27:10',	'2016-01-19 14:11:31',	0,	1),
