(125,	68,	85,	'Hi Vignesh,<div><br></div><div>You can use any version above 3.1. The simulations are same for all the versions, its just that the new versions have more features. The only problem is people have reported some bugs in the new versions. If you face any simulation errors while using version 3.6 you can download version 3.3. Following is the link to download version 3.3. To install it you have to right click on the setup file and select run as administrator (assuming that you are using windows). &nbsp; &nbsp;</div><div><br></div><div>https://sourceforge.net/projects/dwsim/files/DWSIM/DWSIM%203.3/DWSIM_bin_v33_b5517_full.exe/download</div>',	'2016-02-16 10:58:36',	'2016-02-16 10:58:36',	0,	0),
