(133,	64,	91,	'<div><p style=\"margin:0in;font-family:&quot;Times New Roman&quot;\"><span style=\"font-weight: bold; font-size: 11.25pt; background-image: initial; background-attachment: initial; background-size: initial; background-origin: initial; background-clip: initial; background-position: initial; background-repeat: initial;\">Tips to use Equilibrium\\r\\nreactor</span><span style=\"font-size:12.0pt\">&nbsp;</span></p>\\r\\n\\r\\n<p style=\"margin: 0in; line-height: 16pt; font-family: \'Times New Roman\'; font-size: 11.25pt;\">1. In the flow sheet panel, drag and use the\\r\\n\"Equilibrium reactor\" from the object palette</p>\\r\\n\\r\\n<p style=\"margin: 0in; line-height: 16pt; font-family: \'Times New Roman\'; font-size: 11.25pt;\">2. \"Equilibrium reactor\" requires one inlet\\r\\nmaterial stream, two outlet material stream (one for liquid and one for vapour)\\r\\nand one energy stream to be connected to it</p>\\r\\n\\r\\n<p style=\"margin: 0in; line-height: 16pt; font-family: \'Times New Roman\'; font-size: 11.25pt;\">3. Use \"Reaction manager\" under\\r\\n\"Tools\" to create \"Chemical reactions\" and \"Reaction\\r\\nset\". For example, water gas shift reaction is illustrated. Give stoichiometric coefficients and also choose base component. Enable calculation of equilibrium constant from Gibbs energy of the reaction.&nbsp;</p><p style=\"margin: 0in; line-height: 16pt; font-family: \'Times New Roman\'; font-size: 11.25pt;\">4. The equilibrium reactor can be simulated at three different modes - Isothermal (temperature fixed at inlet stream value), adiabatic or with a temperature (as that of outlet stream). In the present example, isothermal mode if choosen.</p><p style=\"margin: 0in; line-height: 16pt; font-family: \'Times New Roman\'; font-size: 11.25pt;\">5. Once all specifications are iven, activate and run (\"recalculate\") the simulation&nbsp;</p><p style=\"margin: 0in; line-height: 16pt; font-family: \'Times New Roman\'; font-size: 11.25pt;\">The DWSIM simulation illustrating equilibrium reactor with WGS reaction can be found at the following link&nbsp;</p></div><div><a href=\"http://bit.ly/DWSIM-Equilibrium-Reactor-WGS \" title=\"\" target=\"_blank\">http://bit.ly/DWSIM-Equilibrium-Reactor-WGS </a><br></div><div><br></div><div>I hope with this tips, you are able to successfully build and develop equilibrium reactor</div><div><br></div><div>Thanks</div><div>Naren&nbsp;</div>',	'2016-02-29 19:58:23',	'2016-02-29 19:58:23',	0,	0),
