(157,	48,	98,	'Hi KVK,<br><br>Your deltaT is decreasing / changing because of implementation of adjustable Runtime in controlDict file which must have been kept on. Also please check your initial dT since your max Courant number ( Co = U*dT / dX ) is exceeding the limit value of 1.<br>Most of the times the solution diverges because of the Courant number exceeding 1 in such explicit solvers.<br>Try decreasing the initial&nbsp; time step (dT).<br><br>Regards,<br><br>Rahul Joshi<br>',	'2016-03-13 02:59:24',	'2016-03-13 02:59:24',	0,	0),
(158,	48,	98,	'Hi KVK,&nbsp;<div><br></div><div>Keep the adjust time step - &nbsp;off</div><div><br></div><div>In case you keep it on, &nbsp;keep the deltaT as 0.001 and then try running your simulation.&nbsp;</div>',	'2016-03-13 06:10:23',	'2016-03-13 06:10:23',	0,	0),
