(169,	56,	105,	'Dear Winderson,<div><br></div><div>We have created our own component in Kicad for simulation in ngspice. The reason is there are few components in Kicad whose netlist generation are not in order with that of ngspice.&nbsp;</div><div><br></div><div>In our earlier version(OSCAD), We were doing mapping in Kicad to Ngspice converter for all such component whose netlist are not in order with ngspice but that was not great solution because if Kicad people change the netlist format then again we have to redo the mapping in our source code&nbsp;</div><div><br></div><div>I would suggest you to use Kicad\'s own component for PCB designing and for simulation you can use eSim\'s component.</div><div><br></div><div>Hope this answer your query.</div><div>&nbsp;</div>',	'2016-03-24 05:39:23',	'2016-03-24 11:26:54',	0,	1),
