(179,	131,	107,	'<p>sorry for the wrong language.</p><p>Hello,</p><p>in my Company i have to do a Vibration measurement. I get all messdata in a Special Programm and Import it in scilab. Then i will plot the messdata in contourf plot in scilab. I did a fast Fourier Transformation and take the command \"abs\" to get the absolut valuse (Amplitudes).</p><p>&nbsp;Now I have the Problem, i really don\\xb4t know how i have to do this. </p><p>Which commands i Need for this plot, when i want to have the number of the bottle at the x-Axis, and the frequenzy of the fast Fourier Transformation on the y-Axis.</p><p>In the z-Axis i want to have the amplitudes from the fast Fourier Transformation.</p><p>the value in x -Axis Shows us the Speed of the machine maximal Speed is 2500 bottles per hour&nbsp;. </p><p>the value in the y - axis shoult reach from Zero Hz up to 50 Hz.</p><p><br></p><p>i\\xb4m sorry for my not so good english</p><p>max</p><p><br></p>',	'2016-03-31 10:37:10',	'2016-03-31 10:37:10',	0,	0),
