(194,	56,	111,	'Hi,<br><br>Here are few rules for project name.<br><br>1. You cannot have spaces in between the project name. e.g You cannot have \"RC Circuit\" as your project name instead you can use \"RC_Circuit\"<br><br>2. Make sure while opening an eSim you have selected a workspace location in proper path. The complete path of workspace location cannot have space in between them.<br><br>Hope this will help you. Do let us know if you still face any problem while running an eSim<br>',	'2016-04-23 08:27:48',	'2016-04-23 08:27:48',	0,	0),
(195,	48,	112,	'Hi KVK,<div><br></div><div>Can you elaborate on which results do you want to plot.</div>',	'2016-04-25 01:38:38',	'2016-04-25 01:38:38',	0,	0),
(196,	90,	113,	'I\'ve modified your code-<br><br>clear, clf // Define your variables <br>stacksize(\'max\')<br>&nbsp;t1 =[0:0.01:100]; <br>&nbsp;y1=25+75 ./(1+exp((t1-50)/10)); <br>&nbsp;t2=[0:0.01:100]; <br>&nbsp;y2 = -10 *log((75/t2-25)-1) + 50; <br>&nbsp;<br>&nbsp;// Use the logflag option to define logarithmic or normal axis <br>&nbsp;// n for normal, l for logarithmic. <br>&nbsp;plot(t1,y1,t2,y2)<br>&nbsp;// Use xgrid to add a grid on your current figure <br>&nbsp;xgrid;<br><br>I\'ve added an asterisk before log and removed the dot operator before -1.<br><br>I get a plot but there is a warning-<br>WARNING: Transposing row vector X to get compatible dimensions<br><br>Also, you have to increase the stacksize to max as the code exceeds the stack size allocation.<br>',	'2016-04-25 10:18:03',	'2016-04-25 10:18:03',	0,	0),
(197,	90,	113,	'Based on y1, I get y2 to be 10 .*log(((75)./(t2-25))-1) + 50. It is different from the y2 you have calculated. I\'m not sure the range you have&nbsp; selected is correct. When t2=100, it becomes log(0) which leads to an error. I\'ve modified the code to this-<br><br>clc<br>clear<br>t1 =[1:10:100];<br>y1=25+(75)./(1+exp((t1-50)/10));<br>t2=[1:10:100];<br>g=((75)./(t2-25))-1<br>y2 = 10 .*log(g) + 50<br>plot(t1,y1,t2,y2)<br>xgrid;<br><br>Please check if the plot is correct now.<br><br>',	'2016-04-27 05:54:29',	'2016-04-27 05:54:29',	0,	0),
(198,	90,	113,	'Please check the code now-<br><br>clc<br>clear<br>t1 =[1:0.1:99.9];<br>y1=25+(75)./(1+exp(-(t1-50)/10));<br>t2=[1:0.1:99.9];<br>y2=zeros(size(t2,1),1)<br>for t=1:length(t2)<br>&nbsp;&nbsp;&nbsp;&nbsp; if (t2(t)==25)&nbsp; then // ln(0) is an error. Equate it to zero.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; y2(t)=0;<br>&nbsp;&nbsp;&nbsp;&nbsp; else&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; y2(t) = -10 *(log(((75)./(t2(t)-25))-1)) + 50;<br>&nbsp;&nbsp;&nbsp;&nbsp; end<br>end<br>plot(t1,y1,t2,y2\')<br>ax=gca();<br>ax.data_bounds=[25 25;120 120];<br>xgrid;<br><br>For the range you\'ve chosen, no value exists for ln(0) and division by zero. We have to handle such exceptions in the code. Please check the plot now. y2 exists for values below t2&lt;25.I\'ve plotted only from t2&gt;=25 to match the plot you have shown.<br>',	'2016-04-28 08:57:40',	'2016-04-28 08:57:40',	0,	0),
(201,	140,	113,	'Thanks for your help, that works pretty well.<div>Much appreciated</div>',	'2016-05-02 10:25:34',	'2016-05-02 10:25:34',	0,	0),
(202,	90,	115,	'The code has been modified to this-<br><br>B = 470; k = 0.08; g = 32; W = 527; <br>function D = f(v) <br>&nbsp;&nbsp;&nbsp; D = (1 ./k^2 .* g)*(W .*(W-B).*log(1 + (k .*v)./(W - B)) - W .*k .*v); <br>endfunction; <br><br>function[v,D] = grafico(ini, fim) <br>&nbsp;&nbsp;&nbsp; intervalo = fim-ini <br>&nbsp;&nbsp;&nbsp; intervalo = intervalo / 100 <br>&nbsp;&nbsp;&nbsp; l=length(ini:intervalo:fim)<br>&nbsp;&nbsp;&nbsp; for i=1:1:l<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; v(i) = ini; <br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; D(i)= f(v(i));<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ini = ini + intervalo; <br>&nbsp;&nbsp;&nbsp; end;<br>&nbsp;&nbsp;&nbsp; plot(v,D) <br>endfunction; <br><br>a = 0; //intervalo inicial <br>b = 0.0001; //intervalo final <br>ini = a; fim = b; <br>[v,D]=grafico(a, b,\'k\');<br><br>This\\r\\n plots v vs D. I don\'t understand plot(v, D, \'.k\'); Are you trying to \\r\\nspecify the curved should be plotted in black? Then it is only \'k\'. If \\r\\nnot, please let me know.<br><br>',	'2016-05-04 05:15:17',	'2016-05-04 05:15:17',	0,	0),
(203,	56,	116,	'Hi,<br><br>Please make sure while installing eSim you right click the setup file and run it as an administrator to set the environment variable properly.<br><br>Do let us know if you still face the issue.<br><br>Regards,<br>Fahim<br>',	'2016-05-06 11:49:07',	'2016-05-06 11:49:07',	0,	0),
(204,	48,	117,	'Hi Subhankar,<br><br>1. We would be in a better position to answer your question if you post the error that you get in windows installation of OpenFOAM.<br><br>2. There are several advantages of working in Ubuntu over windows : <br><br>- Even while using&nbsp; windows you will still have to run the simulation using command terminal. So why not use Ubuntu<br><br>- All the functionalities that are available in windows are easily available in Ubuntu<br><br>- OpenFOAM is best learnt while working in Ubuntu ( personal experience)<br><br>- Learning Linux helps you lot&nbsp; in&nbsp; academia as well as getting job industry.<br><br>&nbsp;<br>',	'2016-05-10 08:53:10',	'2016-05-10 08:53:10',	0,	0),
(205,	48,	118,	'Hi Anirban,<br><br>You can start with solving some cases in interFoam solver and let us know about your progress.<br>',	'2016-05-12 12:38:50',	'2016-05-12 12:38:50',	0,	0),
(206,	68,	114,	'Hi, presently DWSIM is not compatible with Mac. You can install ubuntu or windows on your Mac as a virtual machine and then run DWSIM on it. If you want to use it on ubuntu then follow the instructions on&nbsp;http://www.mono-project.com/docs/getting-started/install/linux/ to install mono. For windows you simply have to run the setup.',	'2016-05-13 08:17:19',	'2016-05-13 08:17:19',	0,	0),
(207,	68,	110,	'You can go to <b>new compound creator</b> study, then create your own database using the <b>Create New</b> option. A new xml file will be created. After than you can create the new compound by entering the required properties. Then click on the option <b>Save compound to the database</b> and then save the simulation. Now go to <b>settings--&gt;general settings--&gt;Datasets</b> and click on <b>Add User database</b>. Search the xml file for the new database you have created and add it. The next time you start DWSIM you will find the compound. Alternately you can add the compound to an existing database like <b>Chemsep</b> or <b>DWSIM</b>. The procedure is same except that in the <b>new compound creator study</b> instead of creating a new database click on <b>Search</b> and select the xml file for the database (chemsep.xml or DWSIM.xml) which will be there in DWSIM\'s installed folder.',	'2016-05-13 08:50:18',	'2016-05-13 08:50:18',	0,	0),
(208,	152,	119,	'Dear Subhankar,<div><br></div><div>Kindly elaborate more on how the results you are getting are different. What do you exactly mean by run time and execution time? What changes did you make in the controlDict and blockMeshDict file?</div><div><br></div><div>Which version of OpenFOAM and ParaView are you using?&nbsp;</div><div><br></div><div>As a beginner, I think you should start learning from the in-build case files given in OpenFOAM within tutorial folder. You can simply run the icoFoam solver for this case without making any changes in the case file. The spoken tutorials prepared in context to the lid driven cavity explains the example well and how the case file works. Please go through the tutorials from the beginning and follow it step by step to get a basic ideas about how a simulations is created in OpenFOAM. You may also go through this &nbsp;link:&nbsp;<a href=\"http://http://cfd.direct/openfoam/user-guide/cavity/\" title=\"Lid driven cavity\" target=\"\">Lid driven cavity</a>&nbsp;for more insight into this problem. Since, I<span style=\"line-height: 1.42857;\">n OpenFOAM,</span><span style=\"line-height: 1.42857;\">&nbsp;every problem is case specific it is very difficult to build a tutorial on writing the files. But you can always go through the documentation:&nbsp;<a href=\"http://http://cfd.direct/openfoam/user-guide/\" title=\"OpenFOAM user guide\" target=\"\">OpenFOAM user guide</a>&nbsp;to get some initial perception.&nbsp;</span></div><div><span style=\"line-height: 1.42857;\"><br></span></div><div><span style=\"line-height: 1.42857;\">Regards</span></div><div><span style=\"line-height: 1.42857;\">Subhasree Basu</span></div><div><span style=\"line-height: 1.42857;\">CFD Team, Fossee,</span></div><div><span style=\"line-height: 1.42857;\">IIT Bombay</span></div><div><br></div>',	'2016-05-16 05:58:52',	'2016-05-16 05:58:52',	0,	0),
(209,	154,	114,	'DWSIM may run on OS X but it is very unstable. It is better to setup an Ubuntu virtual machine and install DWSIM on it. View this topic for more information:&nbsp;https://sourceforge.net/p/dwsim/discussion/844529/thread/26c053a1/\'<div><br></div><div>Daniel</div>',	'2016-05-16 14:07:08',	'2016-05-16 14:07:08',	0,	0),
(210,	154,	110,	'The logic for creating new compounds is a little complicated, I know. The purpose is to allow the user to have multiple databases of its own (the \"XML\" files), and the \"dwcsd\" files which will contain the data for each single compound created. This way the user can use the compound creator to edit the data for a previous added compound by opening the \"dwcsd\" file and then re-adding the compound to the database once he/she finished the editing process.<div><br></div><div>Daniel</div>',	'2016-05-16 14:12:14',	'2016-05-16 14:12:14',	0,	0),
(211,	154,	91,	'Hi,<div><br></div><div>In DWSIM, each reactor type has its corresponding reaction type. Equilibrium reactors work with equilibrium reactions. Equilibrium reactors solve the chemical equilibrium by using the reaction extent approach. Gibbs reactors can work with equilibrium reactions or without any reaction information (gibbs minimization mode). In this case, it will respect the element mass balance and try to find a state where the gibbs free energy will be at a minimum. <b>This approach works only for single, vapor phase systems.</b></div><div><br></div><div>Daniel</div>',	'2016-05-16 14:18:25',	'2016-05-16 14:18:25',	0,	0),
(212,	48,	118,	'Hi Anirban,<br><br>You can start with cappilaryRise case. This will give you an idea about implementing volume fraction in OpenFOAM. After this you can proceed with your own problem.<br><br>Regards<br>',	'2016-05-17 10:37:05',	'2016-05-17 10:37:05',	0,	0),
(213,	132,	119,	'Hi Subhankar,<br><br>You can go through these tutorials (weblink below) \\r\\nand can understand how you can change different parameters in different \\r\\nfolders and files on your own to run your own simulation and to get the \\r\\nresults of your desire.<br><br>&nbsp;<i>https://www.youtube.com/watch?v=pYX-rP95_mY<br>https://www.youtube.com/watch?v=KznljrgWSvo<br>https://www.youtube.com/watch?v=bJTSKaxG58Y<br>https://www.youtube.com/watch?v=pYX-rP95_mY&amp;index=2&amp;list=PL7WFbgpeASD2U3JHiHHFUeINTawuvNgpI<br><br><br></i>With reagrds,<br>Anirban Mondal<br>Mechanical Dept.<br>IIT KGP',	'2016-05-17 10:48:15',	'2016-05-17 10:48:15',	0,	0),
