(220,	68,	122,	'Hi Akash, instead of adding the compound to default databases(chemsep or DWSIM), try creating a new database. You can do this by clicking on the <b>create new</b> button in the compound creator window. Just give an appropriate name to your database. It will be saved in xml format. Now add your compound to this new database you have created. Once this process is done. Restart Dwsim go to <b>Settings-&gt;General Settings-&gt;databases</b> click on<b> add user database.</b> Locate your new database file (.xml) and add it. The next time when you start DWSIM you will find your compound in the general list of compounds.',	'2016-06-09 08:18:03',	'2016-06-09 08:18:03',	0,	0),
(221,	152,	126,	'Hi Subhankar,<br><br>Thanks for the query. To start writing a blockMeshDict file it would be better if you can follow a video tutorial rather than read one. To get a more clear idea you can go through the spoken tutorials on OpenFOAM here: (http://spoken-tutorial.org/). You would also find a example on 2-D flow over a cylinder here. <br><br>Now coming to solving a problem in OpenFOAM basically requires 3 main folders:<br>1. 0 folder- containing initial conditions of the flow like pressure, velocity, temperature, etc<br>2. constant folder-containing geometry file and some transport properties of the flow like viscosity, etc<br>3. system folder- contains the time details for running the iterations as well as the schemes which are followed to solve the respective problem.<br>The details on each folder changes depending upon the problem statement. You can follow the spoken tutorials mentioned above to get a more clear idea regarding this. Also you can go through the codes of some of the in built tutorial files provided along with the OpenFOAM toolkit to clear your doubts.<br><br>Do let me know if you have any other query regarding this.<br><br><div><span style=\"line-height: 1.42857;\">Regards</span></div><div><span style=\"line-height: 1.42857;\">Subhasree Basu</span></div><div><span style=\"line-height: 1.42857;\">CFD Team, Fossee,</span></div><div><span style=\"line-height: 1.42857;\">IIT Bombay</span></div><br><br>',	'2016-06-14 04:51:08',	'2016-06-14 04:51:08',	0,	0),
