(250,	48,	147,	'Dear Subhankar,<br><br>Add the following lines at the end of controlDict file<br><br>functions<br>\\r\\n{<br>\\r\\nforces<br>\\r\\n{<br>\\r\\ntype forces;<br>\\r\\nfunctionObjectLibs ( \"libforces.so\" ); // lib to load<br>\\r\\noutputControl timeStep;<br>\\r\\noutputInterval 1;<br>\\r\\npatches<br>\\r\\n(<br>\\r\\nwall // change to your patch name<br>\\r\\n);<br>\\r\\n// name of fields<br>\\r\\npName p;<br>\\r\\nUName U;<br>\\r\\nlog true; // dump to file<br>\\r\\nrhoInf 1025;<br>\\r\\nCofR ( 0 0 0 );<br>\\r\\n}<br>\\r\\nforcesCoeffs<br>\\r\\n{<br>\\r\\ntype forceCoeffs;<br>\\r\\nfunctionObjectLibs ( \"libforces.so\" ); // lib to load<br>\\r\\noutputControl timeStep;<br>\\r\\noutputInterval 1;<br>\\r\\npatches<br>\\r\\n(<br>wall // change to your patch name <br>\\r\\n);<br>\\r\\n// name of fields<br>\\r\\npName p;<br>\\r\\nUName U;<br>\\r\\nlog true; // dump to file<br>\\r\\nrhoInf 1025;<br>\\r\\nCofR ( 0 0 0 );<br>\\r\\nliftDir ( 0 1 0 );<br>\\r\\ndragDir ( 1 0 0 );<br>\\r\\npitchAxis ( 0 0 0 );<br>\\r\\nmagUInf 1.0; // velocity magnitude<br>\\r\\nlRef 0.305;<br>\\r\\nAref 0.001525;<br>\\r\\n}<br>\\r\\n}<br><br>This will create a file for lift and drag values.<br>',	'2016-08-03 10:20:36',	'2016-08-03 10:20:36',	0,	0),
