(268,	152,	152,	'Hi Subhankar,<div>\n</div><div>You can use \"gnuplot residuals\" to plot the residuals in OpenFOAM. The following link gives a clear idea of how to use it:</div><div>\n</div><div>http://www.cfd-online.com/Forums/openfoam-solving/172931-plot-residuals.html</div><div>\n</div><div>\n</div>',	'2016-08-24 05:22:10',	'2016-08-24 05:22:10',	0,	0),
(270,	48,	154,	'Hi Shubhankar, <div>You can have a look at swak4Foam for implementing your boundary condition. </div><div>\n</div><div>Regards, </div>',	'2016-09-27 05:37:02',	'2016-09-27 05:37:02',	0,	0),
(271,	56,	156,	'Dear Guillermo,<div>\n</div><div>Can you please confirm that you are able to see the ngSpice window. If yes then you can plot from ngSpice window as well. Please look at ngspice command on esim.fossee.in in download section.</div><div><span style=\"line-height: 1.42857;\">Meanwhile please zip your project file and send us at contact-esim@fossee.in as we cannot find out the exact error.  </span></div><div>\n</div><div>\n</div>',	'2016-09-29 05:30:50',	'2016-09-29 05:30:50',	0,	0),
