(273,	201,	157,	'Hi Arahata,<div>\n</div><div>You can use other meshing tools like Gmsh to create a mesh file and later import the mesh using appropriate command. You can refer the following tutorial which should help you in defining boundary patches and importing the mesh file: </div><div>http://spoken-tutorial.org/watch/OpenFOAM/Creating%2Ba%2Bsphere%2Bin%2BGMSH/English/</div><div>\n</div><div>Regards,</div><div>Viraj Belekar</div>',	'2016-10-19 05:15:36',	'2016-10-19 05:15:36',	0,	0),
(274,	201,	158,	'Hello,<div>\n</div><div>I think the simulation is running correctly. There might be some mistake in the file which you are using to create GNUplot.</div><div>\n</div><div>Regards,</div><div>Viraj</div>',	'2016-10-19 05:22:55',	'2016-10-19 05:22:55',	0,	0),
(275,	201,	159,	'Hello,<div>\n</div><div>\'Plot over line\' option should be there in the \'Data Analysis\' option in the \'Filters\' drop-down menu. It should not be greyed out if there are proper simulation results available for plotting.</div><div>Regards</div>',	'2016-10-21 05:22:58',	'2016-10-21 05:22:58',	0,	0),
(276,	90,	160,	'You need to provide more information. For now, you can explore these functions- https://help.scilab.org/docs/6.0.0/en_US/section_bfaba9753eea8655622536c43c9371f4.html\n',	'2016-10-26 11:36:07',	'2016-10-26 11:36:07',	0,	0),
