(278,	201,	163,	'Hello <a href=\"http://forums.fossee.in/accounts/view-profile/206\">francesco.ciani88</a>,<div>\n</div><div>1) You can test OpenFOAM installation by running an inbuilt tutorial for any OpenFOAM solver.</div><div>\n</div><div>2) ParaView is the best compatible post-processing tool to view the results of your simulation. Highly Recommended.</div><div>\n</div><div>3) Of course, following the tutorial is the best way to learn. You can also find some documentation for fireFoam solver on Google.</div><div>\n</div><div>Regards,</div><div>Viraj</div>',	'2016-11-02 04:23:20',	'2016-11-02 04:23:20',	0,	0),
(279,	201,	162,	'Hi,<div>\n</div><div>Vortex shedding occurs when the flowfield becomes asymmetric. There might be a number of reasons for not getting vortex shedding. Some of them might be:\n\n1) Low Re</div><div>2) ambiguity in fvSchemes and fvSolution files, etc.</div><div>\n</div><div>You ma refer discussion on this thread to get an idea for the same: <a href=\"http://www.cfd-online.com/Forums/openfoam-solving/63082-what-best-way-get-vortex-shedding.html\" title=\"Vortex shedding\" target=\"_blank\">Vortex shedding</a></div>',	'2016-11-02 04:37:57',	'2016-11-02 04:37:57',	0,	0),
