(289,	220,	170,	'Hi <a href=\"/accounts/view-profile/219\" style=\"background-color: rgb(239, 227, 227);\">Vijay_Karthik</a><div>\n</div><div>Assuming you\'re running under a Linux-Like system (including MacOS), the way I\'m doing that is simply by using the \"host\" function.</div><div>if your C program is called \"myProgram\" expecting two inputs let\'s say \"a\" &amp; \"b\"</div><div>then something like</div><div>host(\'./myProgram a b\')</div><div>should work.</div><div>Let us know</div>',	'2016-11-16 12:36:17',	'2016-11-16 12:36:17',	0,	0),
