(317,	243,	176,	'<p>Suppose I created these 2 files and I want to combine them. (rand command creates a random matrix of the given dimension)</p><p> A=rand(10,10) <br></p><p>B=rand(10,5) <br></p><p>write_csv(A,\'1.txt\') <br></p><p>write_csv(B,\'2.txt\') <br></p><p>Now I have to load both these files by read_csv and operate on it to join the matrix as follows <br></p><p>C=read_csv(\"1.txt\") <br></p><p>D=read_csv(\"2.txt\") <br></p><p>In our case, since we have same number of rows in both the matrix we can join them by row as follows, <br></p><p>E=[C,D] <br></p><p>You can export the E matrix as csv file like as follows: <br></p><p>write_csv(A,\'3.txt\')</p>',	'2017-01-10 10:35:13',	'2017-01-10 10:36:05',	0,	0),
