(320,	201,	197,	'<p>Hello,</p><div></div><div>I would suggest that you export your CAD Model in .stl format to be used in OpenFOAM. You can use snappyHexMesh for meshing in OpenFOAM. You can refer to the tutorials on snappyHexMesh on this link: <a href=\"http://spoken-tutorial.org/tutorial-search/?search_foss=OpenFOAM&amp;search_language=\" target=\"_blank\" title=\"OpenFOAM Spoken Tutorials\">OpenFOAM Spoken Tutorials</a> . You can use the <span style=\"background-color: rgb(249, 246, 246); color: rgb(0, 0, 0); font-family: HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, &quot;Lucida Grande&quot;, sans-serif;\">Spalart Allmaras turbulence model by specifying the same in&nbsp;<b></b></span><font color=\"#000000\" face=\"HelveticaNeue, Helvetica Neue, Helvetica, Arial, Lucida Grande, sans-serif\"><b>turbulenceProperties&nbsp;</b>dictionary in the <b>constant&nbsp;</b>folder of your test case.</font></div><div><font color=\"#000000\" face=\"HelveticaNeue, Helvetica Neue, Helvetica, Arial, Lucida Grande, sans-serif\"><br></font></div><div><font color=\"#000000\" face=\"HelveticaNeue, Helvetica Neue, Helvetica, Arial, Lucida Grande, sans-serif\"></font></div><div><font color=\"#000000\" face=\"HelveticaNeue, Helvetica Neue, Helvetica, Arial, Lucida Grande, sans-serif\">Regards</font></div><div><font color=\"#000000\" face=\"HelveticaNeue, Helvetica Neue, Helvetica, Arial, Lucida Grande, sans-serif\">Viraj Belekar</font></div><p></p>',	'2017-01-16 08:59:38',	'2017-01-16 09:00:59',	0,	0),
