(328,	215,	199,	'<p>In \"<b>wikipedia</b>\" the infinite is defined as <i>something without any bound or larger than any number.</i>But in the computation, the program needs a value to do the calculations. One can not touch or reach infinity but for his own satisfaction he goes to a maximum extent. By using this, one can select a maximum value to solve the given problem. I am considering the <b>10^25</b> as the maximum extent for <b>exp(at)</b> where <b>a</b>&gt; 0. With the maximum value we can find the \"<b>t</b>\" in the following way exp(at) = 10^25, t = 25*log(10)/a. By using this \"<b>t</b>\" value we can solve the plotting problem. I am writing a simple code about it and hoping that it will be the right answer.</p><pre style=\"font-family:Monospaced;font-style:normal;font-size:12.0;\"><span style=\"color:rgb(176,24,19);\">function</span> <span style=\"color:rgb(0,0,0);text-decoration:underline;\">Exp</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(131,67,16);font-weight:bold;\">a</span><span style=\"color:rgb(74,85,219);\">)</span>\\n    <span style=\"color:rgb(0,0,0);\">t</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">25</span><span style=\"color:rgb(92,92,92);\">*</span><span style=\"color:rgb(50,185,185);\">log</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(188,143,143);\">10</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(92,92,92);\">/</span><span style=\"color:rgb(131,67,16);font-weight:bold;\">a</span>\\n    <span style=\"color:rgb(0,0,0);\">t</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(50,185,185);\">ceil</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">t</span><span style=\"color:rgb(74,85,219);\">)</span>\\n    <span style=\"color:rgb(0,0,0);\">time</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(0,0,0);\">t</span><span style=\"color:rgb(92,92,92);\">/</span><span style=\"color:rgb(188,143,143);\">1000</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(0,0,0);\">t</span>\\n    <span style=\"color:rgb(0,0,0);\">s</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(50,185,185);\">poly</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(188,143,143);\">s</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(74,85,219);\">)</span>\\n    <span style=\"color:rgb(0,0,0);\">temptf</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(174,92,176);text-decoration:underline;\">syslin</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(188,143,143);\">c</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(92,92,92);\">/</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">s</span><span style=\"color:rgb(92,92,92);\">+</span><span style=\"color:rgb(131,67,16);font-weight:bold;\">a</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(74,85,219);\">)</span>\\n    <span style=\"color:rgb(0,0,0);\">y</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(174,92,176);text-decoration:underline;\">csim</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(188,143,143);\">step</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">time</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">temptf</span><span style=\"color:rgb(74,85,219);\">)</span>\\n    <span style=\"color:rgb(174,92,176);text-decoration:underline;\">plot</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">time</span><span style=\"color:rgb(74,85,219);\">)</span>\\n<span style=\"color:rgb(176,24,19);\">endfunction</span></pre><p></p>',	'2017-02-06 10:06:10',	'2017-02-14 06:45:51',	0,	0),
