(333,	260,	173,	'<span style=\"font-family: arial, sans-serif; font-size: 12.8px;\"> The issue is that the GUI Builder allows for functions such as fscanfMat to be processed, and can even display their outputs. What it can\'t do is provide an output variable for even the simplest assignments such as f = 1. </span><span style=\"font-family: arial, sans-serif; font-size: 12.8px;\">Perhaps there might be a convoluted way to do so which I am unaware of. But it is clear that there is no direct way of getting an output variable from the GUI builder.</span><div><span style=\"font-family: arial, sans-serif; font-size: 12.8px;\">\n</span></div>',	'2017-02-15 06:38:00',	'2017-02-15 06:38:00',	0,	0),
