(351,	289,	220,	'<p>Thank you for the response. I got the error in Linux Mint 18.1 Serena, with desktop Cinnamon. Detailed info about the kernel: Linux version 4.4.0-66-generic (buildd@lgw01-28) (gcc version 5.4.0 20160609 (Ubuntu 5.4.0-6ubuntu1~16.04.4) ) #87-Ubuntu SMP Fri Mar 3 15:29:05 UTC 2017 <br></p><p>I tried to start ngspice from the terminal and this is working but I can\'t start it from eSim with the simulation button.<br></p><p>If you need more info don\'t hesitate to ask me. Thanks in advance</p>',	'2017-03-23 07:27:15',	'2017-03-23 07:29:25',	0,	0),
(352,	250,	222,	'Hey Subhankar,\n\nI will try to help you out assuming you are using Paraview and assuming that you need to plot the data over a line. \n\n<ol><li>Type paraFoam in the directory of your case \n</li><li>Now in the left-side panel you should see the meshParts and internalFields boxes. Tick internalMesh and the volume fields for U and P in that and click on Apply                                                                                     \n</li><ol><li><img src=\"data:image/png;base64,\" alt=\"\" width=\"146\" height=\"399\"></li></ol><li>Now you should get your geometry rendered in the main Viewport. \n</li><li>Now click on the Plot Over Line button in the Toolbar</li><ol><li><img src=\"data:image/png;base64,\" alt=\"\"></li><li><img src=\"data:image/png;base64,\" alt=\"\"> - This is the PlotOverLine Button. \n</li></ol><li>Click on Apply in the Plot Over Line Toolbox.</li><ol><li> <img src=\"data:image/png;base64,\" alt=\"\" width=\"137\" height=\"388\"></li></ol><li>The Toolbar on the left should now change into this - \n</li><ol><li><img src=\"data:image/png;base64,\" alt=\"\" width=\"135\" height=\"420\"></li><li>Select all the parameters you want to plot and click on Apply. It should plot all the values you need to see. \n</li><li><img src=\"data:image/png;base64,\" alt=\"\" width=\"467\" height=\"262\"></li></ol></ol><p>\n</p><p>I have made certain assumptions about your case. You could let me know if you have any other issues. \n</p><p>\n</p><p>Regards,</p><p>Anmol\n</p>',	'2017-03-27 07:17:51',	'2017-03-27 07:17:51',	0,	0),
