(355,	154,	213,	'I wouldn\'t say that there are very few components... There are more than 600 compounds available right away, and you can now import compounds from web sources too. KDB database has more than 2000 compounds, and the ChEDL Thermo library has 1107 which can be imported to DWSIM. Not to mention the compound creator which you can use to create your own.',	'2017-03-28 14:49:42',	'2017-03-28 14:49:42',	0,	0),
(356,	154,	218,	'Try balancing the reaction by slightly modifying one of the coefficients.',	'2017-03-28 14:53:18',	'2017-03-28 14:53:18',	0,	0),
(357,	154,	195,	'The concept of a tear stream is not used in DWSIM. In some simulators the tear stream is detected automatically, but in DWSIM you must insert a recycle block manually. The two material streams connected to the recycle and the recycle itself would then be the \"tear\" stream in another simulator.',	'2017-03-28 14:56:31',	'2017-03-28 14:56:31',	0,	0),
(358,	65,	223,	'Your question is not very clear.  If the following does not answer your question, please give an example and explain your question:\n\nIn Scilab, y and L have to be defined first before you use them on the right hand side - this is true of any variable.  If this is what you really want, you may consider using OpenModelica (13 Spoken Tutorials on it are available at http://spoken-tutorial.org/tutorial-search/?search_foss=OpenModelica&amp;search_language=English.  \n',	'2017-03-30 01:38:58',	'2017-03-30 01:38:58',	0,	0),
