(361,	201,	227,	'<font face=\"georgia\">Hey,</font><div><font face=\"georgia\">\n</font></div><div><font face=\"georgia\">After running the wallShearStress utility, <span style=\"background-color: rgb(247, 247, 247); color: rgb(0, 0, 0); font-size: 13.3333px;\">load the wall patches (except the internalField) and use the calculator filter on it.</span><span style=\"background-color: rgb(247, 247, 247); color: rgb(0, 0, 0); font-size: 13.3333px;\"> Use the following formula:</span></font></div><div><span style=\"background-color: rgb(247, 247, 247); color: rgb(0, 0, 0); font-size: 13.3333px;\"><font face=\"georgia\">\n</font></span></div><div><span style=\"color: rgb(0, 0, 0); font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><font face=\"georgia\"><b>skin friction coefficient = (2*tauw/(rho*V^2))</b></font></span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"></div>',	'2017-04-03 05:16:50',	'2017-04-03 05:16:50',	0,	0),
