(365,	243,	228,	'<p>Dear chanyau,</p><p> Since this the plot consist of multiple line segments, we cannot plot it with a single plot2d function. Here is how I did it <br></p><p>x1=0:0.5:1; //taking arbitrary x axis data as the x axis in plot above is blank<br></p><p>y1=-40:20:0; // -40 to 0<br></p><p>plot2d(x1,y1) <br></p><p><br></p><p>x2 =1:2; <br></p><p>y2= repmat(0,1,2); <br></p><p>plot2d(x2,y2) //the horizontal line at 0 </p><p><br></p><p>x3 =2:4; <br></p><p>y3 = 0:50:100;</p><p> plot2d(x3,y3); //0 to 100<br></p><p><br></p><p>x4=4:10;</p><p> y4=repmat(100,1,7);</p><p> plot2d(x4,y4) //horizontal line at 100<br></p><p><br></p><p>x5=1:0.5:11; <br></p><p>y5=100:20:140; <br></p><p>plot2d(x1,y1,nax=[-1,0,-1,8])&nbsp; //100 to 140,the -1 in nax removes the ticks in x axis as it is in the plot above<br></p><p><br></p><p>xtitle(\"Temperature vs Heat absorbed\", \"Heat Absorbed\",\"Temperature\") //title and x &amp; y labels<br></p>',	'2017-04-05 06:24:37',	'2017-04-05 06:30:27',	0,	0),
