(380,	205,	236,	'Here is the link for sample flow sheet where multi-component distillation is carried out: http://dwsim.fossee.in/flowsheeting-project/dwsim-flowsheet-run/13.\n\nClick on the Download flowsheet link and run the Petroleum Distillation file with .dwxmz extension.\n',	'2017-04-26 04:49:20',	'2017-04-26 04:49:20',	0,	0),
(381,	201,	235,	'Hi,<div>\n</div><div>OpenFOAM is not an animation software which will show you the automated movement of your gate. You can analyze the motion of concrete. I suggest you refer to the damBreak tutorial of interFoam solver for your case. Make an inlet patch. There is no need for your gate to open and close.</div><div>\n</div><div>Regards</div><div>Viraj Belekar</div>',	'2017-04-26 06:03:43',	'2017-04-26 06:03:43',	0,	0),
(382,	201,	234,	'Hi Ashok,<div>\n</div><div>1) Courant number = ut/x</div><div>Therefore try playing with these 3 parameters and you should definitely refine your mesh.</div><div>\n</div><div>2) You have assigned noSlip boundary condition on the bottom patch which might hinder your concrete to flow on it. Try changing it.</div><div>\n</div><div>Regards</div><div>Viraj</div>',	'2017-04-26 06:22:08',	'2017-04-26 06:22:08',	0,	0),
(383,	90,	237,	'<p>Please follow these steps 1. At the top of Scilab console, click on Applications menu 2. Choose Variable Browser from the drop down menu 3. Variable Browser will appear in a separate window 4. You should see a black band at the top. On this black band , you will see \'Variable \'Browser\' and a question mark. 5. Click on this black band and drag the window to the Scilab console 6. Move the mouse to add the variable browser at a location of your choice on Scilab console. Repeat the same steps for Command history.</p>',	'2017-05-01 16:33:46',	'2017-05-01 16:34:15',	0,	0),
