(388,	224,	241,	'<p></p><div>OK, I found an error within my script and the \"abort\"-command works again but only more or less... See for instance the following code:</div><div><br></div><div>clear;</div><div>A = 2;</div><div>B = 5;</div><div>abort;</div><div></div><div>C = 8;</div><div><br></div><div>Before I run the script in the freshly started Scilab I can use the Console normally - hence, If I write A = 2 and hit return it creates the variable and displays the value of A in the console window.</div><div><br></div><div>If I run the script I only see that it was performed but I do not see any new variables in the variable-browser. Only after, for instance, typing a 1 in the console window and hitting return I see that the script actually did something, as A and B are defined (C is not, as it is supposed to be).</div><div>However, now after having run the script I cannot use the Console-Window properly anymore.. I still can use it to define variables or perform calculations but the results are never displayed in the console. It is if every command I input would have the \";\" at the end.... This is annoying, as only rebooting Scilab helps in that case..</div><div></div><div>Maybe if it helps, here is what the console displays upon Scilab-Startup:</div><div><br></div><div>Starte Ausfuehrung:</div><div>lade Startumgebung</div><div></div><div>START GUI Builder 4.0.1 for Scilab 6.0</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load macros</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load help</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Type \"guibuilder\" to start the GUI</div><div><br></div><div></div><div>Start IPCV 1.0 for Scilab 6.0</div><div>Image Processing and Computer Vision Toolbox for Scilab</div><div>Copyright (C) - 2017 - Tan Chin Luh (Trity Technologies)</div><div>Find more information at http://scilabipcv.tritytech.com</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load macros</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load dependencies</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load gateways</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load help</div><div><span class=\"Apple-tab-span\" style=\"white-space:pre\"></span>Load demos</div><div><br></div><div></div><div>Thanks already for your help!!</div><p></p>',	'2017-05-09 09:20:18',	'2017-05-09 09:20:50',	0,	0),
