(402,	90,	255,	'<p>In <b>Routine A,</b> if you comment the line- blackwhite=image;, you\'ll get comparable results. When I ran the code after commenting the line, I got the run time to be either equal or routine B run time was higher than routine A. <br></p><p>The code I\'ve used is given below</p><pre style=\"font-family: Monospaced; font-size: 12px;\">//This was declared on the console<br><br><font face=\"courier new\">image=rand(5,1000); <br>image1=image; <br>threshold=</font><font face=\"courier new\">0.4;<br><br></font><font face=\"courier new\">//Routine A was saved in a separate file <br>t1=tic()<br>for i=1:length(image)<br>        if image(i) &lt; threshold then<br>            image(i) = 0;<br>        else<br>            image(i) = 1;<br>        end<br>        //blackwhite = image;<br>end<br>t2=toc()<br>disp(t2)<br><br></font><font face=\"courier new\">//Rotuine B was saved in a separate file<br>t3=tic()<br>for y=1:length(image1(:, 1)) <br>    for x=1:length(image1(1, :))<br>        if image1(y, x) &lt; threshold then<br>            blackwhite(y, x) = 0;<br>        else<br>            blackwhite(y, x) = 1;<br>            <br>        end<br>    end<br>end<br>t4=toc();<br>disp(t4)<br></font><span style=\"color:rgb(92,92,92);\"></span><span style=\"color:rgb(0,0,0);\"></span><span style=\"color:rgb(0,0,0);\"></span></pre><p><br></p>',	'2017-06-06 07:04:49',	'2017-06-06 07:10:04',	0,	0),
