(424,	205,	280,	'<div style=\"\">First of all, there is no deadline to apply for this \r\nproject. So, you can apply anytime. However the sooner you apply, earlier will be the chance for your contribution to be recognized by FOSSEE, IIT Bombay. In any case, we have deadline for \r\nsubmitting the flowsheet after you have submitted proposal which is \r\ntypically one month from the date of submission of proposal.<br style=\"\"></div><br style=\"\"><div style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT108_com_zimbra_url\" style=\"\">H</span>ere are the detailed steps to participate in flowsheeting project.</div><ol><li>Register yourself at FOSSEE DWSIM using: <span class=\"Object\" id=\"OBJ_PREFIX_DWT170_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT371_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT90_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/user/register\" style=\"\">http://dwsim.fossee.in/user/register</a></span></span></span></li><li>Once registered, login using <span class=\"Object\" id=\"OBJ_PREFIX_DWT171_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT372_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT91_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/user\" style=\"\">http://dwsim.fossee.in/user</a></span></span></span></li><li>Submit a proposal using the flowsheeting proposal link: <span class=\"Object\" id=\"OBJ_PREFIX_DWT109_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT373_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT92_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/flowsheeting-project/proposal\" style=\"\">http://dwsim.fossee.in/flowsheeting-project/proposal</a></span></span></span></li><li>Once proposal is received by us and approved, you can upload your flowsheet and a short abstract here: <span class=\"Object\" id=\"OBJ_PREFIX_DWT110_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT374_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT93_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/flowsheeting-project/abstract-code/upload\" style=\"\">http://dwsim.fossee.in/flowsheeting-project/abstract-code/upload</a></span></span></span></li><li>Submitted flow sheet will be published in DWSIM FOSSEE webpage after it is reviewed by technical team.</li><li>Please check for the detailed guidelines to create flow sheet in this link: <span class=\"Object\" id=\"OBJ_PREFIX_DWT111_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT375_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT94_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/flowsheeting-project/coding-guidelines-flowsheeting\" style=\"\">http://dwsim.fossee.in/flowsheeting-project/coding-guidelines-flowsheeting</a></span></span></span></li><li>Also, few sample flow sheets have been made available in the link here: <span class=\"Object\" id=\"OBJ_PREFIX_DWT112_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT376_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT95_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/flowsheeting-project/completed-flowsheet\" style=\"\">http://dwsim.fossee.in/flowsheeting-project/completed-flowsheet</a></span></span></span></li><li>Completing a flow sheet with the mentioned guidelines will be awarded with prize money and certificate from FOSSEE, IIT Bombay.\n</li></ol><div style=\"\"> \nDetailed information about how to apply for this activity is also available on <span class=\"Object\" id=\"OBJ_PREFIX_DWT107_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT369_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT96_com_zimbra_url\"><a target=\"_blank\" href=\"http://dwsim.fossee.in/flowsheeting-project\" style=\"\">http://dwsim.fossee.in/flowsheeting-project</a></span></span></span><br style=\"\"><br style=\"\">You can get started by learning DWSIM from our spoken tutorials here: <span class=\"Object\" id=\"OBJ_PREFIX_DWT108_com_zimbra_url\" style=\"\"><span class=\"Object\" id=\"OBJ_PREFIX_DWT370_com_zimbra_url\" style=\"\"><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT97_com_zimbra_url\"><a target=\"_blank\" href=\"http://spoken-tutorial.org/tutorial-search/?search_foss=DWSIM&amp;search_language=English\" style=\"\">http://spoken-tutorial.org/tutorial-search/?search_foss=DWSIM&amp;search_language=English</a></span></span></span> </div><br style=\"\">In case of any queries, please feel free to revert back to us. We will be happy to guide you.',	'2017-08-08 03:53:13',	'2017-08-08 03:53:13',	0,	0),
