(432,	205,	283,	'<p></p><p>Dear Akash, Honorarium details for DWSIM Textbook Companion has been updated. Please click <a href=\"http://dwsim.fossee.in/textbook-companion/tbc-honorarium\" target=\"_blank\" title=\"\">here</a>. If you are looking to how to apply for TBC, kindly check <a href=\"http://dwsim.fossee.in/textbook-companion/textbook-companion-internship\" target=\"_blank\" title=\"\">here</a>. Guidelines for coding are mentioned <a href=\"http://dwsim.fossee.in/textbook-companion/guidelines-coding\" target=\"_blank\" title=\"\">here</a>. <br></p><p>Also, we would like to inform about the recently launched project named \"<a href=\"http://dwsim.fossee.in/flowsheeting-project\" target=\"\" title=\"\">DWSIM Flowsheeting Project</a>\" where one can take up any flowsheet from any source and simulate using DWSIM. Honorarium, certificates and exciting prizes will be awarded to the contributors. For more details about how to participate in this project, kindly click <a href=\"http://dwsim.fossee.in/flowsheeting-project\" target=\"\" title=\"\">here</a>. In case of any queries, kindly feel free to revert back to us.</p><p></p>',	'2017-08-21 08:49:46',	'2017-08-31 07:06:28',	0,	0),
