(434,	390,	221,	'<p>Hi...i am a new user here. According to me the active simulation profile refers to other schematic. Not the one you trying to simulate. Try to search the simualiton profiles for the current schematic and make that active with RMB \"Make active\". All of these can be found in the Pspice resources folder of the Project manager.</p><p><br></p><p><a href=\"https://www.7pcb.com/Prototype-PCB-Assembly.php\" title=\"\" target=\"\">pcb assembly prototype</a></p>',	'2017-08-30 16:52:15',	'2017-09-15 21:00:18',	0,	0),
