(449,	205,	295,	'<p>The link for spoken tutorial videos related to DWSIM can be found <a href=\"http://spoken-tutorial.org/tutorial-search/?search_foss=DWSIM&amp;search_language=English\" title=\"\" target=\"_blank\">here</a>.<br></p>',	'2017-10-09 05:57:54',	'2017-10-09 05:58:58',	0,	0),
(451,	65,	299,	'I am happy that you chose to post this \"Scilab\" question in the \"Python\" forum.  The reason is that Python is more suitable to computer programmers like you.  \n\nScilab is likely to have a lot more \"application\" type of libraries, compared to Python.  Scilab is more like Matlab than Python is.  But both of these advantages are not relevant to you.  On the other hand, it is possible to do all kinds of programming in Python: starting from device level communication to fancy application programming.  \n\nFinally, there are a lot of employment opportunities for those who know Python.  Because of all these,  please consider Python programming.  All the projects that I mentioned about Scilab are available for Python also.  For example, contribute a Python textbook companion.  If you are already good in Python, get into advanced activities like Django programming.  If you are good in Python programming, we will be interested in giving an internship or a full time job to you.\n\nBest wishes,\nKannan\n',	'2017-10-13 02:17:39',	'2017-10-13 02:17:39',	0,	0),
(452,	257,	256,	'Hello Lalit,\n\nThe \"function not defined\" error occurs when you try to call a function without loading it. The \"getd\" command in the start.sce file is probably failing. This will happen if the \"common_files\" folder is moved from its place. It is difficult to know the exact reason given the limited info in your question.\n\nI suggest you follow the manual way of executing the code as explained in the spoken tutorial and the SBHS manual, before you begin using \"start.sce\" file.\n\nRupak\n',	'2017-10-13 12:14:46',	'2017-10-13 12:14:46',	0,	0),
(453,	215,	301,	'Hi Prashant, after reading list of your questions/doubts , it seems like you are very enthusiastic about \"Scilab\". It is an open source software so you can use your creativity to build new functions that will help you as well as others. It helps Engineering students in many ways and Kannan sir gave some of the very good examples in his live video. It will and it can be a helpful computational software for the PHARMACY students. Up to my understanding, in Pharmacy ,there must be a problem statement. That statement will have a well define model which may be intuitive or mathematical . Now, the creativity part comes here. You can write those models as Scilab functions and can create a new tool box for whole Pharmacy community. For \"TBC\" you can propose the book and Sir gave all the details about \"How the TBC works\". You can put your problem statement and we can figure out the best way to solve the problems of the \"New Subject\".       ',	'2017-10-13 19:00:09',	'2017-10-13 19:00:09',	0,	0),
