(464,	205,	311,	'<p>DWSIM is a steady state process simulator. However, you can also perform the dynamic simulation in DWSIM with help of python scripting. Click <a href=\"http://dwsim.inforside.com.br/wiki/index.php?title=Dynamic_Simulation_Tutorial_with_DWSIM_and_Python,_Part_1:_Concepts_and_Steady-State_Model\" target=\"_blank\" title=\"\">here</a> for the dynamic simulation tutorial. <br></p><p>Also, there isn\'t any module present in DWSIM for osmosis. However, DWSIM allows the user to create custom unit operation with the help of python scripting.</p>',	'2017-10-31 05:26:22',	'2017-10-31 05:27:04',	0,	0),
(465,	205,	292,	'<p>Not clear about what you want exactly. However, if you are looking for ternary envelopes, DWSIM allows creating Ternary Phase envelope. This can be done from Utilities option by selecting object type as \"Material Stream\" and then selecting the desired material stream for which you desire to create the ternary envelope.</p>',	'2017-10-31 05:39:16',	'2017-10-31 05:39:59',	0,	0),
(466,	205,	291,	'Not clear about what you want exactly. However, if you are looking for ternary envelopes, DWSIM allows creating Ternary Phase envelope. This can be done from Utilities option by selecting object type as \"Material Stream\" and then selecting the desired material stream for which you desire to create the ternary envelope.',	'2017-10-31 05:40:55',	'2017-10-31 05:40:55',	0,	0),
(467,	205,	290,	'<p>DWSIM doesn\'t have any existing unit operation to simulate a spray dryer. Alternatively, the user can create custom unit operation for spray dryer using python scripting. <br></p><p>DWSIM is also CAPE-OPEN compliant simulator. In case any other CAPE-OPEN compliant simulator has got spray drier, it can be used in DWSIM by selecting CAPE-OPEN Unit Operation from the flowsheet objects.</p>',	'2017-10-31 05:46:42',	'2017-10-31 05:47:32',	0,	0),
(468,	205,	310,	'Developing any model in OpenModelica would require the knowledge of equations and variables that govern the working of that model. Probably, you can perform some literature survey on the equations that are used in modelling the spark plug.\n\nAlternatively, did you check the existing native libraries in OpenModelica? If any such model is available, then you can drag &amp; drop and use it in your ignition system.\n',	'2017-10-31 11:27:46',	'2017-10-31 11:27:46',	0,	0),
(469,	266,	312,	'Dear Sheena,\n\nBefore simulation there is a step called Kicad to Ngspice conversion, where Kicad files are converted to Ngspice format. Please ensure that this step is done successfully. The files \'plot_data_i.txt\' and \'plot_data_v.txt\' are created here. If successful, a dialog box will appear which reads Kicad to Ngspice conversion done successfully.\n\nRegards,\nAthul George\n',	'2017-11-02 05:27:54',	'2017-11-02 05:27:54',	0,	0),
(470,	434,	312,	'Thank you Athul for your prompt reply.<div>I have done the Kicad to Ngspice conversion step and the dialog box with the message \" Kicad to Ngspice conversion successful\" also appears but stil the problem remains. You can also see the console details in the previous message that Kicad to Ngspice conversion was done. Can it be due to  an installation issue?</div>',	'2017-11-02 05:53:53',	'2017-11-02 05:53:53',	0,	0),
