=\"color:rgb(74,85,219);\">)</span>\r\n<span style=\"color:rgb(0,0,0);\">data</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(0,0,0);\">data</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">j</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(255,170,0);\">$</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(50,185,185);\">figure</span><span style=\"color:rgb(0,0,0);\">;</span><span style=\"color: rgb(174, 92, 176); text-decoration-line: underline;\">clf</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(0,0,0);\">;</span><span style=\"color:rgb(50,185,185);\">plot2d3</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">data</span><span style=\"color:rgb(74,85,219);\">)</span></pre></div></blockquote><div> Please elaborate you problem if above solution is not working.</div></div>',	'2017-11-08 15:18:14',	'2017-11-08 15:18:14',	0,	0),
