(479,	437,	318,	'Hi Sheena,<div>\n</div><div>Try connecting different GND connection for the voltage sources. Otherwise they will act as short circuit causing error.</div><div>Since you are editing the component value of  diode, no need of adding D.lib libraries at Device modeling. Choose either of them.</div><div>If you are connecting the pulse to the Gate of SCR, then the other end has to be connected to Gnd.</div><div>If  you still get the error, Please send the snapshot of the schematic to <span style=\"font-family: arial, sans-serif; font-size: 12.8px; font-weight: bold; line-height: normal; white-space: nowrap;\">contact-esim@fossee.in.</span></div>',	'2017-11-10 12:39:38',	'2017-11-10 12:39:38',	0,	0),
