(481,	97,	319,	'Hi Akshaya,<div>\n</div><div>You have to upload the eSim project files along with an abstract of the work. The upload module is under testing and will be made live today. Please upload the files after that. The inconvenience caused is regretted.</div><div>\n</div><div>\n</div>',	'2017-11-13 05:21:39',	'2017-11-13 05:21:39',	0,	0),
(482,	437,	315,	'Hello Sounndarrajan.V,<div>\n</div><div>Try to use place junction to connect the component.</div><div>Sometimes, when you connect a wire, the end wire part would be incomplete. So placing a junction ensures the connection is present between the components.</div><div>\n</div><div>Your second query about the eSim libraries<span style=\"line-height: 1.42857;\">:</span></div><div><span style=\"line-height: 1.42857;\">You can add libraries manually, </span></div><div><span style=\"line-height: 1.42857;\"><b>Preferences--&gt; Component Libraries --&gt; Choose from c: user/share/Kicad/Library and then press add.</b></span></div><div><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; line-height: normal;\"></div><div>\n</div>',	'2017-11-13 07:20:42',	'2017-11-13 07:20:42',	0,	0),
