(488,	437,	322,	'Hello,<div>\n</div><div>I tried to Install on windows 7. It is getting installed. There were no issues. You will get following messages, when you run the setup file as administrator.</div><div>Installing Python, </div><div><span style=\"line-height: 1.42857;\">Installing </span><span style=\"line-height: 0.2in;\">pyqt4</span></div>\r\n	\r\n	\r\n	\r\n\r\n\r\n\r\n<p style=\"margin-bottom: 0in; line-height: 0.2in;\"><span style=\"line-height: 1.42857;\">Installing </span>matplotlib</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.2in;\"><span style=\"line-height: 1.42857;\">Installing </span>numpy</p>\r\n<p style=\"margin-bottom: 0in; line-height: 0.2in;\"><span style=\"line-height: 1.42857;\">Installing </span>kicad</p>\r\n<p>Then you need to run(open) the Application.py. <span style=\"line-height: 1.42857;\">The eSIm window will open.</span></p><p><span style=\"line-height: 20px;\">Go through the instruction sheet of installing on windows in Esim website.</span></p><p><span style=\"line-height: 20px;\">The url is: </span>http://esim.fossee.in/esim_on_windows</p><p>\r\n\n\r\nRegards,\r\n\r\n</p><p>Gloria N</p><p>\n</p>',	'2017-11-15 15:00:49',	'2017-11-15 15:00:49',	0,	0),
(489,	421,	304,	'    <div>    Hello Gloria,</div><div>    Thanks a lot for your dedication.I did what you have told.It didn\'t solve my problem.This time, I removed esim and reinstalled but result was       same.Please did you notice what i mentioned in my post as\" <span style=\"background-color: rgb(249, 246, 246); color: rgb(38, 25, 189); font-family: arial, sans-serif; font-size: 12.8px;\">I see the setup.exe file which i get after unzipping your esim software,is only 7,517KB in size,while the   same setup.exe file is 50,679KB in size,as seen on your installation instructions for windows.\" Pl, consider it.You know why i insist on this? In the installation process,in its step where the software asks my permission to select the elements which are required installation,I see only NGSPICE selected or checked.So i think  the software package I received,is only having NGSPICE components.</span></div><div><span style=\"background-color: rgb(249, 246, 246); color: rgb(38, 25, 189); font-family: arial, sans-serif; font-size: 12.8px;\"> Best regards,</span></div><div><span style=\"background-color: rgb(249, 246, 246); color: rgb(38, 25, 189); font-family: arial, sans-serif; font-size: 12.8px;\"> Telegenic. </span></div><div>\n</div><div style=\"text-align: center;\">\n</div><div>\n</div><div>\n</div><div>\n</div>',	'2017-11-19 02:34:24',	'2017-11-19 02:34:24',	0,	0),
(490,	421,	304,	'<div style=\"background-color: rgb(249, 246, 246);\">Hello Gloria,</div><div style=\"background-color: rgb(249, 246, 246);\">Thanks a lot for your dedication.I did what you have told.It didn\'t solve my problem.This time, I removed esim and reinstalled but result was same.Please did you notice what i mentioned in my post as\" <span style=\"color: rgb(38, 25, 189); font-family: arial, sans-serif; font-size: 12.8px;\">I see the setup.exe file which i get after unzipping your esim software,is only 7,517KB in size,while the same setup.exe file is 50,679KB in size,as seen on your installation instructions for windows.\" Pl, consider it.You know why i insist on this? In the installation process,in its step where the software asks my permission to select the elements which are required installation,I see only NGSPICE selected or checked.So i think the software package I received,is only having NGSPICE and PYTHON components.Don\'t think i am teaching you,this is what i think.I hope you may reply me.</span></div><div style=\"background-color: rgb(249, 246, 246);\"><span style=\"color: rgb(38, 25, 189); font-family: arial, sans-serif; font-size: 12.8px;\">Best regards,</span></div><div style=\"background-color: rgb(249, 246, 246);\"><span style=\"color: rgb(38, 25, 189); font-family: arial, sans-serif; font-size: 12.8px;\">Telegenic.</span></div>',	'2017-11-19 02:46:07',	'2017-11-19 02:46:07',	0,	0),
(491,	437,	315,	'<p></p><p>Hello Sounndarrajan, <br></p><p>Please give the error statement along with the type. <br></p><p>Usually the <b>ErrType(3) is: pin connected to some other pins but no pin to drive it.</b> <br></p><p>Then, you need to add <b>PWR_FLAG</b> to indicate that these are power ports. For any power ports used, you need to add PWR_FLAG. <br></p><p>All the best...</p><p></p>',	'2017-11-19 09:05:48',	'2017-11-19 09:07:33',	0,	0),
(492,	437,	315,	'<p>Hello, <br></p><p>Yes, for any power source (Vcc, Gnd) you need to add PWR_FLAG to indicate these are power ports.</p>',	'2017-11-19 09:51:29',	'2017-11-19 09:51:48',	0,	0),
(493,	437,	315,	'<p>Hello Sounndarrajan, <br></p><p>Since you are using Op-amp (lm741). Try to add component form eSim_Subckt devices.</p><p> In <b>eSim_Subckt</b> devices, it is referred as <b>ua741</b>. <br></p><p>* Remember, once you convert kicad-ngspice, don\'t forget to add the <b>path of subcircuit </b>used.</p><p><br></p><p> For <u><i><b>output plot</b></i></u>: you can choose component from<b> eSIm_Plot</b>, based on what kind of output you need to plot (log, v, i, phase).</p>',	'2017-11-19 10:25:50',	'2017-11-19 10:26:40',	0,	0),
(494,	437,	315,	'<p></p><p></p><div align=\"justify\">Hello,&nbsp;</div><div align=\"justify\">When you do <b>Kicad-Ngspice</b> conversion, along with analysis, source details, there is a <b>Subcircuits tab</b>.<br>Click on it. You will get <b>add</b> button. <br>Click on it and explore the available sub-circuits.</div><p></p><p></p>',	'2017-11-19 10:46:04',	'2017-11-20 05:54:55',	0,	0),
(495,	437,	304,	'<p>Hello Nandasena,</p><div></div><div>Thank you for your reply.<span style=\"background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">Most of the files got updated on 2016, including eSim setup file. And most of the&nbsp;</span><span style=\"line-height: 20px;\">dependencies&nbsp;</span><span style=\"line-height: 1.42857;\">are part of setup file.</span></span><span style=\"line-height: 1.42857;\"></span><span style=\"line-height: 1.42857;\">I downloaded the eSim windows installer, and reinstalled.</span><span style=\"line-height: 1.42857; background-color: rgb(249, 246, 246);\">There were no issues.</span><span style=\"line-height: 1.42857; background-color: rgb(249, 246, 246);\">You will get following messages, when you run the setup file as administrator.</span></div><div><div style=\"background-color: rgb(249, 246, 246);\">Installing Python,</div><div style=\"background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">Installing&nbsp;</span><span style=\"line-height: 0.2in;\">pyqt4</span></div><p style=\"margin-bottom: 0in; line-height: 0.2in; background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">Installing&nbsp;</span>matplotlib</p><p style=\"margin-bottom: 0in; line-height: 0.2in; background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">Installing&nbsp;</span>numpy</p><p style=\"margin-bottom: 0in; line-height: 0.2in; background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">Installing&nbsp;</span>kicad</p><p style=\"background-color: rgb(249, 246, 246);\">Then you need to run(open) the Application.py. <span style=\"line-height: 1.42857;\">The eSIm window will open.</span></p><p style=\"background-color: rgb(249, 246, 246);\">Go through the instruction sheet of installing on windows in Esim website.</p><p style=\"background-color: rgb(249, 246, 246);\">The url is:http://esim.fossee.in/esim_on_windows</p><p style=\"background-color: rgb(249, 246, 246);\">And sorry for the delayed response.</p><p style=\"background-color: rgb(249, 246, 246);\">Regards,</p><p style=\"background-color: rgb(249, 246, 246);\">Gloria N</p></div><p></p>',	'2017-11-23 10:07:56',	'2017-11-23 10:08:59',	0,	0),
(496,	437,	318,	'Hi Sheena, <div>\n</div><div>Try to use D.lib from add device rather than UserDiode.lib.</div><div>Let me know the result.</div><div>\n</div><div>Regards,</div><div>Gloria N</div>',	'2017-11-27 10:09:54',	'2017-11-27 10:09:54',	0,	0),
(497,	437,	322,	'<p>Hello,</p><div></div><div>Sometimes due to antivirus, eSim may not get install.</div><div>So, disable it during eSim installation.</div><div>Then run eSim as administrator.</div><div>Once installed, run Application.py</div><div>Or use the command&nbsp;<span style=\"color: rgb(0, 0, 0); font-family: Monaco, Menlo, Consolas, \'Courier New\', monospace; font-size: 16px; line-height: 21.1654px; orphans: 1;\">python Application.py</span></div><div></div><div>Let me know the results.</div><div></div><div>Regards,</div><div>Gloria N</div><p></p>',	'2017-11-27 10:13:13',	'2017-11-27 10:14:28',	0,	0),
(498,	437,	315,	'Hello,<div>\n</div><div>Like I said, most of the components of kicad, will not be recognized in ngspice.</div><div><span style=\"line-height: 1.42857;\">It is preferable  to use the </span><span style=\"line-height: 20px;\">components</span><span style=\"line-height: 1.42857;\"> named under eSIm.</span></div><div><span style=\"line-height: 1.42857;\">If you are using Opamp-741, then you have to choose it from eSim-Subckt option.</span></div><div><span style=\"line-height: 1.42857;\">In eSim-Subckt is is labelled as ua741. You can choose that.</span></div><div><span style=\"line-height: 1.42857;\">\n</span></div><div><span style=\"line-height: 1.42857;\">Regards,</span></div><div><span style=\"line-height: 1.42857;\">Gloria</span></div><div><span style=\"line-height: 1.42857;\">\n</span></div>',	'2017-12-04 05:58:58',	'2017-12-04 05:58:58',	0,	0),
(499,	437,	328,	'Hello Soundarrajan,<div>\n</div><div>Ngspice will not recognize all the components of Kicad. </div><div>It recognizes the components that are labelled using eSim.</div><div>If you are using Opamp- 741, you need to choose it from the eSim-Subckt option available in \"Place the component \".</div><div>In eSim-Subckt, it is labelled as ua741.</div><div>\n</div><div>Regards,</div><div>Gloria N</div>',	'2017-12-04 06:07:23',	'2017-12-04 06:07:23',	0,	0),
