(505,	437,	332,	'Hello Amolbedarkar,<div>\n</div><div>You will get following messages, when you run the setup file as an administrator.</div><div>Installing Python, pyqt4, matplotlib, numpy, kicad. Then run(open) the <b>Application.py</b>. </div><div>The eSim window will open. (Sometimes due to antivirus also, eSim will not load properly. Deactivate antivirus and then install eSim )</div><div>Sometimes the Kicad libraries will not load by default. You need to do it manually in eeschema.</div><div>Go to <b>Preferences --&gt; Component Libraries --&gt; </b>and select<b> Add or Insert</b> and choose the path <b>/usr/share/kicad/library  .</b></div><div>Please let me know whether the problem is resolved or not.</div><div>\n</div><div>Regards,</div><div>Gloria N</div><div> \n<div><div style=\"background-color: rgb(249, 246, 246);\">\n</div></div></div>',	'2017-12-09 16:57:53',	'2017-12-09 16:57:53',	0,	0),
(506,	437,	332,	'Hello <span style=\"background-color: rgb(249, 246, 246);\">Amolbedarkar,</span><div><span style=\"background-color: rgb(249, 246, 246);\">\n</span></div><div><span style=\"background-color: rgb(249, 246, 246);\">May I know, what error you are getting.  If you are opening eSim and choosing create new project </span><img src=\"https://lh5.googleusercontent.com/OU8e__pbwJzkSSNHCIVeagEZbw27AB6iIv1BkY6JO8NTbRVqx8RPovHCrlKvvaLfyCNocQaDu0vsU9oyolvDv0PO7_rAvbtRCDO_j020dGsDVEQ6CXFHcnZwY_wEZjsUd654x_zY\" width=\"37\" height=\"30\" style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 10pt; white-space: pre-wrap; line-height: 1.42857; border-style: none; border-width: initial; transform: rotate(0rad);\"><span style=\"line-height: 1.42857; background-color: rgb(249, 246, 246);\">(first icon on the left toolbar of eSim), then it will direct to eeshema, where you create a project.</span></div><div><span style=\"background-color: rgb(249, 246, 246);\">If you are opening kicad and then creating new project, then you have to load the project into eSim by choosing open a project </span><span style=\"line-height: 1.42857;\"> </span><img src=\"https://lh3.googleusercontent.com/8tUR3qbbsOsXr6pwCA5AfWtzo9FtDdmaBUllKK1GotyiembAZu9wviIaEz5uiWfCDY31n_5HwAU2tXTQlTHaL5iI6ly5q0wuU5oh_UCX5iRZwxRixRp_ENBjwkqR_FiWvpZhFS4m\" width=\"37\" height=\"36\" style=\"color: rgb(0, 0, 0); font-family: Arial; font-size: 10pt; white-space: pre-wrap; line-height: 1.42857; border-style: none; border-width: initial; transform: rotate(0rad);\"> in eSim.</div><div>\n</div><div>\n</div>',	'2017-12-10 13:06:57',	'2017-12-10 13:06:57',	0,	0),
(507,	437,	297,	'Hello Abhinay,<div> If you are building an uncontrolled rectifier, the power diodes are available in eSim. You need to add library as powerdioide.lib.</div><div>But, if you want to build a 3-phase Ac source, you can build a sub-circuit of the same.</div><div>Please follow the instructions on \"How to build a subcircuit\" in eSim manual. Once you create a sub-circuit, you can use it in your circuit.</div><div>\n</div><div>Sorry for the delayed reply.</div><div>\n</div><div>Regards,</div><div>Gloria N</div><div><div>\n</div><div>\n</div><div>\n</div></div>',	'2017-12-12 06:43:44',	'2017-12-12 06:43:44',	0,	0),
(508,	397,	325,	'Hi Arezes,<div>You need to check the tutorials of multiPhaseFlow solvers. More specifically you can use interFoam solver.</div><div>Geometry of the problem is simple creation of sphere with inlet and outlet, for which you can use Gmsh software.</div><div>For the solving part try to go through tutorials for interFoam solver and search for cases solved using interFoam solver.</div><div>I attach the research paper for case solved using interFoam, which might be useful to you.</div><div>\n</div><div>http://www.tuvnel.com/assets/content_images/P8_-_Numerical_simulation_of_multiphase_flows_in_large_horizontal_pipes_.pdf</div><div>\n</div><div>Thank you.</div><div>Sathish</div><div>\n</div>',	'2017-12-12 10:03:08',	'2017-12-12 10:03:08',	0,	0),
