(524,	437,	344,	'Hello,<div>\n</div><div>Please uninstall eSim and its dependencies. If you are using windows OS, go to control panel, remove eSim and its dependencies(kicad, ngspice,pyqt4,matplotlob). <span style=\"line-height: 1.42857;\">Deactivate the antivirus. </span><span style=\"line-height: 1.42857;\">Download eSim from the website. you can download from link: </span><span style=\"line-height: 20px;\">http://esim.fossee.in/downloads</span><span style=\"line-height: 1.42857;\">. </span></div><div><span style=\"line-height: 1.42857;\">Run the setup file as administrator and also open the eSim icon as administrator.</span></div><div><span style=\"line-height: 1.42857;\">If you are getting error again. Go to console window. Set the path where the eSim has installed. </span><span style=\"line-height: 1.42857;\">The default location is C:\\\\eSim</span></div>Change directory to this location.  cd C:\\\\eSim\\\\src\\\\frontEnd\\\\\nThen type : python Application.py',	'2017-12-27 09:40:26',	'2017-12-27 09:40:26',	0,	0),
(525,	466,	343,	'I am using windows 8 in laptop.',	'2017-12-28 08:09:44',	'2017-12-28 08:09:44',	0,	0),
(526,	437,	334,	'Hello, <div>You need to do:</div><div>1.  Go to Subcircuit model in eSim, choose \"create new subcircuit model\", select \"yes\". Add the components and make proper connections (refer ua71.cir.out file of any example to know the components added). I added: CCCS, R, C from eSim_sources and port from miscellaneous.</div><div>\n</div><div>***** <b>Whichever pin you want to connect the inputs/outputs add port. The port and pin number should match.</b></div><div>** Now, annotate, create netlist and to kicad to ngspice conversion. In analysis, choose Ac, lin and 0 to start, stop and points and press convert.</div><div>___________________________________________________</div><div>2. Go to Kicad(Go to dash home/control panel and search Kicad). Go to Library editor(icon with a book mark) and choose create a new component.</div><div>Mark reference as \"X\". Keep other settings as default. Now draw a rectangle assign pin (same as you had assigned before in your schematic).</div><div>Then choose \"current library \" as \"eSim_Subckt\" and then choose \"update component\" and save it to the current library (First icon in the toolbar)</div><div>\n</div><div>----------------------------------------------------------------------------------------</div><div>3. Finally, close kicad, go to eSIm schematic. update library by selecting \"preferences\", \"component library\" and press\"Add\".</div><div>Now you can use it..</div><div>\n</div><div>the same steps can be found on eSim user manual.. Am attaching the images to your mail. </div>',	'2017-12-28 10:25:22',	'2017-12-28 10:25:22',	0,	0),
(527,	437,	345,	'Hello,<div><font size=\"2\">\n</font></div><div><font size=\"2\" color=\"#000000\">You didn\'t tell what was the error generated in previous question.</font></div><div><font size=\"2\" color=\"#000000\">All the components available in Kicad are not compatible with ngspice.</font></div><div><font size=\"2\" color=\"#000000\">Hence eSim team has created their own library which can be simulated using ngspice.</font></div><div><font size=\"2\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; line-height: normal;\">While drawing schematic please make sure to take the components from esim\'s library. The library starts with name esim_* .</span><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; line-height: normal;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; line-height: normal;\">You can add your own component in eSim\'s library by creating a component in kicad. You can download the eSim manual here: </span><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT67_com_zimbra_url\" style=\"color: rgb(0, 90, 149); cursor: pointer; font-family: arial, helvetica, sans-serif; line-height: normal;\"><a target=\"_blank\" href=\"http://esim.fossee.in/downloads\" style=\"color: rgb(0, 90, 149); cursor: pointer;\">http://esim.fossee.in/downloads</a></span><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; line-height: normal;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; line-height: normal;\">The buzzer, Led available in Kicad can be used for PCB generation which gives a gerber file after matching with appropriate footprint.</span></font><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px; line-height: normal;\"></div><div>\n</div>',	'2017-12-28 10:29:10',	'2017-12-28 10:29:10',	0,	0),
(528,	437,	343,	'<div><span style=\"line-height: 1.42857; background-color: rgb(249, 246, 246);\">Hello,</span></div><div><span style=\"line-height: 1.42857; background-color: rgb(249, 246, 246);\">\n</span></div><div><div style=\"background-color: rgb(249, 246, 246);\"></div><div style=\"background-color: rgb(249, 246, 246);\">Please uninstall eSim and its dependencies. If you are using windows OS, go to control panel, remove eSim and its dependencies(kicad, ngspice,pyqt4,matplotlob). <span style=\"line-height: 1.42857;\">Deactivate the antivirus.</span><span style=\"line-height: 1.42857;\">Download eSim from the website. you can download from link:</span>http://esim.fossee.in/downloads<span style=\"line-height: 1.42857;\">.</span></div><div style=\"background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">Run the setup file as administrator and also open the eSim icon as administrator.</span></div><div style=\"background-color: rgb(249, 246, 246);\"><span style=\"line-height: 1.42857;\">If you are getting error again. Go to console window. Set the path where the eSim has installed.</span><span style=\"line-height: 1.42857;\">The default location is C:\\\\eSim</span></div><span style=\"background-color: rgb(249, 246, 246);\">Change directory to this location. cd C:\\\\eSim\\\\src\\\\frontEnd\\\\ Then type : python Application.py</span></div><div><span style=\"background-color: rgb(249, 246, 246);\">Let me know the error.</span></div>',	'2017-12-28 10:38:07',	'2017-12-28 10:38:07',	0,	0),
