(531,	205,	346,	'<p>Following result properties are displayed for a reactor simulation through master property table:</p><ol><li>Pressure Drop</li><li>Residence time</li><li>Volume<br></li><li>Temperature delta</li><li>Heat Load <br></li></ol><p>Percentage Conversion is displayed in the edit properties tab for the reactor under results section. Reaction constant is generally given as input for kinetic reaction or equilibrium reaction so they cannot be displayed as a part of results.</p>',	'2018-01-01 10:23:21',	'2018-01-01 10:26:37',	0,	0),
