(536,	437,	348,	'Hello, <div>\n</div><div>It is an open source EDA tool used for circuit simulation, interactive analysis and PCB design.</div><div>You can build the circuit and do the PCB design using eeschema (kicad). </div><div>You can also do the simulation of the circuit using Ngpice.</div><div>You can build own subcircuit and can also use it for device modeling.</div><div>You can think of this tool as an alternative to OrCAD.</div><div>For more details, you can visit the eSim website. Please find the link here: http://esim.fossee.in/</div>',	'2018-01-04 06:46:04',	'2018-01-04 06:46:04',	0,	0),
(537,	437,	348,	'Hello,<div><span style=\"line-height: 1.42857;\">\n</span></div><div><span style=\"line-height: 1.42857;\">FOSSEE aims to promote the open source software and hardware tools for education and </span><span style=\"line-height: 20px;\">development</span><span style=\"line-height: 1.42857;\"> purpose.</span></div><div>Based on the purpose and the field of Application, you can choose the tools. </div><div>You can visit the link here for more details: http://fossee.in/</div>',	'2018-01-04 08:53:13',	'2018-01-04 08:53:13',	0,	0),
