(560,	205,	357,	'<p>Velocity refers to the rate of the reaction. Amount refers to the concentration term in rate = -[dC/dt] equation i.e the amount of chemical change occurring.</p><p>In the simulation configuration wizard, if any component has the CP column checkbox ticked against its name, it implies that the compound is also supported by CoolProp property package.</p>',	'2018-01-23 06:50:16',	'2018-01-23 06:50:42',	0,	0),
(561,	437,	360,	'<div><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">As per discussion, there was an error in the Application.py folder.</span></div><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">Python is not installed properly.</span><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">Reinstall python again and update it.</span><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">or</span><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\"> </span><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">go to this link: </span><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT195_com_zimbra_url\" style=\"color: rgb(0, 90, 149); cursor: pointer; font-family: arial, helvetica, sans-serif; font-size: 16px;\"><a target=\"_blank\" href=\"https://github.com/FOSSEE/eSim\" style=\"color: rgb(0, 90, 149);\">https://github.com/FOSSEE/eSim</a></span><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">On the right side, there is clone or download or you can clone it by copying the clone link and type in the terminal, select the folder where you want to install and type:  git clone </span><span class=\"Object\" role=\"link\" id=\"OBJ_PREFIX_DWT196_com_zimbra_url\" style=\"color: rgb(0, 90, 149); cursor: pointer; font-family: arial, helvetica, sans-serif; font-size: 16px;\"><a target=\"_blank\" href=\"https://github.com/FOSSEE/eSim.git\" style=\"color: rgb(0, 90, 149);\">https://github.com/FOSSEE/eSim.git</a></span><br style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\"><span style=\"color: rgb(0, 0, 0); font-family: arial, helvetica, sans-serif; font-size: 16px;\">Then go to the installed eSim (from GitHub,) folder and try to open the Application.py from there.</span><div><font color=\"#000000\" face=\"arial, helvetica, sans-serif\"><span style=\"font-size: 16px;\">It is not an installation file. If you still get the error, then the python is not installed properly.</span></font></div>',	'2018-01-26 08:42:41',	'2018-01-26 08:42:41',	0,	0),
(570,	205,	364,	'<p>Hi, DWSIM 3.4 is not compatible with 32-bit version of Windows 7. Kindly download an install DWSIM Version 5.1 update 9 for 32-bit windows 7 which is available here: http://dwsim.inforside.com.br/wiki/index.php?title=Downloads <br></p><p><br></p><p>Also, a lot of development and advanced features have been added to DWSIM 5.1 and therefore it is strongly recommended to use the latest version available.<br></p>',	'2018-02-02 09:21:28',	'2018-02-02 09:22:43',	0,	0),
