(576,	521,	367,	'<p style=\"margin-bottom: 0px;\">* C:\\Users\\Admin\\eSim-Workspace\\colpitts\\colpitts.cir</p>\r\n<p style=\"margin-bottom: 0px;\">\n</p>\r\n<p style=\"margin-bottom: 0px;\">* EESchema Netlist Version 1.1 (Spice format) creation date: 2/5/2018 3:08:52 PM</p>\r\n<p style=\"margin-bottom: 0px;\">\n</p>\r\n<p style=\"margin-bottom: 0px;\">* To exclude a component from the Spice Netlist add [Spice_Netlist_Enabled] user FIELD set to: N</p>\r\n<p style=\"margin-bottom: 0px;\">* To reorder the component spice node sequence add [Spice_Node_Sequence] user FIELD and define sequence: 2,1,0</p>\r\n<p style=\"margin-bottom: 0px;\">\n</p>\r\n<p style=\"margin-bottom: 0px;\">* Sheet Name: /</p>\r\n<p style=\"margin-bottom: 0px;\">Q1  Net-_C3-Pad2_ Net-_C1-Pad1_ Net-_C2-Pad1_ BC107		</p>\r\n<p style=\"margin-bottom: 0px;\">R4  Net-_C2-Pad1_ GND 1.2k		</p>\r\n<p style=\"margin-bottom: 0px;\">C2  Net-_C2-Pad1_ GND 0.1u		</p>\r\n<p style=\"margin-bottom: 0px;\">R3  VCC Net-_C3-Pad2_ 4.8k		</p>\r\n<p style=\"margin-bottom: 0px;\">R1  VCC Net-_C1-Pad1_ 380k		</p>\r\n<p style=\"margin-bottom: 0px;\">R2  Net-_C1-Pad1_ GND 72k		</p>\r\n<p style=\"margin-bottom: 0px;\">C1  Net-_C1-Pad1_ Net-_C1-Pad2_ 0.1u		</p>\r\n<p style=\"margin-bottom: 0px;\">C3  vout Net-_C3-Pad2_ 0.1u		</p>\r\n<p style=\"margin-bottom: 0px;\">U1  vout plot_v1		</p>\r\n<p style=\"margin-bottom: 0px;\">L1  Net-_C1-Pad2_ vout 50m		</p>\r\n<p style=\"margin-bottom: 0px;\">C5  vout GND 0.01u		</p>\r\n<p style=\"margin-bottom: 0px;\">C4  GND Net-_C1-Pad2_ 0.01u		</p>\r\n<p style=\"margin-bottom: 0px;\">\n</p>\r\n<p style=\"margin-bottom: 0px;\">.end</p>\r\n<p style=\"margin-bottom: 0px;\">\n</p>',	'2018-02-05 10:45:11',	'2018-02-05 10:45:11',	0,	0),
