(609,	426,	254,	'You can visit http://python.fossee.in/python-workshops/ for more details\n',	'2018-02-15 07:20:09',	'2018-02-15 07:20:09',	0,	0),
(610,	90,	379,	'Hello,\n\nThis thread should help you- http://forums.fossee.in/question/237/problem-with-the-opening-environment-window/\n\n\n',	'2018-02-16 05:12:43',	'2018-02-16 05:12:43',	0,	0),
(611,	205,	186,	'<p>When there are multiple inlet streams to the flash drum at different pressures, specifying the outlet pressure calculation helps to calculate the pressure for the outlet stream. Suppose if Outlet Pressure Calculation is specified as inlet minimum, then the outlet pressure is the minimum pressure of the inlet streams. Similarly inlet average results in outlet streams with pressure equivalent to average of all inlet streams. <br></p><p><br></p><p>In case the flash is to be operated at temperature/pressure other than what is there at inlet streams, it can be overridden by specifying override separation temperature ans override separation pressure accordingly.</p>',	'2018-02-16 06:21:51',	'2018-02-16 06:22:11',	0,	0),
(613,	437,	380,	'Hello,<div>\n</div><div>You will be giving a wide range of frequencies, and you will be select AC as transient analysis.</div><div>Hence it shows Amplitude as a single line that is maintained across these frequency ranges.</div>',	'2018-02-16 18:25:40',	'2018-02-16 18:25:40',	0,	0),
(614,	544,	379,	'this was very helpful!',	'2018-02-17 03:26:56',	'2018-02-17 03:26:56',	0,	0),
(615,	437,	380,	'I hope you understood the difference between AC analysis and Transient Analysis.<div>Please submit the project file. If there are any file missing, we will let you know.</div>',	'2018-02-17 14:37:31',	'2018-02-17 14:37:31',	0,	0),
(616,	205,	274,	'<p>Non-ideal mixtures of components forming an azeotrope are very difficult to separate to a purity beyond their azeotropic composition by using ordinary distillation. In such cases, pressure swing distillation (PSD) is a very common practice in chemical industries to separate such mixtures. <br></p><p>The principle behind PSD is to use two columns operated at sequence in two different pressures. So the pre-requisite for the process is that the composition of azeotrope should change significantly with change in pressure. Therefore assigning the opeerating pressure depends on the component system and the pressure at which their azeotropic composition changes significantly.<br></p><p>In DWSIM, the distillation column pressure can be entered under the Column Configuration &gt;&gt; Stages where one can enter the pressure for every stages individually or one can also enter the top &amp; bottom pressure and extrapolate to get the pressure of stages.</p>',	'2018-02-20 05:12:13',	'2018-02-20 05:14:29',	0,	0),
(617,	205,	383,	'<p>In DWSIM, absorption column is the first unit operation listed under the Flowsheet Objects present in the right side of the GUI. You can also use the absorption column provided by ChemSep by adding a CAPE-OPEN Unit Operation from the flowsheet objects and then select ChemSep from the list of CAPE-OPEN Unit Operations displayed.</p>',	'2018-02-20 05:20:39',	'2018-02-20 05:21:38',	0,	0),
(618,	257,	381,	'What is microdaq? If its a USB based DAQ system, then you can connect to it using Scilab\'s serial communication toolbox <a href=\"https://atoms.scilab.org/toolboxes/serial\" title=\"\" target=\"\">https://atoms.scilab.org/toolboxes/serial</a>\nYou will however need to know the protocol to use the microdaq directly over serial. See if the manufacturer provides this information.\n',	'2018-02-20 06:19:18',	'2018-02-20 06:19:18',	0,	0),
(619,	437,	384,	'Hello,<div>\n</div><div>The 555.lib file is not matching with lm555 subcircuit model.</div><div>You need to create 555 subcircuit, or refer the 555.lib file from here: https://github.com/FOSSEE/eSim-Examples/tree/master/AstableMultivibratorIC555</div><div>\n</div><div>Make the changes or copy the lib file to the existing subcircuit lm555n in the src folder.</div>',	'2018-02-20 11:40:19',	'2018-02-20 11:40:19',	0,	0),
(620,	90,	329,	'We do not have anything available for Scilab 6. You could see if this works- https://scilab.in/scilab-symbolic-toolbox\n\n\n',	'2018-02-21 06:22:57',	'2018-02-21 06:22:57',	0,	0),
(621,	257,	387,	'For plotting the poles and zeros, see plzr() command. For step response, use csim(). See scilab help for exact usage of these commands.\n',	'2018-02-21 17:30:29',	'2018-02-21 17:30:29',	0,	0),
(622,	257,	388,	'The h/.g(1) is scilab\'s way of creating a feedback. Please see this link <a href=\"https://help.scilab.org/docs/5.4.1/pt_BR/feedback.html\" title=\"\" target=\"\">https://help.scilab.org/docs/5.4.1/pt_BR/feedback.html</a>\nDo not confuse it with other dot operations.\n',	'2018-02-22 06:50:20',	'2018-02-22 06:50:20',	0,	0),
(623,	4,	347,	'Can you please post the question under \"scilab-toolbox\" category, preferably in English? ',	'2018-02-22 07:02:01',	'2018-02-22 07:02:01',	0,	0),
