(626,	544,	387,	'<div class=\"body\" id=\"body625\" style=\"padding-bottom: 12px;\"><p>How would I use this to create a unit step function, u(t), as is commonly used in electrical engineering?</p></div><span class=\"meta\"><small><i></i></small></span><span class=\"modify\" style=\"display: block;\"><a class=\"edit btn btn-xs btn-info vs\" href=\"http://forums.fossee.in/question/387/matlab-equivalent/#body625\" data-target=\"body625\"></a></span>',	'2018-02-22 19:22:18',	'2018-02-22 19:22:18',	0,	0),
(627,	90,	389,	'Please install the FOSSEE Signal Processing Toolbox- https://scilab.in/fossee-scilab-toolbox/signal-processing-toolbox. The installation instructions are given. filtic function is available in the toolbox. Please post any bugs or error that you may encounter.\n',	'2018-02-23 09:15:44',	'2018-02-23 09:15:44',	0,	0),
(628,	90,	391,	't\' is the transpose of t. 0*t\' is multiplying every element of t with 0. I would recommend looking up matrix operations to understand similar code.',	'2018-02-23 16:21:38',	'2018-02-23 16:21:38',	0,	0),
(629,	544,	391,	'It would seem simpler to make a zero array and transpose it.',	'2018-02-23 17:12:08',	'2018-02-23 17:12:08',	0,	0),
(630,	437,	392,	'Hello Sir,<div>\n</div><div>Most of the Kicad components are not compatible with Ngspice. eSim team has created their own set of libraries which are labeled under eSim_*(eSim_devices, eSim_subckt).You need to add UJT using <b>Device modeling</b> or <b>subcircuit builder</b>.  Tutorials on device modeling are available here: http://spoken-tutorial.org/tutorial-search/?search_foss=eSim&amp;search_language=English and for subcircuit builder, you can refer eSim user manual here: http://esim.fossee.in/downloads.</div><div>You can use any one of these methods to add the device to the library. Or the other way is by using the equivalent circuit of UJT with diode and resistors.</div>',	'2018-02-24 06:49:51',	'2018-02-24 06:49:51',	0,	0),
(631,	90,	393,	'This should help you- https://help.scilab.org/doc/6.0.0/en_US/scilab_keywords.html\n',	'2018-02-24 17:02:28',	'2018-02-24 17:02:28',	0,	0),
(632,	544,	393,	'I can find nothing there that is even closely related to the matrix operation of the dot product!',	'2018-02-24 23:26:32',	'2018-02-24 23:26:32',	0,	0),
(633,	544,	393,	'I can find nothing there that is even closely related to the matrix operation of the dot product! Maybe it is under some other name for the function, something like was done for the root locus method which you people call the Evans function. As a programmer I name functions so that the user will find them very easily: everyone knows root locus, but very few people know the some scientist named Evans was the originator of the root locus method.',	'2018-02-24 23:43:12',	'2018-02-24 23:43:12',	0,	0),
(634,	65,	393,	'Unfortunately, Scilab does not seem to have a built-in dot product.  It is easy to define a function, however, and use it.  This function should first invoke .* (dot followed by *, without any space), and then the components of the resulting vector can be added up using the sum command.\n\nAn example of .* is given in https://cloud.scilab.in/index?eid=4296, in our textbook companion page.  You may have to click the box with left-right-arrow, in case the code is not visible.  I located this by going to scilab.in and then clicking Search -&gt; TBC Code Search, and then searching for the word \"dot\".\n\nPreliminary learning material on Scilab is available in these Spoken Tutorials: http://spoken-tutorial.org/tutorial-search/?search_foss=Scilab&amp;search_language=English.  The eighth tutorial in this series is on Scritps and Functions.\n',	'2018-02-25 00:40:32',	'2018-02-25 00:40:32',	0,	0),
(635,	4,	390,	'<span style=\"background-color: rgb(249, 246, 246);\">Can you please post the question under \"scilab-toolbox\" category?</span>',	'2018-02-26 05:06:18',	'2018-02-26 05:06:18',	0,	0),
(636,	437,	394,	'Hello,<div>\n</div><div>Please use pwl.</div><div>The format for pwl is (time1 voltage1, time2 voltage2 and so on)</div><div>If you need it with pulse width, use eSim_pulse and give the rise time, fall time, pulse width, pulse delay, amplitude, and pulse period.</div><div>\n</div><div>\n</div>',	'2018-02-27 05:41:32',	'2018-02-27 05:41:32',	0,	0),
(637,	560,	394,	'Thank You for the answer. I tried with pulse and it helped.',	'2018-02-27 10:48:20',	'2018-02-27 10:48:20',	0,	0),
(638,	257,	402,	'I tried the code that you have mentioned. It works perfectly on my local scilab as well as on <a href=\"https://cloud.scilab.in/\" title=\"\" target=\"\">https://cloud.scilab.in/</a>\n',	'2018-02-28 06:15:24',	'2018-02-28 06:15:24',	0,	0),
(639,	205,	396,	'It is true that there are no packed contactor or scrubber unit in DWSIM. As of now there are no unit operation available which can replace them. However you can create your own unit operation using the Python Script Unit Operation available in the flowsheet objects. \n',	'2018-02-28 11:20:14',	'2018-02-28 11:20:14',	0,	0),
