(641,	544,	402,	'I tried the cloud and it does work there! Very nice example.',	'2018-02-28 15:50:35',	'2018-02-28 15:50:35',	0,	0),
(642,	544,	407,	'<span lang=\"EN\"><span lang=\"EN\"><p>t=0:0.05:5;\ns=poly(0,\'s\');\ntf=(s+1)/((s-1)*(s+2)*(s+3))\nclf(0);\nxset(\"window\",0);\nshow_window();\nplot2d([t\',t\'],[csim(\'step\',t,tf2ss(tf))\',0*t\'])\n</p><p>\n</p><p>correction, this is the code that I actually used in the cloud after some fooling around and this seems to work!</p></span><p>\n</p></span>',	'2018-03-01 05:21:23',	'2018-03-01 05:21:23',	0,	0),
(643,	437,	409,	'Hello,<div>\n</div><div>Use the MOS from the eSim_devices library.</div><div>Send the cir file to <span style=\"background-color: rgb(252, 252, 252); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\"><font color=\"#000000\">contact-esim [at] fossee [dot] in or copy paste it here.</font></span></div>',	'2018-03-01 05:28:45',	'2018-03-01 05:28:45',	0,	0),
(644,	437,	408,	'Hello,<div>\n</div><div>Try to run \"Application.py\". You can find it in src&gt;&gt; front end folder of eSim-1.1.2.</div><div>If you get the error, this means the python is not installed properly. Try to reinstall eSim.</div><div>If you are using two versions of python, make sure they should not be in the single directory.</div><div>eSim uses python 2.7.</div><div>\n</div>',	'2018-03-01 05:33:19',	'2018-03-01 05:33:19',	0,	0),
(645,	437,	408,	'Hello,<div>\n</div><div>Try to run \"Application.py\". You can find it in src&gt;&gt; front end folder of eSim-1.1.2.</div><div>If you get the error, this means the python is not installed properly. Try to reinstall eSim.</div><div>If you are using two versions of python, make sure they should not be in the single directory.</div><div>eSim uses python 2.7.</div><div>\n</div>',	'2018-03-01 05:33:19',	'2018-03-01 05:33:19',	0,	0),
(646,	560,	409,	'Thank You for the reply.<div>It worked when I gave path of the .lib files as:</div><div>/eSim/src/deviceModelLibrary/MOS/NMOS-180nm.lib</div><div>\n</div><div>Earlier I had copied these files manually in the project folder.</div>',	'2018-03-01 09:09:53',	'2018-03-01 09:09:53',	0,	0),
(647,	257,	405,	'There is nothing wrong with this example except that it uses \'syms\' to \r\ndeclare a symbolic variable. \'Syms\' command is no longer supported in \r\nthe latest scilab versions. syms k will simply declare a symbolic \r\nvariable k, just like you declare s=%s. You may simply replace k with \r\nits correct value and the example will work. You can attach the example \r\nurl next time to help us help you better. Just a note, if I am not \r\nwrong, the k here is \"forward\" gain and not \"feedback\" gain.',	'2018-03-01 15:46:12',	'2018-03-01 15:46:12',	0,	0),
(648,	257,	406,	'We have problems running scilab code that uses scimax toolbox.',	'2018-03-01 16:00:10',	'2018-03-01 16:00:10',	0,	0),
(649,	257,	411,	'This is a server-side error. Sorry for the inconvenience caused. The \r\ncode will work fine on local scilab. Thank you for reporting it.',	'2018-03-01 16:16:26',	'2018-03-01 16:16:26',	0,	0),
(650,	65,	413,	'This is the unique frequency range for discrete time systems.  After this range, the spectrum starts repeating itself.  This behaviour is known as the periodicity.\n',	'2018-03-02 03:46:34',	'2018-03-02 03:46:34',	0,	0),
(651,	257,	412,	'It does work for me on local scilab.',	'2018-03-02 09:19:34',	'2018-03-02 09:19:34',	0,	0),
(652,	437,	414,	'Hello,<div>\n</div><div>Add the libraries manually.</div><div>in Eeschema, go to Prefeernces&gt;&gt;componnet libraries&gt;&gt;select Add. It will direct to Kicad library in C drive. Select all(not the folders), then Add.</div>',	'2018-03-02 09:52:22',	'2018-03-02 09:52:22',	0,	0),
(653,	568,	25,	'Write an email to <a href=\"https://quickassignmenthelp.co.uk/\" title=\"\" target=\"_blank\">Assignment Writers UK</a> for possible academic writing help.',	'2018-03-02 11:07:01',	'2018-03-02 11:07:01',	0,	0),
(654,	544,	412,	'The cloud must have been down for  a while, since I see that now the code is working in the cloud (days later).  I still do not get the same results when I use the code in the Scilab tool.  I have seen no reason for this.  The sgrid() code still does not show, only the root locus plot.  Maybe there is a bug Scilab  when using Windows 8.1, but can find no related bug reports. This is baffling!.',	'2018-03-02 19:58:01',	'2018-03-02 19:58:01',	0,	0),
(655,	544,	405,	'When doing a root locus, one starts with the form 1 + k(Q(s)/P(s)) and the roots are plotted for k values from 0 to inf thus forming a root locus graph. Which brings up 2 questions: in the above code k would have to be scanned over 0 to inf, so putting in a constant seems contrary to forming a root locus graph, and as evans with k a constant would  seem not  to show a root locus, but it does, somehow the evans function inserts a k parameter to make a  1 + k(Q(s)/P(s)) function for evans to analyze the above function. Any comments welcome.',	'2018-03-02 20:29:45',	'2018-03-02 20:29:45',	0,	0),
(656,	544,	402,	'I made a mistake and posted this message several times. I can find no way to delete the replica messages. There is a way in other forums. Maybe the administrator can clean up this mess.',	'2018-03-02 20:33:28',	'2018-03-02 20:33:28',	0,	0),
(657,	437,	419,	'Hello,<div>\n</div><div>You cannot attach screenshots here. Please check, whether the KiCad is installed properly.</div><div>In c:users/share/kicad , there will be Kicad libraries.</div><div>Send the screenshot to contact-esim[at]fossee[dot]ine</div>',	'2018-03-03 15:35:18',	'2018-03-03 15:35:18',	0,	0),
(658,	437,	422,	'Hello,<div>\n</div><div>We need to place plot_db at the output. As db is 20logv(in), even though it can be plotted using Ngspice, the py plot shows w.r.t frequency or time.</div><div>If we take 20log(10) and 20log(100), it will be 20 and 40, whereas python plot will be using ms for time/voltage and the frequency plot will be plotted using F=1/T.</div><div>\n</div>',	'2018-03-04 13:35:25',	'2018-03-04 13:35:25',	0,	0),
(659,	257,	416,	'You cant. Only .sci files can be loaded in the scilab console to make use of them using the \"getd\" command. This is because the convention is to keep only re-usable functions inside the .sci files and executable code inside .sce files. Loading all .sce files in the console is not desirable. You can use the exec command to execute any .sce scilab file.\n\n\n',	'2018-03-05 06:48:43',	'2018-03-05 06:48:43',	0,	0),
(660,	257,	417,	'It is just a warning. Ideally csim() will expect a syslin list (SIMO linear system) in continuous time. If you dont do this, it will assume a continuous time system.\n',	'2018-03-05 07:14:27',	'2018-03-05 07:14:27',	0,	0),
(661,	257,	418,	'Try issuing a \'clear\' command before the beginning of the code.\n',	'2018-03-05 07:15:56',	'2018-03-05 07:15:56',	0,	0),
(662,	257,	420,	'Thanks for reporting this. Sorry for the inconvenience. \n',	'2018-03-05 07:21:37',	'2018-03-05 07:21:37',	0,	0),
(663,	257,	421,	'As reported earlier and addressed, we have problems running code with \'syms\' command. Can you try this and let us know the results? <a href=\"https://scilab.in/scilab-symbolic-toolbox\" title=\"\" target=\"\">https://scilab.in/scilab-symbolic-toolbox</a> Be informed that the toolbox will work only with the mentioned system specifications. Looking at the code, I am assuming that you know what K and T are with respect to control systems.\n',	'2018-03-05 07:33:04',	'2018-03-05 07:33:04',	0,	0),
(664,	257,	425,	'There are a couple of toolboxes in scilab for ANN. See <a href=\"https://atoms.scilab.org/toolboxes/neuralnetwork/2.0\" title=\"\" target=\"\">https://atoms.scilab.org/toolboxes/neuralnetwork/2.0</a> and <a href=\"https://atoms.scilab.org/toolboxes/ANN_Toolbox\" title=\"\" target=\"\">https://atoms.scilab.org/toolboxes/ANN_Toolbox</a> Also see this link that I got out of a google search <a href=\"https://scilab.io/artificial-neural-network-tutorial/\" title=\"\" target=\"\">https://scilab.io/artificial-neural-network-tutorial/</a>\n\n',	'2018-03-05 08:57:34',	'2018-03-05 08:57:34',	0,	0),
(665,	257,	423,	'<p>\"When I run the code I see 1 zero and 3 poles all on the real, not imaginary) axis\": This is not true when i execute your code on scilab. I do see a correct plot.<br></p>',	'2018-03-05 09:34:17',	'2018-03-05 09:36:39',	0,	0),
(666,	437,	426,	'Hello,<div>\n</div><div>Please go through eSim manual here: http://esim.fossee.in/resource/book/esimusermanual.pdf</div><div>Refer Chapter 8, they have given an example of Half adder.</div><div>Also, the issue is being addressed in question 334 of eSim: http://forums.fossee.in/question/334/esim-installation-problem/</div>',	'2018-03-05 12:20:53',	'2018-03-05 12:20:53',	0,	0);
INSERT INTO `website_answer` (`id`, `uid`, `question_id`, `body`, `date_created`, `date_modified`, `upvotes`, `num_votes`) VALUES
(667,	544,	416,	'Going into the cloud and clicking the icon in the upper left corner, you can find the book \"Control Systems Engineering - I.T.Nagrath and M.Gopal\"  and the code that I am referring to comes from this book which I downloaded, copied and pasted some of the code in the book into the  Scilab console  and got all these errors about syms. Even in the cloud one can select an example and try to run it, but I get the same error! Other files from other books without a syms in it load into the cloud console and execute just fine!  So it seems like a lot of books with their out of date code are still being published without informing the community that these books are essentially useless! ',	'2018-03-05 21:09:42',	'2018-03-05 21:09:42',	0,	0),
(668,	544,	421,	'<ol style=\'list-style: decimal; margin: 0px 0px 1em 1.5em; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; color: rgb(114, 111, 111); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 15px; font-style: normal; font-weight: 300; word-spacing: 0px; vertical-align: baseline; white-space: normal; orphans: 2; widows: 2; background-color: rgb(252, 252, 252); font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Install Maxima. On terminal type sudo apt-get install maxima</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\"><a style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; color: rgb(48, 99, 165); font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; text-decoration: none; vertical-align: baseline;\" href=\"http://scilab.in/scilab_toolbox/overload-1.3.3.tar\">Download overload-1.3.3.tar</a></li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Extract overload-1.3.3</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">On Scilab console, navigate to overload-1.3.3 folder</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Type exec loader.sce in Scilab console</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\"><a style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; color: rgb(48, 99, 165); font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; text-decoration: none; vertical-align: baseline;\" href=\"http://scilab.in/scilab_toolbox/scilab-scimax-2.1.4.tar\">Download scilab-scimax-2.1.4.tar</a></li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Extract scilab-scimax-2.1.4</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Open scilab-scimax-2.1.4/builder.sce on an editor. Change line 14 to indicate the path of overload.1.3.3. For example, the path could look like this-\n%otb_path=\'/home/xyz/overload-1.3.3\'</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">On Scilab console, navigate to scilab-scimax-2.1.4</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Type exec builder.sce in Scilab console</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Type exec loader.sce in Scilab console</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Type maxinit in Scilab console</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">To test the toolbox has been loaded properly, type the following in Scilab console\nSyms x\nSyms y\ne=(x+y)^5\nf=expand(e)</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">---------------------------------------------------------------------------------------------------------------------------------</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">from the above toolbox  link:</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">tar files are a Linux file type and I am using Microsoft windows. </li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 15px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">what the heck is Maxima and sudo looks like a Linux comand</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px 