(674,	257,	430,	'<p></p><div>When you ask a question referring to an external source, please paste the link here so that the reader fully understands the context of the question. This is not just for me but also for other readers who might have the same problem as yours.</div><div></div><div>The Maxima tool is independent of scilab. It is needed by overload-1.3.3 to work. Dont wory, overload will understand on its own if maxima in installed or not.</div><div></div>From what I can understand is that you are using linux installation instructions over a windows OS using a windows compatible installer file. This will not work. The instructions will confuse you and the file, <a href=\"http://scilab.in/scilab_toolbox/overload-1.3.3.tar\" style=\"background-color: rgb(252, 252, 252); color: rgb(48, 99, 165); outline: 0px; font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; margin: 0px; padding: 0px; border: 0px currentcolor; vertical-align: baseline;\">overload-1.3.3.tar</a> is obviously not meant to work on Windows OS<div><div></div><div>Also, if you have problem navigating to a directory using scilab, you should probably watch the basic tutorials on scilab first. You may start with this <a href=\"http://spoken-tutorial.org/watch/Scilab/Getting%2BStarted/English/\" target=\"\" title=\"\">http://spoken-tutorial.org/watch/Scilab/Getting%2BStarted/English/</a> In fact I suggest you to practice the tutorials from 3 to 12 available here <a href=\"http://spoken-tutorial.org/tutorial-search/?search_language=English&amp;search_foss=Scilab&amp;page=1\" title=\"\" target=\"\">http://spoken-tutorial.org/tutorial-search/?search_language=English&amp;search_foss=Scilab&amp;page=1</a></div></div><p></p>',	'2018-03-09 06:22:16',	'2018-03-09 06:30:19',	0,	0),
(675,	544,	430,	'<p><a href=\"https://scilab.in/scilab-symbolic-toolbox\">https://scilab.in/scilab-symbolic-toolbox</a></p><p>This is the link to the site that explains how to \"fix\"  the syms problem that occurs when I try to run any example code that contains the syms command.  This webpage is obviously Linux oriented, and I see no information as to how to do this in a windows operating system: as that is what I would have done being a windows user! I will check out the links to the tutorials given and thank you so much for these links. So if there is any link to a site that will explain how to install the symbolic toolbox on a windows system I will be forever grateful if you know of such a site!</p>',	'2018-03-09 20:40:55',	'2018-03-09 20:40:55',	0,	0),
(676,	90,	432,	'<p>While we understand your requirements, please know that we have limited resources available for developing toolboxes. For this particular toolbox, we provide support only for the Linux version as that is our priority. We are a FOSS promotion group, first and foremost. Our priority will always be to make tools available for Linux users. We got the toolbox working for Linux platform to make sure our TBC examples can be executed on at least one platform. You have two options now- 1. Switch to a Linux platform 2. Either contact Scilab users mailing list (users@list.scilab.org) or the toolbox authors directly asking if anyone has this toolbox working for Windows. Please bear in mind the authors have not maintained this toolbox for many years. So it is quite possible that you will find no help there.</p>',	'2018-03-10 23:41:49',	'2018-03-11 09:20:18',	0,	0),
(677,	90,	434,	'Looking at the toolbox and Scilab versions, it looks to be using an old Scilab version. Theoretically, it should work if you\'re using an old version of Scilab. But I would not be too hopeful. Once again, please contact the toolbox authors directly. You can find them on the ATOMS page or on the Forge page. \n',	'2018-03-11 21:46:45',	'2018-03-11 21:46:45',	0,	0),
