(683,	426,	439,	'Hi,\nThe files required for lessons are included as attachment in respective lesson units. The \"pendulum.txt\" file is available in \"circulate.zip\" which is included in \"Example Simple Pendulum\" lesson.\n',	'2018-03-14 04:30:30',	'2018-03-14 04:30:30',	0,	0),
