(685,	437,	438,	'Hello,<div>\n</div><div>LM741 is not recognized in ngspice. The team has created ua741 for the same purpose.</div><div>If you need to add external pins, you need to add ports. The other way is you need to create your own subcircuit of LM741 and can add ports to pin 2,3,4,6 and 7. For more information about subcircuit refer eSim user manual: http://esim.fossee.in/resource/book/esimusermanual.pdf</div><div>and for more information on the spice model, you can refer here: http://www.ecircuitcenter.com/Circuits/opmodel1/opmodel2.htm</div>',	'2018-03-14 06:28:37',	'2018-03-14 06:28:37',	0,	0),
