(689,	606,	441,	'\r\n	\r\n	\r\n	\r\n	<style type=\"text/css\">p { margin-bottom: 0.25cm; line-height: 120%; }a:link { }</style>\r\n\r\n\r\n<p style=\"margin-bottom: 0cm; line-height: 138%\">Dear Subrata,<br>\r\n<br>\r\nThank\r\nyou for contacting the Osdag team. <br>\r\n<br>\r\nThe <a href=\"https://osdag.fossee.in/resources/downloads\" target=\"_blank\">installation\r\ninstructions</a> for the Windows installer are updated on the Osdag\r\nwebsite. Please check the new installation instructions on the\r\nwebsite to avoid any issues with Osdag installation on Windows\r\n(please clear your browsers cached data before going to the\r\n<a href=\"https://osdag.fossee.in/resources/downloads\">downloads</a>\r\npage). <br>\r\n<br>\r\nFollowing issues could cause problems while\r\ninstalling Osdag (<b>Installer [Release: 2017-08-08]</b>) on Windows.\r\n<br>\r\nMiniconda2 installed in a directory other than C:/Program\r\nFiles (x86)/Miniconda2 (This step is very important as Osdag wont\r\nwork if this is not followed properly)</p>\r\n<ul><li>\r\n<p><b>Solution</b>:</p>\r\n</li></ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n1. While installing Miniconda2 for Osdag, the default installation\r\ndirectory is shown as C:/ProgramData/Miniconda2, please change\r\nit to C:/Program Files (x86)/Miniconda2<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n2. If you didnt select this option, please uninstall Miniconda2,\r\nwkhtmltopdf, Osdag<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n3. Reinstall Osdag from scratch<br>\r\n<br>\r\n<br>\r\n2. Already existing\r\nMiniconda2 or Python 2.7 on your Windows system</p>\r\n<ul><li>\r\n<p><b>Solution</b>:</p>\r\n</li></ul>\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n1.&nbsp; Uninstall existing Miniconda2 and/or Python 2.x on your\r\nWindows system.<br>\r\nNote: If you think you need Miniconda2 or Python\r\n2.x, please drop an email to\r\ncontact-osdag@fossee.in.<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n2. After uninstalling Miniconda2 and/or Python 2.x, please remove all\r\nthe paths related to Miniconda2 and/or Python 2.x from the PATH\r\nvariable from the System Environmental Variables (See <a href=\"https://docs.google.com/document/d/1cnSDEiUZ1Fez-ZU4hB7N4Q_h8QjYpwU_zOaJtry-4M4/edit\" target=\"_blank\">here</a> if you\r\ndont know how to change the PATH variable).<br>\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n3. Reinstall Osdag using the instructions.<br>\r\n<br>\r\nAny\r\ninconvenience caused is regretted.<br>\r\n<br>\r\nRegards,<br>\r\nOsdag\r\nTeam.<br>\r\n<br>\r\n<br>\r\n<br>\r\n\r\n</p>\r\n\r\n',	'2018-03-16 12:16:42',	'2018-03-16 12:16:42',	0,	0),
