(707,	205,	467,	'<p></p><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\">You can create your desired compound in DWSIM by following the below steps:</span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\"></span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\"><br>Go to File &gt;&gt; Compound Creator Study<br><br></span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\"></span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\">Now there are number of ways to create the compound:</span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\">1. Entering the component property directly: In case you have the property date for the component, you can enter them against the different properties.</span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\">2. Group Contribution Method: You can define the functional groups present in the compound by different group contribution methods like Joback, UNIFAC, MODFAC &amp; NIST-MODFAC and the properties get calculated accordingly</span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\">3. Importing Compound from Online sources: Go to Compound &gt;&gt; Import Data from Online Sources . Then you can search for your compound by CAS ID in any of the displayed online sources and import it.</span></div><div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\"></span></div><span style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\"><br>Once the component properties are available in the creator study by one of the above methods, save the file by exporting data to the JSON File. Go to Compound &gt;&gt; Export Data to JSON File and save the json file. Now the same JSON file can be imported while adding compounds in the Simulation configuration wizard while doing a new steady state simulation.</span><p></p>',	'2018-03-22 04:58:30',	'2018-03-22 04:58:46',	0,	0),
(708,	437,	468,	'Hello,<div>\n</div><div>Use FET from the eSim_devices library.</div>',	'2018-03-22 06:03:53',	'2018-03-22 06:03:53',	0,	0),
(709,	606,	469,	'Hi Hoshil,<div>\n</div><div>Thanks for contacting Osdag team.</div><div>Even if you have Python 2.7 installed on the system you have to tick (check) both the options of <b>\'Advanced Options\'</b> (already mentioned in <b>README </b>file) while installing Minicionda. This is because Osdag uses dependencies and packages through Miniconda.</div><div>\n</div><div>You have to uninstall Osdag and Miniconda and reinstall it again following the instructions strictly given in the <b>README </b>file. Now you will be able to use the command \'python osdagMainPage.py\' (here the python used is from Miniconda).You are installing Osdag and Miniconda in the correct directories as mentioned.</div><div>\n</div><div>For <span style=\"font-family: arial, sans-serif; font-size: 12.8px;\">ArcGIS software, you can try using python 2.7 from Miniconda.</span></div><div>In case if Osdag doesn\'t work even after following the above instructions please check the forum post \'<a href=\"https://forums.fossee.in/question/441/osdag-software-not-opening/\" title=\"Osdag not opening\" target=\"_blank\">Osdag not opening</a>\'</div><div>\n</div><div>Regards,</div><div>Osdag Team</div><div>\n</div>',	'2018-03-22 06:17:16',	'2018-03-22 06:49:41',	0,	-1),
(710,	257,	473,	'<div>Please follow the instructions given here <a href=\"https://scilab.in/fossee-scilab-toolbox/scilab-to-c-toolbox-installation-instructions\" title=\"\" target=\"\">https://scilab.in/fossee-scilab-toolbox/scilab-to-c-toolbox-installation-instructions</a></div><div>\n</div>',	'2018-03-23 05:54:59',	'2018-03-23 05:54:59',	0,	0),
(711,	257,	473,	'Do as told in 3rd and 4th. If you do not know how to change scilab\'s working directory, please see scilab basic spoken tutorials first\n<a href=\"http://spoken-tutorial.org/tutorial-search/?search_foss=Scilab&amp;search_language=English\" title=\"\" target=\"\">http://spoken-tutorial.org/tutorial-search/?search_foss=Scilab&amp;search_language=English</a>',	'2018-03-23 06:44:09',	'2018-03-23 06:44:09',	0,	0),
(712,	606,	470,	'Hi Subrata,<div>\n</div><div>Could you please elaborate exactly which Connectivity of the module is showing this problem.</div><div>Check whether the .osi file is properly saved using \'<b>Save inputs\'</b> option in the <b>File</b> menu?</div><div>While loading the inputs did you use<b> \'Load inputs\' </b>option from <b>File</b> menu? </div><div>Learn how to load and save .osi files in Osdag using <a href=\"https://www.youtube.com/watch?v=3BsHThOAVaw\" title=\"\" target=\"_blank\">this </a>video tutorial.</div><div>\n</div><div>Please try again, following the above instructions and if it still doesn\'t work send us the .osi file at <b>contact-osdag@fossee.in</b></div><div><b>\n</b></div><div>Regards,</div><div>Osdag Team</div>',	'2018-03-23 09:39:25',	'2018-03-23 09:39:25',	0,	0),
(713,	606,	469,	'<div>\n</div>1. Check if Miniconda is installed properly in \"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">C:\\Program Files (x86)\\Miniconda2</font>\".<div>2. Go inside this folder \"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">C:\\Program Files (x86)\\Miniconda2\\Lib\\site-packages</font>\", inside <b>site-packages </b>folder \"PyQt5\" should be present. If it is not present then Miniconda and Osdag is not installed properly.</div><div>3. In command prompt type \"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">conda list</font>\" which will list out all the dependencies <b>related and not related </b>to Osdag  (Osdag related dependencies can be found in the downloaded installer folder &gt; \"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">depe<font style=\"\">ndencies</font></font>\". Here you need to cross check if all the dependencies are present in \"cond list\". If some packages are missing then the installation is not done properly).</div><div>4. To check which python you are using type \"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">python</font>\" in command prompt. It should be using Miniconda python 2.7.<div>6. If the system is not using Miniconda python 2.7 and using some different python installed then it will show this in command prompt</div><div>\"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">C:\\Users\\USER&gt;python</font></div><div><font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">Python 2.7.11 (v2.7.11:6d1b6a68f775, Dec  5 2015, 20:32:19) [MSC v.1500 32 bit (Intel)] on win32</font></div><div><font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">Type \"help\", \"copyright\", \"credits\" or \"license\" for more information.</font></div><div><font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">&gt;&gt;&gt; exit()</font>\" </div><div>to use the Miniconda python change the path to \"<font face=\"courier new\" style=\"background-color: rgb(255, 255, 204);\">C:\\Program Files (x86)\\Miniconda2;C:\\Program Files (x86)\\Miniconda2\\Scripts;C:\\Program Files (x86)\\Miniconda2\\Library\\bin;</font>\" in the <b>Environment Variable. </b></div><div>If you don\'t know how to set/change the path please see <a href=\"https://docs.google.com/document/d/1cnSDEiUZ1Fez-ZU4hB7N4Q_h8QjYpwU_zOaJtry-4M4/edit?ts=5aab6e4b\" title=\"\" target=\"_blank\" style=\"background-color: rgb(255, 255, 255);\">this </a>document.</div></div><div>\n</div><div>If you still face any issues with installation, please write in detailed or send related screenshots to <b>contact-osdag@fossee.in</b></div><div><b>\n</b></div><div><b>\n</b></div><div>Regards,</div><div>Osdag Team</div>',	'2018-03-23 13:12:23',	'2018-03-23 13:12:23',	0,	0),
