(723,	606,	478,	'Could please let us know what exactly problem/issue you are facing?<div>\n</div><div>Please check whether you have followed the proper process for installation. You can refer to the <a href=\"https://osdag.fossee.in/forums\" title=\"\" target=\"_blank\">forum </a>page where you will see a list of questions. </div><div>You can refer to these question \"<a href=\"https://forums.fossee.in/question/441\" target=\"_blank\" style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(130, 80, 81); text-decoration-line: underline; background-color: rgb(255, 255, 255);\">osdag software not opening</a>\" and \"<a href=\"https://forums.fossee.in/question/469\" target=\"_blank\" style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(130, 80, 81); text-decoration-line: underline; background-color: rgb(255, 255, 255);\">LAUNCHING OSDAG</a>\" where we have answered about the installation issues.</div><div>\n</div><div>Regards,</div><div>Osdag Team</div><div>\n</div>',	'2018-03-27 06:39:41',	'2018-03-27 06:39:41',	0,	0),
