(732,	437,	488,	'All the kicad components are not recognized in eSim. You need to add it on your own.<div>You can build its internal diagram using subcircuit builder or add its characteristics from the datasheet using device modeling.</div><div>For subcircuit builder:https://esim.fossee.in/resource/book/esimusermanual.pdf  and for</div><div>device modeling:http://spoken-tutorial.org/tutorial-search/?search_foss=eSim&amp;search_language=English</div>',	'2018-04-02 04:41:25',	'2018-04-02 04:41:25',	0,	0),
(733,	257,	486,	'I am assuming you are referring to <a href=\"https://atoms.scilab.org/toolboxes/CPGE\" title=\"\" target=\"\">this</a> toolbox. If so, toolboxes are contributed by people around the world and are not maintained by scilab.org. If you need help in using them please write to the respective authors. You may even leave a comment on the atoms page and wait for one of the authors to reply.',	'2018-04-02 05:07:13',	'2018-04-02 05:07:13',	0,	0),
(734,	606,	490,	'<p></p><p></p><div>Dear Yallamanda,</div><div><br></div><div></div>Thanks for contacting Osdag Team.<div></div><div><br></div><div>Hope you have followed the Installation instruction from <b>README</b>file properly, but still, I would suggest referring <a href=\"https://forums.fossee.in/question/441/osdag-software-not-opening/\" target=\"_blank\" title=\"\">this&nbsp;</a>post for correct installation of Osdag. If the installation is not followed properly then Osdag will not run properly.</div><div>If you have antivirus installed on your system then please disable it before installing Osdag. This is because on some systems during installation of Osdag some packages are been blocked by antivirus.</div><div><br></div><div>Try uninstalling <b>Miniconda, wkhtmltox and Osdag</b> and reinstall following the same sequence with strictly correct <b>installation instructions.</b> Following these steps, if you still get an error please let us know by sending a screenshot of the error that occurs.</div><div><br></div><div></div><div>Regards,</div><div>Osdag Team</div><p></p><p></p>',	'2018-04-03 03:53:23',	'2018-04-09 10:37:17',	0,	0),
(735,	205,	491,	'<p></p><div><span data-mce-style=\"font-family: \'times new roman\', \'new york\', times, serif;\" style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\">Cyclone separator is not available so such units can be replaced by compound separator. Gasifier can be replaced by any reactors depending upon the reaction information available. <br><br>Also, DWSIM allows creating custom unit operation using python/iron Python scripting. Such examples are available under DWSIM samples.<br data-mce-bogus=\"1\"></span></div><div><span data-mce-style=\"font-family: \'times new roman\', \'new york\', times, serif;\" style=\"font-family: &quot;times new roman&quot;, &quot;new york&quot;, times, serif;\"><br data-mce-bogus=\"1\"></span></div><p></p>',	'2018-04-04 11:38:28',	'2018-04-04 11:42:44',	0,	1),
(736,	205,	492,	'<p>What components are you looking for in DWSIM database? In DWSIM, you can add your own components through Compound Creator utility available under file menu. More details about compound creator utility can be found <a href=\"http://dwsim.inforside.com.br/wiki/index.php?title=Using_the_Compound_Creator_Utility\" title=\"\" target=\"_blank\">here</a>.<br></p><p>As far as Unit Operations like scrubbers or any other column is concerned, it can be achieved by Chemsep columns available under \"CAPE-OPEN Unit Operation\" flowsheet object. Kindly drag and drop CAPE-OPEN Unit Operation from flowsheet object and select Chemsep from the list and you can perform any column operation (distillation, absorption/scrubbing, extraction) as per the process requirement. Also, DWSIM has 5 different reactors (CSTR, PFR, Conversion, Equillibrium, Gibbs) which are good enough to carry out any steady state simulations with some approximations in case the reaction is a complex one. What kind of reactor are you looking for? <br></p><p>Also DWSIM being a CAPE-OPEN compliant simulator supports different plug-ins like Scilab Unit Operation, Matlab Unit Operation, Python/IronPython Scripting which enables users to create/model custom unit operations as per the process requirement. This would help you to create any custom flowsheet object as per the process flowsheet provided you know the i/p &amp; o/p variables and governing equations for the model.</p>',	'2018-04-04 11:46:43',	'2018-04-04 11:47:49',	0,	0),
(737,	707,	493,	'You just have to create 5 questions on <a href=\"https://contribute-yaksh.fossee.in/login\" title=\"\" target=\"\">https://contribute-yaksh.fossee.in/login</a>. Instructions on creating questions can be found here <a href=\"https://yaksh-contribution.readthedocs.io/en/latest/\" title=\"\" target=\"\">https://yaksh-contribution.readthedocs.io/en/latest/</a>.  For more information check <a href=\"https://python.fossee.in/fellowship2018/\" title=\"\" target=\"\">https://python.fossee.in/fellowship2018/</a>.',	'2018-04-05 06:47:23',	'2018-04-05 06:47:23',	0,	0),
(738,	707,	493,	'Your questions are already submitted. Now from 9th April to 20th April you have to review 10 questions once the review website is up and running.',	'2018-04-05 12:23:04',	'2018-04-05 12:23:04',	0,	0),
(739,	437,	496,	'Hello,<div>\n</div><div>It might be the installation problem. Please refer the installation instructions here:https://esim.fossee.in/downloads</div><div>or follow this tutorial:http://spoken-tutorial.org/tutorial-search/?search_foss=eSim&amp;search_language=English</div>',	'2018-04-09 04:51:57',	'2018-04-09 04:51:57',	0,	0),
(741,	257,	497,	'Where is this \"sd_synth_fast\" example? Help us to re-produce the problem at our end, step by step.',	'2018-04-11 10:05:49',	'2018-04-11 10:05:49',	0,	0),
(742,	544,	497,	'When I open up Sue2 there is a synthesizer_examples list on the right side with a lot of examples, including the sd_synth_fast example that I doubled clicked  to put it into the main console showing the code for the example. Then I did a compile/run that gave the warning. I should mention that I had this thing running perfectly once before, but I had to uninstall this and then did a reinstall using the original setup file, and the reinstall  was to be OK, with the same desktop icons as in the original install. I did delete the whole CppSim folder after uninstalling to make sure I started from scratch before doing a reinstall. The reinstall worked fine with no problems at all. But the compile\\run gives the mentioned warning.',	'2018-04-11 13:48:21',	'2018-04-11 13:48:21',	0,	0),
(743,	257,	498,	'As I always say, please give us enough information to understand how can we re-produce the problem. Please mention tutorial/web-link that you are referring to. Without this information we cannot correct mistakes, if  any.\n',	'2018-04-13 05:11:29',	'2018-04-13 05:11:29',	0,	0),
(744,	544,	498,	'If you go into the DOC selection tab in  Sue2, you will see the above mentioned Doc. I did say what page of this document I was referring to.',	'2018-04-13 12:12:45',	'2018-04-13 12:12:45',	0,	0),
(745,	729,	25,	'Open the screen keyboard to work for few times after go and get repaired by an expert one day I have also got the same problem in office while working on the computer and making an assignment for the students. I work for the <a href=\"https://www.fullassignmenthelp.co.uk/\" title=\"Full Assignment Help\" target=\"_blank\">fullassignmenthelp</a> is the better way to get the assignment done by experts and at that time I have used the screen keyboard.',	'2018-04-15 04:44:42',	'2018-04-15 04:44:42',	0,	0),
(746,	426,	489,	'If you have met the criteria  for certificate (mentioned at https://python.fossee.in/python-workshops), you will receive an email from FOSSEE to your registered email address with instructions on how to download.\n',	'2018-04-16 05:41:22',	'2018-04-16 05:41:22',	0,	0),
(747,	426,	500,	'You can  skip the question using the option provided in the review interface, you will be \r\nasked for the reason for skipping with comment column, You can select \r\nappropriate reason and mention about the issue with test case.\n',	'2018-04-19 10:02:09',	'2018-04-19 10:02:09',	0,	0),
(748,	600,	25,	'Visit our website to know the reviews of different assignment writing service providers. <div><a href=\"http://www.findassignmentreviews.com/allassignmenthelp-com-review/\" title=\"\" target=\"\">Allassignmenthelp reviews</a></div>',	'2018-04-30 07:34:09',	'2018-04-30 07:34:09',	0,	0),
(749,	257,	503,	'Were you writing a scilab code OR building Xcos diagrams? If you were writing code you can always open it any other editor and save its content in a new file and then try opening it with Scilab. \n',	'2018-05-02 10:59:41',	'2018-05-02 10:59:41',	0,	0),
(750,	749,	25,	'Thanks for informing we are like to share our service that is free of cost you can get it from here <a href=\"https://bigowner.pk/\" title=\"Big Owner\" target=\"\">Big Owner</a> we have the best properties in Pakistan you can see or buy and also sell your property here.',	'2018-05-11 05:50:32',	'2018-05-11 05:50:32',	0,	0),
(751,	437,	531,	'Hello,<div>\n</div><div>You need to construct VCO using subcircuit builder or device modeling feature of eSim. You can refer spoken tutorial of eSim here: http://spoken-tutorial.org/tutorial-search/?search_foss=eSim&amp;search_language=English  or the eSim user manual: https://esim.fossee.in/downloads</div>',	'2018-05-16 05:14:12',	'2018-05-16 07:09:50',	0,	1),
(752,	205,	533,	'Please mention the desired top and bottom compositions that is expected from the distillation column output.\n',	'2018-05-18 08:52:54',	'2018-05-18 08:52:54',	0,	0),
(753,	755,	533,	'<p></p><div><br></div><div><br></div><p></p>',	'2018-05-18 09:05:54',	'2018-05-18 09:07:41',	0,	0),
(754,	205,	533,	'<p>Methanol-Acetonitrile-Benzene forms a very complex ternary azeotropic system and therefore cannot be separated by conventional distillation. It has to be separated by pressure swing distillation. Kindly refer to the DWSIM flowsheeting <a href=\"https://dwsim.fossee.in/flowsheeting-project/completed-flowsheet\" title=\"\" target=\"_blank\">Completed Flowsheets</a>. You can find the flowsheet to solve Methanol-Acetonitrile-Benzene <a href=\"https://dwsim.fossee.in/flowsheeting-project/dwsim-flowsheet-run/99\" target=\"_blank\" title=\"\">here</a>.</p>',	'2018-05-18 10:32:42',	'2018-05-18 10:33:32',	0,	0);
INSERT INTO `website_answercomment` (`id`, `uid`, `answer_id`, `body`, `date_created`, `date_modified`) VALUES
(1,	7,	3,	'printers works with ubuntu based os<div>I have used sudo apt-get install lpadmin &nbsp;.The error msg is \"UNABLE TO LOCATE PACKAGE LPADMIN\"</div><div>I am not able to find the printer options in the netbook.Can you please suggest way to install printer.<br><div><br></div></div>',	'2015-05-07 05:48:16',	'2015-05-07 05:48:16'),
(2,	27,	13,	'Dear Shrikant<br><br>We installed gNash on the FOSSEE laptop which is now playing the flash files, but it is now not able to track the Javascript attached to it, can u help with the javascript part.<br>',	'2015-07-15 08:58:43',	'2015-07-15 08:58:43'),
(3,	4,	13,	'Could you please explain the exact issue with JS?&nbsp; I\'ll connect JS experts to this thread. Thanks<br><br>',	'2015-07-15 09:10:53',	'2015-07-15 09:10:53'),
(4,	27,	13,	'Dear Shrikant <br><br>Actually we have a learning framework which has Multiple flash files connected and hyperlinked, when we start the learning the video restarts even after it is coded to stop once it reaches to end.<br><br>Still will communicate with the developers and give you the exact issue.<br>',	'2015-07-16 04:20:14',	'2015-07-16 04:20:14'),
(5,	27,	14,	'Thank you so much Shrikant, I will try to do as you have directed and will come back with the result.<br>',	'2015-07-20 06:57:02',	'2015-07-20 06:57:02'),
(6,	27,	13,	'Hello Shrikant<br><br>Can i have your mail or communication ID were i can send you few details about the framework and demo login to recreate the issue we are facing. <br>',	'2015-07-20 06:59:09',	'2015-07-20 06:59:09'),
(7,	4,	13,	'Hello, I strongly recommend we continue this discussion here. This could help others with similar JS issues. I hope you understand our concern. <br>Also, Gnash is not a complete replacement for Flash plugin, your existing Flash oriented code may not work with Gnash at all. We, in that case, may not be in a position to resolve this issue anytime soon. <br>My email id is srikant@fossee.in. <br>',	'2015-07-20 08:06:05',	'2015-07-20 08:06:05'),
(8,	29,	15,	'Thanks<br><br>',	'2015-07-23 09:42:20',	'2015-07-23 09:42:20'),
