lse\" Priority=\"39\" QFormat=\"true\" Name=\"TOC Heading\"/>\\r\\n </w:LatentStyles>\\r\\n</xml><![endif]--><!--[if gte mso 10]>\\r\\n<style>\\r\\n /* Style Definitions */\\r\\n table.MsoNormalTable\\r\\n\\t{mso-style-name:\"Table Normal\";\\r\\n\\tmso-tstyle-rowband-size:0;\\r\\n\\tmso-tstyle-colband-size:0;\\r\\n\\tmso-style-noshow:yes;\\r\\n\\tmso-style-priority:99;\\r\\n\\tmso-style-qformat:yes;\\r\\n\\tmso-style-parent:\"\";\\r\\n\\tmso-padding-alt:0cm 5.4pt 0cm 5.4pt;\\r\\n\\tmso-para-margin-top:0cm;\\r\\n\\tmso-para-margin-right:0cm;\\r\\n\\tmso-para-margin-bottom:10.0pt;\\r\\n\\tmso-para-margin-left:0cm;\\r\\n\\tline-height:115%;\\r\\n\\tmso-pagination:widow-orphan;\\r\\n\\tfont-size:11.0pt;\\r\\n\\tfont-family:\"Calibri\",\"sans-serif\";\\r\\n\\tmso-ascii-font-family:Calibri;\\r\\n\\tmso-ascii-theme-font:minor-latin;\\r\\n\\tmso-fareast-font-family:\"Times New Roman\";\\r\\n\\tmso-fareast-theme-font:minor-fareast;\\r\\n\\tmso-hansi-font-family:Calibri;\\r\\n\\tmso-hansi-theme-font:minor-latin;\\r\\n\\tmso-bidi-font-family:\"Times New Roman\";\\r\\n\\tmso-bidi-theme-font:minor-bidi;}\\r\\n</style>\\r\\n<![endif]-->\\r\\n\\r\\n<p class=\"MsoNormal\">Thank you for your quick reply Sir.</p>\\r\\n\\r\\n<p class=\"MsoNormal\">But the solution you suggested did not work, and moreover\\r\\nlogically I don\\u2019t feel it right.</p>\\r\\n\\r\\n<p class=\"MsoNormal\">Take an e.g. suppose there are 2 reservoirs (1<sup>st</sup>\\r\\nour laptop system and 2<sup>nd</sup> Arduino hardware) connected by a pipeline\\r\\n(here serial bus) controlled by certain gates (here Comports). Now if the\\r\\npipeline is blocked anyhow, bi-directional flow (date flow) through it stops.</p>\\r\\n\\r\\n<p class=\"MsoNormal\">To maintain the continuous functioning of this pipeline we need\\r\\nsome better solution.</p>\\r\\n\\r\\n<p class=\"MsoNormal\">The program you provided cannot pass through. </p>\\r\\n\\r\\n',	'2015-07-29 07:44:35',	'2015-07-29 07:44:35'),
(10,	42,	35,	'Actually i created a new user with my name and deleted the student one .<br>The only solution to this problem is to completely reinstall the os!!<br>',	'2015-08-24 19:25:57',	'2015-08-24 19:25:57'),
(11,	4,	35,	'No need to reinstall the OS.<br>You do the following:<br>1) Press Cntl + Alt + f1 and enter to console mode. <br>2) Login with \'root\' as user and \'student\' as password.<br>3) When in you have \'#\' prompt (i.e, root user), enter the following:<br>&nbsp;&nbsp;&nbsp; <strong>usermod -G adm,dialout,sudo,audio,video,plugdev,netdev,ssh,bluetooth,pulse,inet,net_raw \"new-user\"<br></strong>4) Now enter \"reboot\" command to restart. Internet should work now. <br>',	'2015-08-25 06:02:59',	'2015-08-25 06:02:59'),
(12,	29,	40,	'I created block in C++.&nbsp;',	'2015-08-31 08:15:32',	'2015-08-31 08:15:32'),
