(18,	58,	54,	'Hi,<div><br></div><div>Thank you very much for your answer. Could you please suggest how we can plot the node voltage using interactive plotting and the links to some tutorials to do the same.</div><div>Thank You.</div>',	'2015-10-01 18:02:06',	'2015-10-01 18:02:06'),
(19,	56,	54,	'Hi,<br><br>After clicking simulation button an interactive python plotting window will open.<br><br>To know the complete flow of eSim please download the User manual from http://esim.fossee.in/downloads <br><br>It contains 5 example which is being solved from scratch using eSim.<br>',	'2015-10-01 18:30:53',	'2015-10-01 18:30:53'),
