(23,	66,	64,	'Sorry it did not help me to plot the expected diode characteristics.<br>In the circuit mentioned above, while going through the step of Kicad to Ngspice convertion I chose the analysis type as DC, where I have varied the source voltage from 0 to 5 volts in steps of 0.1 volts. It then asks for the parameter values under the heading Source Details. What <i>specific</i> value is being expected there, as the source is a variable one? I left that cell blank during conversion. Might that be the issue?<br>',	'2015-10-23 06:14:13',	'2015-10-23 06:14:13'),
