(32,	56,	68,	'Please open your cmd prompt in windows and go to the location where your eSim is installed. The default location is C:\\\\eSim<br><br>Change directory to this location. <br>&nbsp;<br>cd C:\\\\eSim\\\\src\\\\frontEnd\\\\<br><br>Then type <br>python Application.py<br><br>It will open up your eSim and then try to create new project. If you get the same error just go to the terminal to check the error message just paste that error here. <br><br>&nbsp;<br>',	'2015-10-24 06:39:58',	'2015-10-24 06:39:58'),
(33,	69,	68,	'<div>Traceback (most recent call last):</div><div>&nbsp;&nbsp; File \"application.py\", line 26, in &lt;module&gt;</div><div>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; from PyQt4 import QtGui, Qtcore</div><div>ImportError: No module named PyQt4</div>',	'2015-10-24 07:13:59',	'2015-10-24 07:13:59'),
(34,	56,	68,	'Its look like PyQt4 is not installed properly. But how did you enter new project name in the GUI because PyQt4 is used to develop GUI.<br><br>Please try to reinstall PyQt4 module. Its exe is available in the dependency directory.<br><br>Please right click on exe and run it as administrator. Also if you have any anti virus please disable it.<br>After installation is completed you can enable it again.<br><br>&nbsp;<br>&nbsp;<br>',	'2015-10-24 10:04:02',	'2015-10-24 10:04:02'),
(35,	69,	68,	'same problem is occurring. while I am going to reinstall PyQt4 module it is showing \"error opening file\"',	'2015-10-24 15:03:30',	'2015-10-24 15:03:30'),
(36,	69,	68,	'<div>thanks a lot for helping problem has been rectifier</div><div><br></div>',	'2015-10-24 15:28:08',	'2015-10-24 15:28:08'),
