(38,	78,	74,	'Hi,<div><br></div><div>But UA741 ic is not available in IC componets list. is dat available?</div>',	'2015-11-05 14:05:27',	'2015-11-05 14:05:27'),
(39,	60,	74,	'Hi,<br><br>It is available in eSim_subckt. If you can\'t find then you have to add this library. All eSim library are present in eSim folder ---&gt; kicadschematicLibrary. To add libraries you should go preferences---&gt;set active components----&gt;ADD.<br><br><br>',	'2015-11-06 07:22:46',	'2015-11-06 07:22:46'),
(40,	60,	74,	'Hi,<br><br>It is available in eSim_subckt. If you can\'t find then you have to add this library. All eSim library are present in eSim folder ---&gt; kicadschematicLibrary. To add libraries you should go preferences---&gt;set active components----&gt;ADD.<br><br><br>',	'2015-11-06 07:26:30',	'2015-11-06 07:26:30'),
