(46,	60,	82,	'Hi,<div><br></div><div>There is some issue in ubuntu 14.04 and above while designing PCB layout through eSim. So, you can use Kicad for pcb designing through terminal. You have type kicad in terminal, create or load the schematic and then create the pcb layout. For more details on creating pcb layout in kicad you can go to their website where they have given tutorial also.</div><div><br></div><div>kicad website :&nbsp;<a href=\"http://kicad-pcb.org/\" title=\"\" target=\"\">http://kicad-pcb.org/</a></div><div><br></div><div>Note : For lab migration you don\'t need pcb layout.&nbsp;</div>',	'2015-11-30 06:21:45',	'2015-11-30 06:21:45'),
