(53,	105,	109,	'Is there any way to implement floodfill operation in scilab',	'2016-01-20 05:26:51',	'2016-01-20 05:26:51'),
(54,	90,	109,	'I\'m sure it can be implemented. Please show the code you have developed so far. If the code is too long, please use pastebin and share the link here.<br>',	'2016-01-20 05:38:26',	'2016-01-20 05:38:26'),
(55,	105,	109,	'<div>gr=rgb2gray(im);// im is an image whose path is not specified here</div><div>filter=fspecial(\'sobel\');</div><div>imf = imfilter(gr, filter); // filtered image</div><div>filled=imf;</div><div>filled= flood(imf,1,1,0,255);//function call</div><div>imshow(filled);</div><div><br></div><div>// function for flood fill</div><div><div>function[filled]=flood(imf,x,y,fill_col,old_col)</div><div>if(imf(y,x)=old_col)</div><div>filled(y,x)=fill_col;</div><div>end</div><div>flood(imf,x+1,y,fill_col,old_col);</div><div>flood(imf,x-1,y,fill_col,old_col);</div><div>flood(imf,x,y+1,fill_col,old_col);</div><div>flood(imf,x,y-1,fill_col,old_col);</div><div>endfunction</div></div><div><br></div><div><br></div>',	'2016-01-20 08:42:17',	'2016-01-20 08:42:17'),
(56,	103,	100,	'<span style=\"line-height: 21.4286px;\">We are getting error \"Package not found\" on Eswecha, So we tried to install on ubuntu 12.04. First we did that file as executable and then we try to install (install-linux.sh) file we get error as \"used &nbsp; &nbsp; &nbsp;..linux --install\"&nbsp;</span>',	'2016-01-21 08:17:20',	'2016-01-21 08:17:20'),
(57,	56,	100,	'Dear Yogi,<br><br>It is not an error. It shows that you have to give th install flag to the installation script.<br>It should be ./install-linux.sh&nbsp; --install<br>Do let us know if you found any error while installation.<br><br><br><br>',	'2016-01-21 08:47:08',	'2016-01-21 08:47:08'),
