(73,	115,	130,	'This is matlab code for vehicle count.<span style=\"line-height: 21.4286px;\">Could you please tell the equivalent code &nbsp;for this in scilab?</span><div><span style=\"line-height: 21.4286px;\"><br></span></div><div><div>blobAnalysis = vision.BlobAnalysis(\'BoundingBoxOutputPort\', true, \'AreaOutputPort\', false, \'CentroidOutputPort\', false, \'MinimumBlobArea\', 150);</div><div>bbox = step(blobAnalysis, filteredForeground);</div><div>result = insertShape(frame, \'Rectangle\', bbox, \'Color\', \'green\');</div><div>numCars = size(bbox, 1);</div><div>result = insertText(result, [10 10], numCars, \'BoxOpacity\', 1, \'FontSize\', 14);</div><div>figure; imshow(result); title(\'Detected Cars\');</div></div><div><br></div>',	'2016-02-27 08:15:36',	'2016-02-27 08:15:36'),
