(205,	240,	313,	'<div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">There are essentially three well-known methods for FIR filter design namely :<br></div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">1. The window method.</div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">2.&nbsp;The frequency sampling technique.</div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">3. Optimal filter design methods</div><span style=\"font-family: arial, sans-serif; font-size: 12.8px;\">Every method has its own advantages and disadvantages and is selected depending on the type of filter to be designed.The window method is basically used for the design of prototype filters like the low-pass, high-pass, band-pass etc. They are not very suitable for designing of filters with any given frequency response. On the other hand, the frequency sampling technique is suitable for designing of filters with a given magnitude response. The ideal frequency response of the filter is approximated by placing appropriate frequency samples in the z - plane and then calculating the filter co-efficients using the ifft algorithm.</span><br style=\"font-family: arial, sans-serif; font-size: 12.8px;\"><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\"><br></div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">Secondly,&nbsp;The use of windows offers very little design flexibility e.g. in low pass filter design, the passband edge frequency generally cannot be specified exactly since the window smears the discontinuity in frequency. Thus the ideal LPF with cut-off frequency, is smeared by the window to give a frequency response with passband response with passband cutoff frequency and stopband cut-off frequency.</div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\"><br></div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">So, in order to design a FIR filter with any cut-off frequency range frequency sampling based techniques like&nbsp;Weighted Chebyshev approximation should be used instead.<br></div><div style=\"font-family: arial, sans-serif; font-size: 12.8px;\">Hope your doubt is cleared.</div>',	'2017-01-04 08:13:38',	'2017-01-04 08:13:38'),
