(222,	250,	339,	'Dear Saroj, <br><br>The issue at hand is that you want to program the solver to do certain things. This will not be possible in the case directory. What you need to do is to go into the OpenFOAM source code for the solver that you are using e.g icoFoam and change the values there. <br><br>You could start with this tutorial - https://openfoamwiki.net/index.php/How_to_add_temperature_to_icoFoam, which is a very good introduction on how to program solvers in OpenFOAM. You can follow this tutorial and it will explain how the various variables are handled and how you can make changes. <br><br>It is important you understand the difference between the case directories and the source files of OpenFOAM. The only things you have control over in the case directory are runtime properties like initial conditions, boundary conditions, fluid properties, time-step etc. You can look at FunkySetFields from Swak4Foam on how to set initial condition based on coordinates etc. While the source code will let you handle the essential parts of the computation like variables, time stepping and error correction. <br><br>Let us know if you have any other doubts. <br><br>Regards,<br>Anmol<br>',	'2017-03-27 06:58:55',	'2017-03-27 06:58:55'),
