(244,	243,	366,	'Dear chanyau,<br>Here are some modifications to your code<br>x1^2 :since x1 is a vector, it is better to use x .^ 2.&nbsp; ( .^ operator is for vectors and just ^ is for scalar)<br><br>x2=180:780 : this statement creates a vector with gap of 1. For example, 0:6 makes [0 1 2 3 4 5 6]. whereas 0:2:6 makes [0 2 4 6]. In your case I 60 as the gap. Hence x2=180:60:780<br><br>repmat=repmat function repeats its first input into a matrix of the dimensions of the next two inputs.repmat(2, 1 ,5) makes matrix of 2 of dimension 1x5 i.e. [2 2 2 2 2]. In your case since x2 has 11 elements,plot2d function requires that both x and y have the same dimensions. Therefore I have modified that line to y2=repmat(379.08,1,11)<br><br>The modified code is given below<br><pre style=\"font-family: Monospaced; font-size: 12px; font-style: normal;\"><span style=\"color: rgb(0, 0, 0);\">x1</span><span style=\"color: rgb(92, 92, 92);\">=</span><span style=\"color: rgb(188, 143, 143);\">0</span><span style=\"color: rgb(255, 170, 0);\">:</span><span style=\"color: rgb(188, 143, 143);\">180</span><span style=\"color: rgb(0, 0, 0);\">;</span>\r\n<span style=\"color: rgb(0, 0, 0);\">y1</span><span style=\"color: rgb(92, 92, 92);\">=</span><span style=\"color: rgb(188, 143, 143);\">0.0117</span><span style=\"color: rgb(92, 92, 92);\">.*</span><span style=\"color: rgb(0, 0, 0);\">x1</span><span style=\"color: rgb(92, 92, 92);\">.^</span><span style=\"color: rgb(188, 143, 143);\">2;</span>\r\n<span style=\"color: rgb(50, 185, 185);\">plot2d</span><span style=\"color: rgb(74, 85, 219);\">(</span><span style=\"color: rgb(0, 0, 0);\">x1</span><span style=\"color: rgb(0, 0, 0);\">,</span><span style=\"color: rgb(0, 0, 0);\">y1</span><span style=\"color: rgb(74, 85, 219);\">)</span>\r\n\r\n<span style=\"color: rgb(0, 0, 0);\">x2</span><span style=\"color: rgb(92, 92, 92);\">=</span><span style=\"color: rgb(188, 143, 143);\">180</span><span style=\"color: rgb(255, 170, 0);\">:</span><span style=\"color: rgb(188, 143, 143);\">60:780</span><span style=\"color: rgb(0, 0, 0);\">;</span>\r\n<span style=\"color: rgb(0, 0, 0);\">y2</span><span style=\"color: rgb(92, 92, 92);\">=</span><span style=\"color: rgb(174, 92, 176); text-decoration: underline;\">repmat</span><span style=\"color: rgb(74, 85, 219);\">(</span><span style=\"color: rgb(188, 143, 143);\">379.08</span><span style=\"color: rgb(0, 0, 0);\">,</span><span style=\"color: rgb(188, 143, 143);\">1</span><span style=\"color: rgb(0, 0, 0);\">,</span><span style=\"color: rgb(188, 143, 143);\">11</span><span style=\"color: rgb(74, 85, 219);\">)</span>\r\n<span style=\"color: rgb(50, 185, 185);\">plot2d</span><span style=\"color: rgb(74, 85, 219);\">(</span><span style=\"color: rgb(0, 0, 0);\">x2</span><span style=\"color: rgb(0, 0, 0);\">,</span><span style=\"color: rgb(0, 0, 0);\">y2</span><span style=\"color: rgb(74, 85, 219);\">)<br></span></pre>',	'2017-04-05 07:06:14',	'2017-04-05 07:06:14'),
