(261,	243,	385,	'You do not need to create that folder and install scilab there. In your computer, If \"Gowtham\" is your Username, then you will find the scilab-5.5 folder(or whichever version of scilab you are using) in \"C:/Users/Gowtham/AppData/Roaming/scilab-5.5\". Hence you go to that folder and delete the scilab-5.5 folder. Then&nbsp; freshly install Scilab again like you normally do<br>',	'2017-05-03 12:51:04',	'2017-05-03 12:51:04'),
