(280,	372,	422,	'Hi, sorry about that but I recently realized that the operation is in fact correct. Scilab simplifies the function by actually dividing the polynomials in the numerator and denominator and by simplifying the coefficients, so both Scilab\'s and Matlab\'s answers are equivalent.',	'2017-08-07 11:30:47',	'2017-08-07 11:30:47'),
(281,	90,	417,	'It is best if you do eSim TBC rather than Scilab TBC. Please go through- http://esim.fossee.in/textbook-companion-project<br>',	'2017-08-08 08:24:07',	'2017-08-08 08:24:07'),
(282,	215,	422,	'I was expecting the same. Here is an example&nbsp;<div>Please run the given equation in Matlab and Scilab<br><div>sys = (s+1)*(s+2)*(s+1)/((s+1)*(s+5)*(s+1))</div></div><div>You will see the difference in final result. Matlab keeps the redundant roots in rational polynomials but Scilab not. &nbsp;</div>',	'2017-08-10 05:50:33',	'2017-08-10 05:50:33'),
(283,	378,	431,	'Dear ashutumho<br>thank you a lot (I learned somethings with your code...).<br>However, my doubt is not really about the specific script, but about the possibility of using the \"input\" in Scilab 6.0.0.<br>in Scilab 5.5.2, that script was working, but in Scilab 6.0.0 not. It seems a bug with using \"input\"&nbsp; two times in the same script. E.g., in the following simple script , \"y\" value is asked two times and with something like a \"---&gt;\" in the prompt. It would be a bug in this version?<br><br>function test()<br>x=input(\"x=\");<br>y=input(\"y=\");<br>z=x+y;<br>disp(z,\"z=\")<br>z=return(z)<br>endfunction<br><br>This simple code run ok in Scilab 5.5.2 but not in Scilab 6.0.0....<br>sincerely<br>Julio<br><br><br><br>',	'2017-08-11 11:16:52',	'2017-08-11 11:16:52'),
(284,	215,	431,	'Hi Julio,<div>There is a bug in \"input\" command. Here is the <a href=\"https://www.mail-archive.com/search?l=users@lists.scilab.org&amp;q=subject:%22%5C%5BScilab%5C-users%5C%5D+bug%22&amp;o=newest&amp;f=1\" title=\"\" target=\"\">link</a>. Kindly look into the link. I think it will give the answer of your doubts.&nbsp;</div>',	'2017-08-11 12:22:57',	'2017-08-11 12:22:57'),
(285,	378,	431,	'Dear ashutumho,<br>Thank you very much.<br>Actually, this is a bug in v6.0.0 and it was solved in branch version.<br>sincerely<br>Julio<br>',	'2017-08-13 04:28:04',	'2017-08-13 04:28:04'),
