(335,	437,	512,	'Are you giving any feedback from second opamp to first one(so that it can behave as an oscillator, which does not require input signal). How will you get a square wave at the output of 1st opamp?&nbsp;',	'2017-12-15 07:21:54',	'2017-12-15 07:21:54'),
(336,	460,	512,	'First opamp is a Schmitt circuit and 2nd opamp is an integrator.For clarifications visit. https://www.google.co.in/url?sa=t&amp;source=web&amp;rct=j&amp;url=https://www.allsyllabus.com/aj/note/ECE/LINEAR_ICs_and_APPLICATIONS/unit5/SAW-TOOTH%2520WAVE%2520GENERATOR.php&amp;ved=2ahUKEwiPrenxgobYAhUIRY8KHQ_mDXsQFjAiegQIARAB&amp;usg=AOvVaw03tuc6s_BMf7yrAMonBEIB',	'2017-12-15 07:37:04',	'2017-12-15 07:37:04'),
