(392,	437,	526,	'It should generate the netlist for the subcircuit created. So once doing the subcircuit, you do the kicad to ngspice conversion <b>(3rd tab in subcircuit creation) . </b>Then you do the 2nd step mentioned above.. Now you will be able to see the subckt when you choose <b>Place component</b> in eSim.',	'2017-12-29 07:10:40',	'2017-12-29 07:10:40'),
(393,	458,	526,	'<div style=\"background-color: rgb(249, 246, 246);\">\"\"\"\"\"1. Go to Subcircuit model in eSim, choose \"create new subcircuit model\", select \"yes\". Add the components and make proper connections (refer ua71.cir.out file of any example to know the components added). I added: CCCS, R, C from eSim_sources and port from miscellaneous.</div><div style=\"background-color: rgb(249, 246, 246);\"></div><div style=\"background-color: rgb(249, 246, 246);\">*****&nbsp;<b>Whichever pin you want to connect the inputs/outputs add port. The port and pin number should match.</b></div><div style=\"background-color: rgb(249, 246, 246);\">** Now, annotate, create netlist and to kicad to ngspice conversion. In analysis, choose Ac, lin and 0 to start, stop and points and press convert.</div><div style=\"background-color: rgb(249, 246, 246);\">___________________________________________________</div><div style=\"background-color: rgb(249, 246, 246);\">2. Go to Kicad(Go to dash home/control panel and search Kicad). Go to Library editor(icon with a book mark) and choose create a new component.</div><div style=\"background-color: rgb(249, 246, 246);\">Mark reference as \"X\". Keep other settings as default. Now draw a rectangle assign pin (same as you had assigned before in your schematic)\"\"\"\"\"\"</div><div style=\"background-color: rgb(249, 246, 246);\"><br></div><div style=\"background-color: rgb(249, 246, 246);\"><br></div><div style=\"background-color: rgb(249, 246, 246);\"><br></div><div style=\"background-color: rgb(249, 246, 246);\">I have reached till this but when i click on on current library then dialog box appears , it consists of \'filter\' and \'items\'</div><div style=\"background-color: rgb(249, 246, 246);\">but in items there is no option of eSim_subcircuit.</div>',	'2017-12-29 08:21:18',	'2017-12-29 08:21:18'),
