(440,	530,	597,	'Thank you very much.but are there any spoken tutorials for scilab arduino.i didnt find any. is there any workshop for scilab as well as for scilab-arduino interfacing.?',	'2018-02-15 06:15:45',	'2018-02-15 06:15:45'),
(441,	257,	597,	'There are no spoken tutorials as such for Scilab-Arduino. However we have written a book on how to use Scilab with arduino. See the link https://scilab-arduino.fossee.in/downloads We have spoken tutorials on Arduino though. See http://spoken-tutorial.org/tutorial-search/?search_foss=Arduino&amp;search_language=English <br><br>There is no upcoming workshop on scilab-arduino for now. In case if we host one, it will be notified on fossee.in. So keep checking fossee.in regularly to know about upcoming workshops and other activities.<br>',	'2018-02-15 06:48:14',	'2018-02-15 06:48:14'),
