(445,	425,	613,	'Sorry I can\'t get you.?<div>Will you explain it once again?&nbsp;</div><div>You mean I have to do transient analysis not an AC analysis right....</div><div>If I select transient and give start,stop,step Time no graph is plot.</div>',	'2018-02-17 01:31:00',	'2018-02-17 01:31:00'),
(446,	437,	613,	'Hello,<div><br></div><div>The Ac analysis will give you the frequency response for a different set of frequencies. If you want to see the frequency plot, you need to use plot_log.&nbsp; So, the Amplitude will be represented in a single line, assuming we are giving the AC signal of constant amplitude.</div><div>If you want t see the transient analysis, you need to change the AC from eSim_source to Sine and use plot_v to see the response with respect to time. But,&nbsp;the sine will be of a single&nbsp;frequency.</div><div><br></div>',	'2018-02-17 06:33:03',	'2018-02-17 06:33:03'),
(447,	425,	613,	'if i change AC to sine source nothing is displayed.<br>if you want anything to see in project file??<br><br><br>',	'2018-02-17 14:25:47',	'2018-02-17 14:25:47'),
(448,	425,	615,	'of course, i know the differences.<br>i have seen others had done transient analysis and get continuous cycles of a sine wave while plotting.<br>but i cannot find it. if i rectify that it will help with the current project and future project as well.<br><br>',	'2018-02-17 16:25:18',	'2018-02-17 16:25:18'),
(449,	437,	615,	'Hello,<div><br></div><div>In the transient analysis based on the time step and the constant frequency(50,100,1Khz..), you will get the plot as sine signal.&nbsp;</div><div>Since you are designing BPF, you need to plot the frequency response for a set of frequencies(1 to 1Mhz, 100 to 20Khz). To select the frequency range, you need to select AC analysis. In Ac analysis, the AC input has constant amplitude but the frequency changes. This is the reason, you will not be getting the plot of the sine wave over the set of frequencies.&nbsp;&nbsp;</div>',	'2018-02-17 16:46:45',	'2018-02-17 16:46:45'),
(450,	425,	615,	'is it possible to get continuous sine wave in voltage plot(plot_v1) other than all things are working good.<br>only having doubt in that printing voltage plot.<br>',	'2018-02-17 16:50:09',	'2018-02-17 16:50:09'),
(451,	437,	615,	'I think you have connected both plot_log and plot_v with the same node name.<div>Try to give different labels and then simulate it.</div>',	'2018-02-17 17:04:21',	'2018-02-17 17:04:21'),
(452,	425,	615,	'just keep BPF aside......<br>ok, let me know one thing when i place plot_v1 across input AC voltage(sine or AC) what will be the plotting?<br>whether it will be a straignt line or a continuous cycle of input.<br>if it is a straight line, what source is used to get a continuous wave?<br>',	'2018-02-17 17:38:24',	'2018-02-17 17:38:24'),
(453,	437,	615,	'you will get amplitude plot(straight line).<div>You cannot get the continuous signal with AC analysis because of different frequency range.</div>',	'2018-02-17 18:07:01',	'2018-02-17 18:07:01'),
(454,	425,	615,	'how can I get a continuous plot? <br>when I do transient analysis it shows some errors..... but in AC analysis i get perfect output... <br><br><br>',	'2018-02-18 12:53:58',	'2018-02-18 12:53:58'),
(455,	437,	615,	'Hello,<div>Please understand the difference between the AC analysis and Transient analysis.</div><div>If you see plot_v the x-axis is with respect to time. So, as frequency changes the Time changes. So when you give set of frequencies the plot with respect to time varies. That is the reason, you will not get the continous signal. It&nbsp;is assumed as continuous because it is AC.&nbsp;</div><div>When you give transient analysis, you give a SINGLE frequency. That means the time is constant. You will get a sine wave.</div><div><br></div><div><br></div>',	'2018-02-19 05:39:56',	'2018-02-19 05:39:56'),
(456,	544,	610,	'This was very helpful and worked!',	'2018-02-20 21:38:34',	'2018-02-20 21:38:34'),
