(462,	554,	627,	'<pre style=\"font-family:Monospaced;font-style:normal;font-size:12.0;\"><span style=\"color:rgb(50,185,185);\">Thank you Shamika, I used the function filtic provided in signal processing tool box as shown below, but i am getting error<br><br>clc</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(100,174,100);font-style:italic;\">// Difference equation is y[n]+3y[n-1]=x[n]+x[n-1]; x[n]=(1/2)^n u[n];y(-1)=2</span>\r\n<span style=\"color:rgb(0,0,0);\">n</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(188,143,143);\">3</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">a</span> <span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\">[</span><span style=\"color:rgb(188,143,143);\">1</span> <span style=\"color:rgb(188,143,143);\">3</span><span style=\"color:rgb(74,85,219);\">]</span><span style=\"color:rgb(0,0,0);\">;</span> <span style=\"color:rgb(100,174,100);font-style:italic;\">//left hand side of difference equation</span>\r\n<span style=\"color:rgb(0,0,0);\">b</span> <span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\">[</span><span style=\"color:rgb(188,143,143);\">1</span> <span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(74,85,219);\">]</span><span style=\"color:rgb(0,0,0);\">;</span> <span style=\"color:rgb(100,174,100);font-style:italic;\">//right hand side of difference equation</span>\r\n<span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\">[</span><span style=\"color:rgb(188,143,143);\">2</span><span style=\"color:rgb(74,85,219);\">]</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(92,92,92);\">/</span><span style=\"color:rgb(188,143,143);\">2</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(92,92,92);\">.^</span><span style=\"color:rgb(0,0,0);\">n</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">zi</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(0,0,0);\">filtic</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">b</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">a</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">y1</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(174,92,176);text-decoration:underline;\">filter</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">b</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">a</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(74,85,219);\">[</span><span style=\"color:rgb(0,0,0);\">zi</span><span style=\"color:rgb(74,85,219);\">]</span><span style=\"color:rgb(74,85,219);\">)</span>\r\n<span style=\"color:rgb(50,185,185);\">plot2d3</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">n</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">y1</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(74,85,219);\">)</span>\r\n<span style=\"color:rgb(174,92,176);text-decoration:underline;\">plot</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">n</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(0,0,0);\">y1</span><span style=\"color:rgb(0,0,0);\">,</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(188,143,143);\">r</span><span style=\"color:rgb(188,143,143);\">.</span><span style=\"color:rgb(188,143,143);\">\'</span><span style=\"color:rgb(74,85,219);\">)<br><br>Error<br>!--error 4 <br>Undefined variable: calloctave<br>at line      34 of function filtic called by :  <br>zi=filtic(b,a,y,x);<br>at line      10 of exec file called by :    <br>exec(\'C:\\Users\\admin\\Documents\\DSP\\test2.sce\', -1)<br> <br></span></pre>',	'2018-02-24 05:57:17',	'2018-02-24 05:57:17'),
(463,	90,	627,	'Please follow the instructions given here- https://scilab.in/fossee-scilab-toolbox/signal-processing-toolbox . We can only support Ubuntu 14.04 installation for now. <br>',	'2018-02-24 17:00:51',	'2018-02-24 17:00:51'),
(464,	544,	634,	'<p>I have since found 2 ways to do this: define A &amp; B as 2 vectors. Then sum(A.*B) and A*B\' both calculate the dot product. Why this dot product</p><p>function is not part of the matrix operators is beyond my reasoning.</p>',	'2018-02-25 16:21:02',	'2018-02-25 16:21:02'),
(465,	65,	634,	'That is precisely what I meant, sum of a.*b.&nbsp; Because it is very simple, they have not defined a new function!&nbsp; In any case, you may find the links in my last post to be useful.<br>',	'2018-02-26 02:58:34',	'2018-02-26 02:58:34'),
(466,	554,	627,	'working on windows any other solution<br><br>',	'2018-02-26 04:53:50',	'2018-02-26 04:53:50'),
(467,	90,	627,	'Sorry not at the moment. We will let you know one we\'ve released the Windows version.<br>',	'2018-02-26 06:27:49',	'2018-02-26 06:27:49'),
(468,	437,	643,	'Hello,<div>We are able to simulate the CMOS_Inverter.</div><div>Send&nbsp; your email Id to&nbsp;<span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">contact-esim [at] fossee [dot]</span><span style=\"background-color: rgb(252, 252, 252); color: rgb(0, 0, 0); font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px;\">&nbsp;. I can send you the snapshots of the output.</span></div>',	'2018-03-01 05:59:03',	'2018-03-01 05:59:03'),
(469,	563,	645,	'Hi,<div><br></div><div>I\'m still incurring an error. I did have two different versions of Python on my PC, so I uninstalled it along with all eSim files and tried reinstalling it. But I\'m still getting the same error.&nbsp;</div><div>Any other suggestions?&nbsp;</div><div><br></div><div>Thanks.</div>',	'2018-03-01 10:16:16',	'2018-03-01 10:16:16'),
(470,	437,	645,	'Hello, so are you able to give project name?<div>Because you posted another question about libraries.</div>',	'2018-03-02 09:54:04',	'2018-03-02 09:54:04'),
(471,	572,	657,	'I installed eSim correctly and what to do with kicad libraries.',	'2018-03-03 17:09:29',	'2018-03-03 17:09:29'),
(472,	572,	657,	'also and was sent with the appropriate screenshot<div><br></div>',	'2018-03-03 17:10:10',	'2018-03-03 17:10:10'),
(473,	572,	657,	'also an email was sent with the appropriate screenshot.',	'2018-03-03 17:11:01',	'2018-03-03 17:11:01'),
(474,	437,	657,	'Eeschema is part of Kicad. So when you use eeschema, basically you are working with Kicad.<div>So, if Kicad is not installed properly, then you will get eeschema error, and all the libraries(including eSim) will be in C drive.</div><div>So, try to reinstall Kicad. And also, try to run python Application.py from src&gt;&gt;frontend and let me know the error.</div>',	'2018-03-03 17:48:36',	'2018-03-03 17:48:36'),
(475,	425,	658,	'of course, i placed plot_db at the output and also moreover i got frequency plotting in Ngspice plot...<br>but i didn\'t get frequency plot in python plot. <br>how can i get frequency plot in python plotting? <br>can you get me???<br>',	'2018-03-04 13:59:38',	'2018-03-04 13:59:38'),
(476,	437,	658,	'Hello,<div><br></div><div>Refer Low pass filter/High pass filter from \"Examples\" folder in eSim-1.1.2</div>',	'2018-03-04 14:14:49',	'2018-03-04 14:14:49'),
(477,	544,	662,	'If you take out the sgrid() it works OK.',	'2018-03-06 01:59:58',	'2018-03-06 01:59:58'),
(478,	544,	665,	'<p>I should see a poles at -20, -2.5+9.68i, and -2.5-9.68i and a zero at -5 not all the poles&nbsp; on the real axis.</p>',	'2018-03-06 05:19:34',	'2018-03-06 05:19:34'),
(479,	257,	665,	'If you run it without sgrid(), your imaginary axis scale might be too big to show you the poles on imaginary axis. Try zooming in using mouse scroll. Note that zooming will work only on local scilab and not on the cloud.<br>',	'2018-03-06 07:00:42',	'2018-03-06 07:00:42'),
(480,	544,	665,	'<p>That still does not explain why it does not work with sgrid and why the whole thing works in the cloud.&nbsp;</p>',	'2018-03-06 15:25:01',	'2018-03-06 15:25:01'),
(481,	544,	668,	'The last question in the main post was never answered.',	'2018-03-06 15:36:41',	'2018-03-06 15:36:41'),
(482,	257,	665,	'The plot comes after evans() which is the loci of the poles as the closed-loop gain K sweeps from 0 to 100. Ofcourse you will not see the poles in the same location as they are in the plant\'s transfer function. Run plzr() on your plant\'s transfer function and then see the result. There you may want to zoom in to see the location of poles on the imaginary axis as you are expecting. <br><br>Short answer: Your code works fine as it is on both the cloud as well as local scilab. <br>',	'2018-03-06 16:22:36',	'2018-03-06 16:22:36'),
(483,	544,	665,	'nonsense! I see the evans graph for a short moment of time, and the immediately afterwards&nbsp; a plot of poles and tangent lines over riding the initial&nbsp;evans plot which completely disappears&nbsp;, and there is no zooming in on the remaining plot!',	'2018-03-06 23:52:21',	'2018-03-06 23:52:21'),
(484,	544,	668,	'I meant only step 13 instead of step 3',	'2018-03-06 23:56:37',	'2018-03-06 23:56:37'),
(485,	285,	671,	'Hello Madam, We are using our own solver which uses fvDOM library, which in turn using PBiCG as a matrix solver to provide the solution.<br>If you want, I can send you a copy of that.<br><br><br>Thank you very much.<br><br>Regards,<br>Ankur<br>',	'2018-03-07 10:35:24',	'2018-03-07 10:35:24');
