(489,	572,	657,	'Thnq for the feedback... Will be looking forward for the solution',	'2018-03-09 14:32:58',	'2018-03-09 14:32:58'),
(490,	544,	435,	'I don\'t see it in atoms!&nbsp; Where is it?',	'2018-03-09 23:42:01',	'2018-03-09 23:42:01'),
(491,	544,	674,	'I did review these tutorials. The first one is very basic and other than finding the current working directory and opening and closing textfiles, that doesn\'t&nbsp; help&nbsp; much.&nbsp; So if the overload-1.3.3.tar doesn\'t work on windows, the whole article seems useless and I still don\'t&nbsp; know how to install the symbolic toolbox into Scilab, which all I wanted to do from the start so that I could run some of the example code (using syms) that is being posted by the Scilab people. I suppose it would help a heck of a lot if there were a windows version of installation instructions, but that seems like to much to ask for. Will the command&nbsp; \"<span style=\"color: rgb(38, 25, 189); font-size: 13px; background-color: rgb(249, 246, 246);\">exec loader.sce\"&nbsp; even work in the windows environment? There is a windows tool that will allow me to extract a tar file. So maybe if I extracted the tar file&nbsp; and&nbsp; then did the remaining steps, would that work?</span>',	'2018-03-10 00:02:55',	'2018-03-10 00:02:55'),
(492,	544,	600,	'That link seems to verify that it is impossible to install the scilab symbolic toolbox in a windows OS. That is very sad since more people do not use linux as compared to us that use windows! So maybe the people who are providing this alternative environment to the Matlab environment would at least think about making this more windows compatible since most of the example code that I have seen so far does contain the syms command and that requires the symbolic toolbox! But all the installation instructions that I have seen are only for linux users!',	'2018-03-10 17:07:24',	'2018-03-10 17:07:24'),
(493,	544,	600,	'That link seems to verify that it is impossible to install the scilab symbolic toolbox in a windows OS. That is very sad since more people do not use linux as compared to us that use windows! So maybe the people who are providing this alternative environment to the Matlab environment would at least think about making this more windows compatible since most of the example code that I have seen so far does contain the syms command and that requires the symbolic toolbox! But all the installation instructions that I have seen are only for linux users!',	'2018-03-10 17:13:01',	'2018-03-10 17:13:01'),
(494,	544,	676,	'If I had known that you were only concerned with Linux user I would not have wasted my time and used Matlab instead.',	'2018-03-11 04:58:53',	'2018-03-11 04:58:53'),
(495,	90,	676,	'We develop tools for all our users including Windows platform users. For this toolbox, we do not have the resources to devote time to build a Windows compatible toolbox as we are not the original toolbox authors. You could take up your concern with the toolbox authors. Or, for symbolic computation you could use Sage too. <br>',	'2018-03-11 09:24:42',	'2018-03-11 09:24:42'),
(496,	544,	676,	'Well what is Saga? And will it allow me run these Scilab examples containing syms?',	'2018-03-11 14:48:18',	'2018-03-11 14:48:18'),
(497,	544,	676,	'Maybe on the Scilab download site there ought to be a message that the windows download does not contain&nbsp;all the functionality of the Linux version so us windows user will know what we are getting into before finding out the hard way that the windows version&nbsp;is an inferior product! How do I get in touch with the toolbox authors? And, what is Sage? And will it allow me to run your published example code containing syms?',	'2018-03-11 14:58:49',	'2018-03-11 14:58:49'),
(498,	90,	676,	'Sage link- http://doc.sagemath.org/html/en/index.html. You should be able to get the same results but the syntax will differ. I\'m not sure if Sage has a \'syms\' function. Sage and Scilab are in no way connected. Both are FOSS tools but we do not offer support for Sage.<br>',	'2018-03-11 21:50:15',	'2018-03-11 21:50:15'),
(499,	590,	679,	'this project does not contain any kicad&nbsp;netlist file for conversion<div><br></div>',	'2018-03-12 06:44:08',	'2018-03-12 06:44:08'),
(500,	590,	679,	'but i have generated a netlist and it is showing as well in my project section as well as in my workspace folder',	'2018-03-12 06:45:11',	'2018-03-12 06:45:11'),
(501,	437,	679,	'Hello,<div><br></div><div>When you select Netlist generation in Eeschema, select \"Spice\" and then click on \"Default\". It will save your file with .cir extension. this cir file will be used for simulation</div><div>If you don\'t select Spice then by default it will be \"PCB \" and the file is saved with .net. The .net file cannot be used for simulation. It will be used for PCB generation.</div>',	'2018-03-12 06:58:32',	'2018-03-12 06:58:32'),
(502,	590,	679,	'thanks alot<div>and sorry for my stupid mistake</div>',	'2018-03-12 07:05:51',	'2018-03-12 07:05:51'),
(503,	437,	679,	'All the best.<div>You can refer spoken tutorials on eSim&nbsp;here:&nbsp;http://spoken-tutorial.org/tutorial-search/?search_foss=eSim&amp;search_language=English</div>',	'2018-03-12 07:09:27',	'2018-03-12 07:09:27'),
(504,	544,	677,	'I was thinking about contacting the toolbox authors directly!',	'2018-03-12 17:08:06',	'2018-03-12 17:08:06'),
(505,	544,	677,	'In&nbsp; the above overload link there is a mention of&nbsp;\" <span style=\"text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial, helvetica, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255); font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">toolbox must be compiled with<span>&nbsp;</span></span><i style=\"text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial, helvetica, sans-serif; font-size: 13px; font-weight: 400; word-spacing: 0px; white-space: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255); font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\">Scilab</i><span style=\"text-align: left; color: rgb(0, 0, 0); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: arial, helvetica, sans-serif; font-size: 13px; font-style: normal; font-weight: 400; word-spacing: 0px; float: none; display: inline !important; white-space: normal; orphans: 2; widows: 2; background-color: rgb(255, 255, 255); font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><span>&nbsp;</span>built from source files\"&nbsp;to&nbsp;make a windows version.&nbsp; &nbsp;Exactly what does that mean?&nbsp; &nbsp;In Eclipse one would take the files, main, &nbsp;etc. along with a make file and then use the compiler. The builder.sce file looks like some sort of make file, but I have idea which files what I want to compile. Maybe there is another tutorial that I am missing here. So it looks like I can make a windows version, but need help compiling the code with Scilab.</span>',	'2018-03-12 17:43:43',	'2018-03-12 17:43:43'),
(506,	592,	682,	'Thank you ! I found it.',	'2018-03-13 09:28:42',	'2018-03-13 09:28:42'),
(507,	437,	682,	'All the best.',	'2018-03-13 09:29:46',	'2018-03-13 09:29:46'),
(508,	621,	692,	'Right after giving the name of project',	'2018-03-17 06:16:37',	'2018-03-17 06:16:37'),
(509,	437,	692,	'<style type=\"text/css\"><!--td {border: 1px solid #ccc;}br {mso-data-placement:same-cell;}--></style><span style=\"font-size: 10pt; font-family: &quot;Times New Roman&quot;;\" data-sheets-value=\"{&quot;1&quot;:2,&quot;2&quot;:&quot;Please uninstall eSim and its dependencies. If you are using windows OS, go to control panel, remove eSim and its dependencies(kicad, ngspice,pyqt4,matplotlob). Deactivate the antivirus.Download eSim from the website. you can download from link:http://esim.fossee.in/downloads. Run the setup file as administrator and also open the eSim icon as administrator.\\nIf you are getting error again. Go to console window. Set the path where the eSim has installed.The default location is C:\\\\\\\\eSim\\nChange directory to this location. cd C:\\\\\\\\eSim\\\\\\\\src\\\\\\\\frontEnd\\\\\\\\ Then type : python Application.py&quot;}\" data-sheets-userformat=\"{&quot;2&quot;:4865,&quot;3&quot;:[null,0],&quot;11&quot;:4,&quot;12&quot;:0,&quot;15&quot;:&quot;Times New Roman&quot;}\">Please uninstall eSim and its dependencies. If you are using windows OS, go to control panel, remove eSim and its dependencies(kicad, ngspice,pyqt4,matplotlob). Deactivate the antivirus.Download eSim from the website. you can download from link:http://esim.fossee.in/downloads. Run the setup file as administrator and also open the eSim icon as administrator.<br>If you are getting the error again. Go to console window. Set the path where the eSim has installed.The default location is C:\\\\eSim<br>Change directory to this location. cd C:\\\\eSim\\\\src\\\\frontEnd\\\\ Then type : python Application.py</span>',	'2018-03-17 07:23:59',	'2018-03-17 07:23:59'),
(510,	621,	692,	'Thank you, the problem is rectified....',	'2018-03-18 05:43:42',	'2018-03-18 05:43:42'),
(511,	622,	696,	'Ubuntu 16.04, i am using scilab 5.5.2, installed it using [sudo apt-get install scilab]<br>',	'2018-03-18 07:53:06',	'2018-03-18 07:53:06'),
(512,	90,	696,	'<font size=\"3\">This toolbox only works for Ubuntu 14.04 as clearly stated on the Scilab website. <br></font>',	'2018-03-18 10:57:05',	'2018-03-18 10:57:05'),
(513,	437,	690,	'<span style=\"font-family: &quot;Times New Roman&quot;; font-size: 13.3333px;\">Please uninstall eSim and its dependencies. If you are using windows OS, go to control panel, remove eSim and its dependencies(kicad, ngspice,pyqt4,matplotlob). Deactivate the antivirus.Download eSim from the website. you can download from link:http://esim.fossee.in/downloads. Run the setup file as administrator and also open the eSim icon as administrator.</span><br style=\"font-family: &quot;Times New Roman&quot;; font-size: 13.3333px;\"><span style=\"font-family: &quot;Times New Roman&quot;; font-size: 13.3333px;\">If you are getting the error again. Go to console window. Set the path where the eSim has installed.The default location is C:\\\\eSim</span><br style=\"font-family: &quot;Times New Roman&quot;; font-size: 13.3333px;\"><span style=\"font-family: &quot;Times New Roman&quot;; font-size: 13.3333px;\">Change directory to this location. cd C:\\\\eSim\\\\src\\\\frontEnd\\\\ Then type : python Application.py</span>',	'2018-03-18 13:14:32',	'2018-03-18 13:14:32'),
(514,	622,	696,	'Thank you, I have switched to 14.04 and Octave toolbox is working fine. But the problem persists while installing DSP toolbox, the error while trying to execute demo program is:<br><br>\"--&gt;exec demo.sce<br>&nbsp;<br>--&gt;//Example taken from https://in.mathworks.com/help/signal/examples/dft-estimation-with-the-goertzel-algorithm.html<br>&nbsp;<br>--&gt;//DFT Estimation with the Goertzel Algorithm<br>&nbsp;<br>--&gt;cd /home/fossee/Desktop/FOSSEE_Scilab_Octave_Interface_Toolbox<br>cd /home/fossee/Desktop/FOSSEE_Scilab_Octave_Interface_Toolbox<br>&nbsp;!--error 998 <br>cd: Cannot go to directory /home/fossee/Desktop/FOSSEE_Scilab_Octave_Interface_Toolbox<br>at line&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; 3 of exec file called by :&nbsp;&nbsp;&nbsp; <br>exec demo.sce<br>\"<br><br>',	'2018-03-18 14:31:55',	'2018-03-18 14:31:55'),
(515,	622,	696,	'problem solved, directory was defined wrong. Thank you for your response!<br>',	'2018-03-18 14:37:49',	'2018-03-18 14:37:49'),
(516,	544,	700,	'From the link given, I see it is possible to use a Windows environment: &nbsp;Microsoft Visual Studio, git, etc. &nbsp;So it looks like it can be&nbsp; done, but you seem to be against using Windows because you think it is a real pain to try to do this. Comments welcome. &nbsp;Years ago, while working at PWA I used a Linux OS and remember using a very windows like environment for development. So if I add in a second operating system to my computer, do you have any recommendations for the Linux environment to be used? Other than just the plain command line, original Linux OS.',	'2018-03-19 14:54:09',	'2018-03-19 14:54:09'),
(517,	677,	709,	'FOLLOWED ALL THE INSTRUCTION BUT STILL GETTING ERROR IN COMMAND PROMPT.<div>\" Traceback (most recent call last):</div><div>&nbsp; File \"osdagMainPage.py\", line 9, in &lt;module&gt;</div><div>&nbsp; &nbsp; from PyQt5 import Qt</div><div>ImportError: No module named PyQt5\"</div>',	'2018-03-22 06:54:05',	'2018-03-22 06:54:05'),
