(522,	550,	639,	'<div>Hello Sir&nbsp;</div><div>First of all Thanks for your reply. As I am new to this software and unaware of python script I have no idea how to create a new unit operation using the same.A<span style=\'display: inline !important; float: none; background-color: transparent; color: rgb(34, 34, 34); font-family: \"Varela Round\",sans-serif; font-size: 14px; font-style: normal; font-variant: normal; font-weight: 400; letter-spacing: normal; orphans: 2; text-align: left; text-decoration: none; text-indent: 0px; text-transform: none; -webkit-text-stroke-width: 0px; white-space: normal; word-spacing: 0px;\'>lso</span> I am not getting enough material on how to work with python script . It would be a great help if you could suggest some references to lookup or how to create a new simple unit operation using Python script. Thank You.</div>',	'2018-03-25 05:00:35',	'2018-03-25 05:00:35'),
(523,	683,	720,	'I\'ve already emailed but I have not yet received the reply, it\'s been 2 days.',	'2018-03-26 08:25:36',	'2018-03-26 08:25:36'),
(524,	695,	730,	'I changed the vdd component to dc source of 22V. V1 is a pulse generator.',	'2018-03-30 06:39:37',	'2018-03-30 06:39:37'),
(525,	695,	730,	'The new netlist as below:<div><p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">vin1&nbsp; in GND pulse&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">M3&nbsp; Net-_M3-Pad1_ in Net-_M3-Pad3_ Net-_M3-Pad3_\r\nMOS_P&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">M4&nbsp; out in Net-_M3-Pad1_ Net-_M3-Pad3_ MOS_P&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">M5&nbsp; GND Net-_M5-Pad2_ Net-_M3-Pad1_ Net-_M3-Pad3_\r\nMOS_P&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">M1&nbsp; out in Net-_M1-Pad3_ GND MOS_N&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">M2&nbsp; Net-_M1-Pad3_ in GND GND MOS_N&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">M6&nbsp; Net-_M6-Pad1_ Net-_M5-Pad2_ Net-_M1-Pad3_ GND\r\nMOS_N&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">U2&nbsp; out plot_v1&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">v2&nbsp; Net-_M3-Pad3_ GND DC&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<p class=\"MsoPlainText\"><span style=\"font-family:&quot;Courier New&quot;\">v3&nbsp; Net-_M6-Pad1_ GND DC&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; <o:p></o:p></span></p>\r\n\r\n<span style=\"font-size:10.5pt;line-height:115%;font-family:&quot;Courier New&quot;;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-ansi-language:\r\nEN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA\">U1&nbsp; in plot_v1&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></div>',	'2018-03-30 06:40:55',	'2018-03-30 06:40:55'),
(526,	703,	732,	'But that model lm317k and other lm317s are there in the library the circuits are already made the only point when I click to convert kicad to &nbsp;ngspice it gives me errors. After hours of building these circuits when I click convert this error came in each of my 5 circuits. Then just for sake of experimenting I took a simple circuit then it got converted as that circuit had no ic in it but for plotting it gave error that is fatal error for plotting python graph',	'2018-04-03 04:11:46',	'2018-04-03 04:11:46'),
(527,	437,	732,	'All kicad components in eeschema are compatible for PCB. But, if you need simulation results, the devices should be compatible with ngspice. If the device is not compatible with ngspice, then you will get the error as an unknown model.',	'2018-04-03 05:49:04',	'2018-04-03 05:49:04'),
