INSERT INTO `website_question` (`id`, `user_id`, `category_id`, `title`, `body`, `date_created`, `date_modified`, `views`, `num_votes`, `sub_category`) VALUES
(1,	4,	8,	'Damped audio through speakers and headphone',	'The audio through speakers are damped, unable to set them to high volume without distortion.&nbsp;<div>Also, sometimes audio doesn\'t come from speakers at all.&nbsp;</div>',	'2015-03-26 05:22:17',	'2018-05-20 19:39:53',	515,	1,	''),
(2,	5,	2,	'Check if a file exists using Python',	'How do I check if a file exists, using Python, without using a try statement?\\r\\n\\r\\n        ',	'2015-03-27 06:56:28',	'2018-05-20 21:26:29',	729,	0,	''),
(3,	7,	8,	'printer',	'Dear sir/madam<div>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Can you &nbsp;please mention the procedure to &nbsp;configure and add network printer.as some commands are not working .</div><div><br></div><div>Thanking you</div><div>Rodney Bernard</div><div>DNAP</div><div>TIFR</div><div>MUMBAI</div><div><br></div>',	'2015-05-06 07:04:41',	'2018-05-20 18:10:46',	505,	2,	''),
(4,	24,	9,	'Scilab code to Sandhi block',	'If I have the scilab code for my application, how can I convert it into a Sandhi block?<br>',	'2015-07-13 09:35:28',	'2018-05-20 19:49:36',	549,	0,	''),
(5,	27,	8,	'Not able to install Flash Plugin in Firefox on FOSSEE',	'We are trying to install flash plugin in the firefox browser installed on the OS, but it is not getting installed or even other plugins to run flash animations in browser are not working.<div><br></div><div>Request you to provide some solution for the same.</div>',	'2015-07-15 07:00:16',	'2018-05-21 04:33:08',	403,	0,	''),
(6,	24,	9,	'Porting Sandhi program on website',	'<span dir=\"ltr\"><font face=\"Calibri,Arial,Helvetica,sans-serif\" color=\"black\" size=\"3\"><span style=\"font-size:12pt;background-color:white;\">How\\r\\n is a Sandhi program ported on to a web site? Once it is available on \\r\\nthe website, will it be accessible from any operating system including \\r\\nWindows?</span></font></span>',	'2015-07-16 08:23:14',	'2018-05-20 19:53:56',	434,	0,	''),
