(15,	35,	11,	'modification in firmware for pwm freq setup',	'Hi.. <br><br>&nbsp;I wanted to do a close loop control system stability analysis.. Unfortunately, arduino gives me a analog output in pwm form..Will it help to modify pwm freq in setup of firmware to highest and filter o/p using simple rc filter, without impacting system characteristics/transfer function<br><br>Regards<br>Rajaneesh<br>',	'2015-08-05 12:37:58',	'2018-05-20 18:10:44',	413,	0,	''),
