(72,	101,	3,	'Simulation of basic logic gates',	'<br>Sir/Madam,<br><br>Where can I read about simulating basic logic gates using eSim. We tried out simulating using the d_inverter component from eSim_Digital library and the \"pulse\" source from the \"eSim_Sources\" library. But during simulation we get the error \"Error while opening the python plotting Editor\". I am sure we have made some mistake in the schema or may be while entering the values for the \"pulse\" component. Would you kindly look at the .cir file below and help us to solve the problem. We will also be very grateful if you kindly send us some tutorials on simulating digital circuits. <br><br>Best regards,<br>Arup Baruah.<br><br>The .cir file:<br><br>* /home/abaruah/Work/eSim/Workspace/Test06/Test06.cir<br><br>* EESchema Netlist Version 1.1 (Spice format) creation date: Mon Jan 18 12:57:10 2016<br><br>* To exclude a component from the Spice Netlist add [Spice_Netlist_Enabled] user FIELD set to: N<br>* To reorder the component spice node sequence add [Spice_Node_Sequence] user FIELD and define sequence: 2,1,0<br><br>* Sheet Name: /<br>U1&nbsp; Net-_U1-Pad1_ GND d_inverter&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br>v1&nbsp; Net-_U1-Pad1_ GND pulse&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp; <br><br>.end<br><br>The .cir.out file:<br><br>* /home/abaruah/work/esim/workspace/test06/test06.cir<br><br>* u1&nbsp; net-_u1-pad1_ gnd d_inverter<br>v1&nbsp; net-_u1-pad1_ gnd pulse(0 1 0 0 0 1 1)<br>a1 net-_u1-pad1_ gnd u1<br>* Schematic Name: d_inverter, NgSpice Name: d_inverter<br>.model u1 d_inverter(fall_delay=1.0e-9 input_load=1.0e-12 rise_delay=1.0e-9 ) <br>.tran 0e-00 0e-00 0e-00<br><br>* Control Statements <br>.control<br>run<br>print allv &gt; plot_data_v.txt<br>print alli &gt; plot_data_i.txt<br>.endc<br>.end<br><br><br><br><br><br><br>',	'2016-01-18 07:48:10',	'2018-05-20 19:55:57',	769,	0,	''),
