(105,	127,	3,	'eSim Eeschema Diode component problem.',	'Hi,<br><br>The diode component from eSim_Devices Eeschema library have changed pin numbers in comparison to kicad Device lib.<br>The diode draw cathode is named as K and his pin number is 2, while diode anode is named as A and have pin number 1. In the KiCad Device Lib K is numbered as 1 and A as 2. Also the draw is Y mirrored.<br><br>This may not seems to be a problem because you would use eSim devices to simulate a circuit only. But KiCad has a problem with duplicated names in different libs. In my case, I had used an already prepared hierarchical sheet in a new board which the components should be updated. KiCad assimilate my diodes to eSim_Devices&nbsp; D and all the footprints in my board (which use KiCad lib diode numeration) went reversed.<br><br>I think that ngspice use pin 1 as anode and pin 2 as cathode, so simply invert the component pins would not be possible, and also the diodes should be named as D.<br><br>What can we do? Maybe it can be solve in kicad to ngspice converter?<br>',	'2016-03-23 21:19:19',	'2018-05-21 06:25:41',	687,	0,	''),
(106,	128,	3,	'incorect ac simulaton',	'Hi!<br><br>AC:<br>Making ac simulation of simple source-R-C-gnd serial circuit on eSim i always get flat curve at 0v.<br> Ngspice return, plot of Vsource(?!) and Vc, wich are <b>both</b> zero ...<br>Why is v source zero?<br>I tried with ac, sine and other sources, always the same.<br><br>DC:<br>If i add resistor R2 in paralel with C, then i get correct values for input Vs and output V<sub>R2</sub>,&nbsp; for the case of sweep of value of R2.<br>With that resistor in paralel with C, for ac analisis Vc and Vs are again zero.<br><br>TRANSIENT:<br>Second nag is that making transient simulation i get already from ngspice one dimensiolal graf, values have extension only in y directon.<br>For all specified cases I have no error mesages from ngspice.<br><br>Thanks<br>Matjaz<br>',	'2016-03-29 00:40:00',	'2018-05-20 19:41:49',	533,	0,	''),
(107,	131,	1,	'scilab plot contourf ',	'<pre>Hallo zusammen\\r\\n\\r\\nich habe in scilab eine fft gemacht und m\\xf6chte sie in einem contourf 3d \\r\\nplot plotten. als x-Achse soll die Anzahl der Flaschen pro h aufgetragen \\r\\nwerden, die bei 2500 st\\xfcck pro h liegt. Als y Achse soll die Frequenz \\r\\naus der fft aufgetragen werden und in z Richtung sollen die absolut \\r\\nwerte aus der fft aufgetragen werden.\\r\\n\\r\\num das Projekt vll besser zu verstehen wollte ich noch beif\\xfcgen, dass es \\r\\nsich um eine Flaschentransportmaschine handelt bei der eine \\r\\nSchwingungsmessung gemacht wird und der komplette Drehzahl Bereich \\r\\ndurchgefahren wird.\\r\\n\\r\\nleider habe ich keine Ahnung wie ich dort rangehen soll.\\r\\n\\r\\nfunction z=peaks(x, y)\\r\\nx1=x(:).*.ones(1,size(y,\'*\'));\\r\\ny1=y(:)\'.*.ones(size(x,\'*\'),1);\\r\\nz =  (3*(1-x1).^2).*exp(-(x1.^2) - (y1+1).^2) ...\\r\\n   - 10*(x1/5 - x1.^3 - y1.^5).*exp(-x1.^2-y1.^2) ...\\r\\n   - 1/3*exp(-(x1+1).^2 - y1.^2)\\r\\nendfunction\\r\\n\\r\\nfunction z=peakit()\\r\\nx=-4:0.1:4;y=x;z=peaks(x,y);\\r\\nendfunction\\r\\n\\r\\nz=peakit();\\r\\n\\r\\nlevels=[-6:-1,-logspace(-5,0,10),logspace(-5,0,10),1:8];\\r\\nm=size(levels,\'*\');\\r\\nn = fix(3/8*m);\\r\\nr = [(1:n)\'/n; ones(m-n,1)];\\r\\ng = [zeros(n,1); (1:n)\'/n; ones(m-2*n,1)];\\r\\nb = [zeros(2*n,1); (1:m-2*n)\'/(m-2*n)];\\r\\nh = [r g b];\\r\\nxset(\'colormap\',h);\\r\\nxset(\'fpf\',\' \');\\r\\nclf();\\r\\ncontourf([],[],z,[-6:-1,-logspace(-5,0,10),logspace(-5,0,10),1:8],0*ones \\r\\n(1,m))\\r\\n\\r\\nxset(\'fpf\',\'\');\\r\\nclf();\\r\\ncontourf([],[],z,[-6:-1,-logspace(-5,0,10),logspace(-5,0,10),1:8]);\\r\\n\\r\\ndas ist der code den ich gefunden habe, leider schaffe ich es nicht die \\r\\nDaten von meiner fft usw. einzuf\\xfcgen.\\r\\n\\r\\nf\\xfcr eure Hilfe bin ich sehr dankbar.</pre>',	'2016-03-31 08:30:39',	'2018-05-21 03:27:02',	688,	0,	''),
