(155,	195,	3,	'Simulation not working',	'<div><div><div><div><div><div><div>Hello greetings,\n\n</div>I am \r\nwriting you because it seems that I am not getting the simulation to \r\nwork, and I can\'t post a question to the forum. I am trying to run the \r\nRC example from the manual. I can create the schematic in \r\nKicad-eeschema, then run in esim the kicadtoNgspice properly. But when I\r\n try to run the simulation it gives me: \"Error while opening pyhon \r\nplotting Editor. Please look at console for more details\"\n\n</div>and in the console it gives me the following:\n\n[ERROR]: Exception Message :[Errno 2] No such file or directory: \'C:\\\\Users\\\\Guillermo\\\\eSim-<wbr>Workspace\\\\RCAC\\\\plot_data_i.<wbr>txt\'\n[ERROR]: Exception Message :local variable \'alli\' referenced before assignment\n[ERROR]: Exception Message : [Errno 2] No such file or directory: \'C:\\\\Users\\\\Guillermo\\\\eSim-<wbr>Workspace\\\\RCAC\\\\plot_data_v.<wbr>txt\'\n\n</div>my circ.out file is as follows:\n\n* c:\\users\\guillermo\\esim-<wbr>workspace\\rcac\\rcac.cir\n\nv1 in gnd sine(0 2 50 0 0)\nc1 out gnd 1u\nr1 out in 1k\n* u1 in plot_v1\n* u2 out plot_v1\n.tran 10e-03 100e-03 0e-03\n\n* Control Statements \n.control\nrun\nprint allv &gt; plot_data_v.txt\nprint alli &gt; plot_data_i.txt\nplot v(in)\nplot v(out)\n.endc\n.end\n\n</div>I\r\n am suspecting it is the simulation that is not working and not \r\ngenerating the \"plot_data_i.txt\" and the \"plot_data_v.txt\", because if I\r\n open the example from ProgramFiles&gt;esim&gt;Examples&gt;RC I have no \r\nproblem on getting the python editor to plot the results.\n\n</div>Thank you very much for your support.\n</div>Best regards from Mxico,\n</div>Guillermo Becerra',	'2016-09-29 04:35:44',	'2018-05-20 18:07:13',	286,	0,	''),
(156,	195,	3,	'Simulation not working. Error while opening phyton plotting editor',	'<div><div><div><div><div><div><div>Hello greetings,\n\n</div>I am \r\nwriting you because it seems that I am not getting the simulation to \r\nwork, and I can\'t post a question to the forum. I am trying to run the \r\nRC example from the manual. I can create the schematic in \r\nKicad-eeschema, then run in esim the kicadtoNgspice properly. But when I\r\n try to run the simulation it gives me: \"Error while opening pyhon \r\nplotting Editor. Please look at console for more details\"\n\n</div>and in the console it gives me the following:\n\n[ERROR]: Exception Message :[Errno 2] No such file or directory: \'C:\\\\Users\\\\Guillermo\\\\eSim-<wbr>Workspace\\\\RCAC\\\\plot_data_i.<wbr>txt\'\n[ERROR]: Exception Message :local variable \'alli\' referenced before assignment\n[ERROR]: Exception Message : [Errno 2] No such file or directory: \'C:\\\\Users\\\\Guillermo\\\\eSim-<wbr>Workspace\\\\RCAC\\\\plot_data_v.<wbr>txt\'\n\n</div>my circ.out file is as follows:\n\n* c:\\users\\guillermo\\esim-<wbr>workspace\\rcac\\rcac.cir\n\nv1 in gnd sine(0 2 50 0 0)\nc1 out gnd 1u\nr1 out in 1k\n* u1 in plot_v1\n* u2 out plot_v1\n.tran 10e-03 100e-03 0e-03\n\n* Control Statements \n.control\nrun\nprint allv &gt; plot_data_v.txt\nprint alli &gt; plot_data_i.txt\nplot v(in)\nplot v(out)\n.endc\n.end\n\n</div>I\r\n am suspecting it is the simulation that is not working and not \r\ngenerating the \"plot_data_i.txt\" and the \"plot_data_v.txt\", because if I\r\n open the example from ProgramFiles&gt;esim&gt;Examples&gt;RC I have no \r\nproblem on getting the python editor to plot the results.\n\n</div>Thank you very much for your support.\n</div>Best regards from Mexico,\n</div>Guillermo Becerra',	'2016-09-29 04:37:06',	'2018-05-20 18:07:12',	300,	0,	''),
