(163,	206,	4,	'openfoam to firefoam throuh paraview?',	'<span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Hi all,</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">this is my first post. I work in the fire engineering industry and I works mainly with FDS. The biggest problem with this program is that does not simulate the sprinkler effect properly.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">After some research I have found that there is an open foam code, firefoam </span><a href=\"https://github.com/fireFoam-dev\" target=\"_blank\" style=\"color: rgb(153, 0, 102); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">https://github.com/fireFoam-dev</a><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">. FM global, one of the most important insurance company is using this code to simulate the sprinkler effect.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">So I am trying to getting started with open foam and then trying to use this FireFoam code.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Since I am new,  I have some question that I cannot find on internet:</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">1)I have installed openfoam from this site </span><a href=\"http://www.openfoam.com/download/install-windows.php\" target=\"_blank\" style=\"color: rgb(153, 0, 102); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">http://www.openfoam.com/download/install-windows.php</a><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">on windows 10. How can I test that the installation was done properly?</span><div><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">2) Is necessary to install paraview to use openfoam and firefoam?Is this the best visual platform?</span></div><div>\n</div><div>3) Do you think that the best thing to do to learn the program is to follow the tutorials and than try the firefoam code??</div><div><br style=\"background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Thanks in advance... please be kind, it is my first post and my first experience with openfoam</span></div>',	'2016-11-01 15:07:10',	'2018-05-20 18:07:10',	789,	0,	''),
