(169,	168,	3,	'eSim on BOSS Linux (anoop)',	'I\'m getting this error on my BOSS Linux (anoop) laptop<div>\n</div><div><div>Traceback (most recent call last):</div><div>  File \"Application.py\", line 27, in &lt;module&gt;</div><div>    from configuration.Appconfig import Appconfig</div><div>  File \"/home/madhan/OSCAD/eSim-develop/src/configuration/Appconfig.py\", line 26, in &lt;module&gt;</div><div>    class Appconfig(QtGui.QWidget):</div><div>  File \"/home/ madhan/OSCAD/eSim-develop/src/configuration/Appconfig.py\", line 49, in Appconfig</div><div>    modelica_map_json = parser_esim.get(\'eSim\', \'MODELICA_MAP_JSON\')        </div><div>  File \"/usr/lib/python2.7/ConfigParser.py\", line 607, in get</div><div>    raise NoSectionError(section)</div><div>ConfigParser.NoSectionError: No section: \'eSim\'</div></div><div><span style=\"line-height: 1.42857;\">\n</span></div><div><span style=\"line-height: 1.42857;\">I\'m unable to run eSim and have to use the older version FreeEDA.</span></div><div><span style=\"line-height: 1.42857;\">In fact, I had to modify FreeEDA/analysisInserter/convertgui.py to get the Analysis Inserter feature working.</span></div><div><span style=\"line-height: 1.42857;\">In class PageOne(wx.Panel), I had to modify </span><span style=\"line-height: 21.4286px;\">grid1 = wx.GridSizer(5, 2) to </span><span style=\"line-height: 21.4286px;\">grid1 = wx.GridSizer(6, 2).</span></div><div><span style=\"line-height: 21.4286px;\">Seems to be an issue with wxWidgets 3. </span></div>',	'2016-11-14 17:27:07',	'2018-05-20 18:07:07',	275,	0,	''),
