(181,	151,	4,	'post-processing problem',	'Hi all,<div>\n<div>drag co-efficient(Cd) calculated from the forceCoeff.dat through numerical integration doesn\'t match with that calculated from the formula </div><div>Cd=F(drag force)/(0.5*density*diameter*U<sub>max</sub><sup>^</sup>2). Can anyone explain why? Since i am using 2-d simulations so in place of area in the Cd formula i used the diameter of the cylinder over which my flow is taking place.</div></div><div>regards</div><div>Subhankar</div>',	'2016-11-23 13:36:35',	'2018-05-20 18:07:02',	307,	0,	''),
