(202,	258,	1,	'Compile call_scilab in c++ using Eclipse IDE Helios Service Release 2',	'Hi,<div>\n</div><div>I am very new to c++ and I am trying to compile a simple c++ code example using call_scilab on Eclipse IDE Helios Service Release 2 platform.  I get the following errors:</div><div>\n</div><div><div>**** Internal Builder is used for build               ****</div><div>g++ -IC:\\Program Files (x86)\\scilab-5.3.3\\modules -IC:\\Program Files (x86)\\scilab-5.3.3\\modules\\output_stream\\includes -O0 -g3 -Wall -c -fmessage-length=0 -oscilab.o ..\\scilab.cpp</div><div>..\\scilab.cpp: In function \'int main()\':</div><div>..\\scilab.cpp:15:31: error: \'getenv\' was not declared in this scope</div><div>  if ( StartScilab(getenv(\"SCI\"),NULL,NULL) == FALSE )</div><div>                               ^</div><div>..\\scilab.cpp:24:52: warning: deprecated conversion from string constant to \'char*\' [-Wwrite-strings]</div><div>  SendScilabJob(\"myMatrix=[\'sample\',\'for the help\']\");</div><div>                                                    ^</div><div>..\\scilab.cpp:25:33: warning: deprecated conversion from string constant to \'char*\' [-Wwrite-strings]</div><div>  SendScilabJob(\"disp(myMatrix);\"); // Will display !sample  for the help  !</div><div>                                 ^</div><div>..\\scilab.cpp:26:39: warning: deprecated conversion from string constant to \'char*\' [-Wwrite-strings]</div><div>  SendScilabJob(\"disp([2,3]+[-44,39]);\"); // Will display   - 42.    42.</div><div>                                       ^</div><div>Build error occurred, build is stopped</div><div>Time consumed: 328  ms.  </div></div><div>\n</div><div>My code is:</div><div>\n</div><div><div>// A simple call_scilab example</div><div>\n</div><div>#include &lt;stdio.h&gt; /* stderr */</div><div>#include \"api_scilab.h\" /* Provide functions to access to the memory of Scilab */</div><div>#include \"call_scilab.h\" /* Provide functions to call Scilab engine */</div><div>\n</div><div>// Filename: simple_call_scilab.c</div><div>\n</div><div>int main(void)</div><div>{</div><div>/****** INITIALIZATION **********/</div><div>#ifdef _MSC_VER</div><div> if ( StartScilab(NULL,NULL,NULL) == FALSE )</div><div>#else</div><div> if ( StartScilab(getenv(\"SCI\"),NULL,NULL) == FALSE )</div><div>#endif</div><div>  {</div><div>   fprintf(stderr,\"Error while calling StartScilab\\n\");</div><div>   return -1;</div><div>  }</div><div>\n</div><div>/****** ACTUAL Scilab TASKS *******/</div><div>\n</div><div> SendScilabJob(\"myMatrix=[\'sample\',\'for the help\']\");</div><div> SendScilabJob(\"disp(myMatrix);\"); // Will display !sample  for the help  !</div><div> SendScilabJob(\"disp([2,3]+[-44,39]);\"); // Will display   - 42.    42.</div><div>\n</div><div>/****** TERMINATION **********/</div><div> if ( TerminateScilab(NULL) == FALSE ) {</div><div>  fprintf(stderr,\"Error while calling TerminateScilab\\n\");</div><div>  return -2;</div><div> }</div><div> return 0;</div><div>}</div></div><div>\n</div><div>I suspect my configuration is not correct. Can anyone please help ?  Many thanks.</div><div>\n</div><div>Cheers,</div><div>Van</div>',	'2017-02-04 12:13:02',	'2018-05-20 18:06:56',	258,	0,	''),
