(221,	290,	3,	'Error trying to create schematic (Ubuntu running under Win10)',	'<div>I\'m getting the following error trying to create a schematic running on Ubuntu (14.04.5 LTS trusty):</div><div>\n</div><div><i>09:05:14: libboost_context.so.1.54.0: cannot enable executable stack as shared object requires: Invalid argument</i></div><div><i>09:05:14: IO_ERROR: Fatal Installation Bug. File:</i></div><div><i>\'/usr/bin/_eeschema.kiface\'</i></div><div><i>could not be loaded</i></div><div><i>Perhaps a shared library (.dll or .so) file is missing.</i></div><div><i>From command line: argv[0]:</i></div><div><i>\'/usr/bin/eeschema\'</i></div><div><i>\n</i></div><div><i>from /build/kicad-I8aRie/kicad-4.0.6+e0/kicad/common/kiway.cpp : KiFACE() : line 225</i></div><div>\n</div><div>I tried to attach a screenshot of the error details but it doesn\'t seem to work (running Chrome).  Anyhow, this may be the culprit, but I\'m not sure what the problem is... Maybe your tool requires an earlier version?</div><div>\n</div><div>From the Details section:</div><div><i>libboost_context.so.1.54.0: cannot enable executable stack as shared object requires: Invalid argument </i></div><div>\n</div><div><div>&gt; find /usr/lib -name \"libboost*\"</div><div>/usr/lib/x86_64-linux-gnu/libboost_context.so.1.54.0</div><div>/usr/lib/x86_64-linux-gnu/libboost_iostreams.so.1.54.0</div><div>/usr/lib/x86_64-linux-gnu/libboost_system.so.1.54.0</div><div>/usr/lib/x86_64-linux-gnu/libboost_thread.so.1.54.0</div></div><div>\n</div><div>eeschema file exists:</div><div>\n</div><div><div>&gt; ls -lrt /usr/bin/_eeschema.kiface</div><div>-rwxr-xr-x 1 root root 4849968 Feb 21 15:19 /usr/bin/_eeschema.kiface*</div></div><div>\n</div><div>\n</div><div>\n</div>',	'2017-03-24 16:16:40',	'2018-05-20 18:06:49',	348,	0,	''),
(222,	151,	4,	'pressure plot in paraFoam',	'Hi all,\n\nI am trying to plot  pressure on  a cylinder(i have solved for flow past a 2-D cylinder and i have u and p files for different times). I have followed many forum pages, but i can\'t plot. Sometimes the plot option is in a disabled state else in the graph plane there is no plot curve. Also i want to know how to save the data of the plot in array(like pressure at time T1 vs points on which pressure is calculated).  \n\nregards\nSubhankar\n',	'2017-03-27 01:22:03',	'2018-05-21 10:45:42',	435,	0,	''),
