(224,	294,	1,	'xcos - rfile_f - input format',	'<p></p><p>Hello,</p><div></div><div>i have to generate a simulation who read textfiles with integer and double types.</div><div>My question is: How can i read an file with integer content with the rifle_f block. Wich format have to be used.</div><div>In the example is only a format. It looks (3(e10.3,3x)), but its only for exponential.</div><div></div><div>My textfile looks like:</div><div></div><div>0</div><div>1</div><div>2</div><div>5</div><div>5</div><div>5</div><div>5</div><div>5</div><div>5</div><div>...</div><div></div><div>The only way for me to read it, is to modify my file like this</div><div></div><div>0.0+E01</div><div><div>0.0E+01</div><div>0.1E+01</div><div>0.2E+01</div><div>0.5E+01</div><div>0.5E+01</div><div>0.5E+01</div><div>0.5E+01</div><div>0.5E+01</div><div>0.5E+01</div><div>...</div></div><div></div><div>In this case i use the format (3(e10.3,3x)) which is in the example an documentation of scilab given</div><div></div><div>Can anyone help?</div><div></div><div>Best regards</div><div></div><p></p><p></p>',	'2017-03-31 09:40:34',	'2018-05-20 18:06:48',	418,	0,	''),
