(241,	224,	1,	'\"Abort\" command in Scilab 6.0.0',	'<p>Hey guys,</p><div></div><div>I have a problem with the \"abort\" command in Scilab 6.0.0... It does not seem to work properly: Whenever I have it in my code for stopping at a particular place (which I use quite frequently) the execution stops but within my variables-browser I don\'t see any results. They pop up when I type something in the console and press Enter, but I guess that is not how it is supposed to work? Furthermore, when I run the example code from the Scilab help the comman does not work at all:</div><div><div class=\"refsection\"><div class=\"programlisting\"><table border=\"0\" width=\"100%\"><tbody><tr><td width=\"98%\"><pre class=\"scilabcode\"><span class=\"scilabid\">a</span><span class=\"scilaboperator\">=</span><span class=\"scilabnumber\">2</span>\\n<span class=\"scilabid\">b</span><span class=\"scilaboperator\">=</span><span class=\"scilabnumber\">3</span>\\n<span class=\"scilabckeyword\">abort</span> <span class=\"scilabcomment\">// The execution will stop here.</span>\\n<span class=\"scilabid\">c</span><span class=\"scilaboperator\">=</span><span class=\"scilabnumber\">4</span>   <span class=\"scilabcomment\">// c will not be defined</span></pre></td></tr></tbody></table></div></div></div><div>When executed, all three variables, a, b, and c are being defined...</div><div>Does anybody know how to deal with that??</div><div><br></div><div>EDIT: Hmm, now also in my script Scilab simply ignores the \"abort\" command... :/</div><p></p>',	'2017-05-08 09:08:45',	'2018-05-20 18:06:43',	452,	0,	''),
