(255,	224,	1,	'Image processing performance',	'Hey guys,<div>\n</div><div>I have a short question: I want to convert a grayscale-image (matrix of floats from 0 to 1) into a binary image having only 0 and 1, depending on a set threshold. </div><div>Therefore I wrote this two alternative routines:</div><div><b>Routine A</b></div><div><pre style=\"font-family: Monospaced; font-size: 12px;\"><span style=\"color:rgb(160,32,240);\">for</span> <span style=\"color:rgb(0,0,0);\">i</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(50,185,185);\">length</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">)</span>\r\n        <span style=\"color:rgb(160,32,240);\">if</span> <span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">i</span><span style=\"color:rgb(74,85,219);\">)</span> <span style=\"color:rgb(92,92,92);\">&lt;</span> <span style=\"color:rgb(0,0,0);\">threshold</span> <span style=\"color:rgb(160,32,240);\">then</span>\r\n            <span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">i</span><span style=\"color:rgb(74,85,219);\">)</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n        <span style=\"color:rgb(160,32,240);\">else</span>\r\n            <span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">i</span><span style=\"color:rgb(74,85,219);\">)</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n        <span style=\"color:rgb(160,32,240);\">end</span>\r\n        <span style=\"color:rgb(0,0,0);\">blackwhite</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n    <span style=\"color:rgb(160,32,240);\">end</span></pre></div><div><b>Routine B</b></div><div><pre style=\"font-family: Monospaced; font-size: 12px;\"><span style=\"color:rgb(160,32,240);\">for</span> <span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(50,185,185);\">length</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(0,0,0);\">,</span> <span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(74,85,219);\">)</span> \r\n    <span style=\"color:rgb(160,32,240);\">for</span> <span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(50,185,185);\">length</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(0,0,0);\">,</span> <span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(74,85,219);\">)</span><span style=\"color:rgb(74,85,219);\">)</span>\r\n        <span style=\"color:rgb(160,32,240);\">if</span> <span style=\"color:rgb(0,0,0);\">image</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(0,0,0);\">,</span> <span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(74,85,219);\">)</span> <span style=\"color:rgb(92,92,92);\">&lt;</span> <span style=\"color:rgb(0,0,0);\">threshold</span> <span style=\"color:rgb(160,32,240);\">then</span>\r\n            <span style=\"color:rgb(0,0,0);\">blackwhite</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(0,0,0);\">,</span> <span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(74,85,219);\">)</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n        <span style=\"color:rgb(160,32,240);\">else</span>\r\n            <span style=\"color:rgb(0,0,0);\">blackwhite</span><span style=\"color:rgb(74,85,219);\">(</span><span style=\"color:rgb(0,0,0);\">y</span><span style=\"color:rgb(0,0,0);\">,</span> <span style=\"color:rgb(0,0,0);\">x</span><span style=\"color:rgb(74,85,219);\">)</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n        <span style=\"color:rgb(160,32,240);\">end</span>\r\n    <span style=\"color:rgb(160,32,240);\">end</span>\r\n<span style=\"color:rgb(160,32,240);\">end</span></pre></div><div>\nI expected that Routine A should be quicker, as all the operations are done within the \"image\"-matrix and only at the end all values are copied to the new variable. Furthermore it uses only one for-loop instead of two.</div><div>However, using the tic() toc() commands I see that Routine  B is about three times faster than Routine A... Can someone explain me why?\nIam still new to this topic and try to get to know how to make such analyses as fast as possible..</div><div>\n</div><div>Thanks, Hackmet</div>',	'2017-05-31 11:49:25',	'2018-05-20 18:06:39',	229,	0,	''),
(256,	331,	7,	'Error while running program',	'<div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">While running a program following error message observed. SciLab version 5.3.3 Please suggest me solution </span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">\n</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">\n</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">mode(0)</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\"> !--error 246 </span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">Function not defined for given argument type(s),</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">\n</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">  check arguments or define function %ip_part for overloading.</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">\n</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">at line      11 of function init called by :  </span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">res=init([port1 port2]);</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">at line      11 of exec file called by :    </span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">exec ser_init.sce</span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">at line       4 of exec file called by :    </span></font></div><div><font color=\"#000000\" face=\"Helvetica Neue, Segoe UI, Helvetica, Arial, Lucida Grande, sans-serif\"><span style=\"font-size: 13px;\">exec(\'E:\\D\\beproj\\16-17\\SBHS\\scilab_codes_local\\Step_test\\start.sce\', -1)</span></font></div>',	'2017-06-01 12:15:07',	'2018-05-20 18:06:39',	189,	0,	''),
