(270,	303,	4,	'vertical loading in interfoam',	'<span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Hi foamers,</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">I am working on simulation of fresh concrete experiment. In the experiment, a concrete cylinder is placed between 2 plates and a load of 1.5N is applied on the upper plate and the displacement of the upper plate is measured.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Using blockMesh i created a box and using setFields cylinderToCell i managed to create my cylinder in the box. But, i dont know how to input the load into the simulation.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">