(273,	224,	1,	'ParticleLabeling with IPCV toolbox command imlabel',	'Hey guys,<div>\n</div><div>I am currently working with the IPCV toolbox command imlabel for identifying particles in an image.</div><div>Everything works quite well, but the problem is that the output from the imlabel is in int8-format, which allows only 256 different labels. However, in my image there are way a few thousands. Consequently, each identified label containes multiple particles, because in the int8 format the numbers are being overwritten, when labels larger than 255 are being added...</div><div>\n</div><div>Soooo... Is there a way to make the command output an int16 for instance?\nAt the moment I could only think of a workaround by taking each label from the int8 and run the imlabel-command again. However, that means that I have to perform the imlabel-command 257 times (1 original and than 256 for each int-label in the 8bit range). And THAT takes some time, just to extract information that was already obtained but lost through the int8-formatting :(</div>',	'2017-07-26 11:06:15',	'2018-05-20 18:06:33',	168,	0,	''),
(274,	367,	10,	'Assigning operating pressure for distillation column',	'<span style=\"font-size: 15px;\">Good day Sir/Mam</span><div style=\"font-size: 15px;\">\n</div><div style=\"font-size: 15px;\">I am a chemical engineering student from South Africa. I watched the shortcut and rigorous distillation tutorial which were extremely helpful for my project. </div><div style=\"font-size: 15px;\">\n</div><div style=\"font-size: 15px;\">However I wanted to ask how do you assign operating pressure for distillation column ? I have to design a pressure swing distillation system, where the first column operates at a low pressure and the second column operates at a higher pressure to separate azeotropic mixture. How can I change the operating pressures of both columns?</div><div style=\"font-size: 15px;\">\n</div><div style=\"font-size: 15px;\">Your assistance would be much appreciated. \n</div><div style=\"font-size: 15px;\">\n</div><div style=\"font-size: 15px;\">Thank you in advance</div>',	'2017-07-26 18:58:47',	'2018-05-20 18:06:33',	201,	0,	''),
(275,	369,	12,	'example problem required for understanding.',	'<div>//Hi All,</div><div>//i want to solve the following MINLP optimization problem using scilab, but i am new to scilab optimization toolbox, can you please post some example or solve //the bellow problem.</div><div>\n</div><div>\n</div><div>\n</div><div>clc;</div><div>clf;</div><div>//problem statement: </div><div>//minimise : fenske_err</div><div>// by changing:</div><div>//lk,hk integer from 1 to 25</div><div>// Rlk,Rhk continuous from 0.5 to 0.999</div><div>// constraint: lk&lt;hk</div><div>// solution: optimised lk, hk, Rlk, Rhk</div><div>\n</div><div>Fi=[131.0796,127.4439,151.6167,185.0476,185.6320,179.2677,172.5071,160.2259,148.6672,134.9301,121.8694,108.2484,97.2993,89.2256,81.6741,74.5860,67.6739,94.3831,69.7915,54.9432,46.1657,32.8283,39.2493,29.5557,27.0888]</div><div>Ki=[26.01625197,24.9019,23.8856,22.3736,20.6820,18.9222,17.2725,15.6624,14.1555,12.6832,11.2771,9.9420,8.6803,7.5003,6.4170,5.4155,4.5198,3.4637,2.3508,1.5117,0.9441,0.5555,0.2480,0.0677,0.0165]</div><div>EBP=[22.6037384,48.80585632,73.88614807,98.64582214,123.5531403,148.9769836,174.1597534,199.4192902,224.6507355,249.9072968,275.1638428,300.4605347,325.8098389,351.0825439,376.3668457,401.6058289,431.1366516,470.3650146,515.2020508,559.4735046,603.3208252,655.7137085,728.6522766,812.7724243,894]</div><div>Mwt=[57.8,67.0,78.3,90.8,102.2,115.2,130.2,146.5,164.5,184.1,205.6,228.8,254.0,280.6,307.7,333.7,364.2,409.8,466.5,523.5,582.6,657.2,748.0,880.2,1020.6]</div><div>SG=[0.6654,0.6867,0.7065,0.7253,0.7400,0.7551,0.7708,0.7858,0.8002,0.8141,0.8275,0.8403,0.8529,0.8652,0.8770,0.8885,0.8997,0.9141,0.9319,0.9494,0.9660,0.9838,1.0043,1.0328,1.0600]</div><div>\n</div><div>function F=fenske(lk,hk,Rlk,Rhk,Fi,Ki,EBP,Mwt,SG)</div><div>Alpha_lkhk=Ki(1,lk)/Ki(1,hk);//incorporate actual Alpha or k</div><div>Nmin=(log((Rlk/(1-Rlk))/((1-Rhk)/Rhk)))/(log(Alpha_lkhk))</div><div>disp(Nmin, \'Nmin=\');</div><div>j=1</div><div>while j&lt;=25</div><div>\n</div><div>Alpha_ihk(1,j)=Ki(1,j)/Ki(1,hk) </div><div>j=j+1;</div><div>\n</div><div>end</div><div>i=1;</div><div>D=[0];</div><div>B=[0];</div><div>I=[0];</div><div>RiD=[0];</div><div>RiB=[0];</div><div>A=[0];</div><div>while i&lt;=25;</div><div>A(1,i)=(Alpha_ihk(1,i)^Nmin)*((1-Rhk)/Rhk); </div><div>RiD(1,i)=(A(1,i)/(1+A(1,i)));</div><div>RiB(1,i)=1-RiD(1,i);</div><div>D(1,i)=Fi(1,i)*RiD(1,i); </div><div>B(1,i)=Fi(1,i)*(1-RiD(1,i));</div><div>I(1,i)=i;</div><div>i=i+1;</div><div>end</div><div>i=1;</div><div>totpro=0;</div><div>while i&lt;=25;</div><div>   totpro=totpro+B(1,i)</div><div>   i=i+1</div><div>end</div><div>i=1;</div><div>CUTV=0;</div><div>CUTVP=0;</div><div>totv=0;</div><div>\n</div><div>while i&lt;=25;</div><div>    CUTV(1,i)=Mwt(1,i)*B(1,i)/SG(1,i);</div><div>    i=i+1;</div><div>end</div><div>\n</div><div>i=2;</div><div>while i&lt;=25;</div><div>     totv(1,1)=CUTV(1,1);</div><div>    totv(1,i)=totv(1,i-1)+CUTV(1,i);</div><div>    i=i+1;</div><div>end</div><div>i=1;</div><div>while i&lt;=25;</div><div>    CUTVP(1,i)=totv(1,i)*100/totv(1,25);</div><div>    i=i+1;</div><div>end</div><div>\n</div><div>plot(I, B,\'xb\')</div><div>CALC=0;</div><div>CALC(1,1)=interpln([CUTVP;EBP],5);</div><div>CALC(1,2)=interpln([CUTVP;EBP],50);</div><div>CALC(1,3)=interpln([CUTVP;EBP],95);</div><div>CALC(1,4)=totpro;</div><div>\n</div><div>F=CALC;</div><div>endfunction</div><div>\n</div><div>function err=fenske_err(Pinit,Fi,Ki,EBP,Mwt,SG)</div><div>\n</div><div>a=Pinit(1);</div><div>b=Pinit(2);</div><div>c=Pinit(3);</div><div>d=Pinit(4);</div><div>\n</div><div>CALC=fenske(a,b,c,d,Fi,Ki,EBP,Mwt,SG)</div><div>err=sqrt((320-CALC(1))^2+(481.00-CALC(2))^2+(810.00-CALC(3))^2+(571.00-CALC(4))^2)</div><div>endfunction</div><div>\n</div><div>CALC=fenske(lk,hk,Rlk,Rhk,Fi,Ki,EBP,Mwt,SG)</div><div>disp(CALC,\'CALC=\');</div><div>Pinit=[12;18;0.9339;0.9324]</div><div>err=fenske_err(Pinit,Fi,Ki,EBP,Mwt,SG)</div><div>disp(err,\'err=\');</div>',	'2017-07-31 12:57:17',	'2018-05-20 18:06:32',	164,	0,	'Optimization Toolbox'),
(276,	371,	4,	'OpenFOAM Issue with Porous Media and Buoyancy',	'<p><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">I have been trying to simulate flow across a porous square heated cylinder, subjected to buoyancy. I am using BuoyantBoussinesqPimpleFoam with explicitPorositySource via fvOptions. I have attached the case file for reference. (BlockMesh + TopoSet + SetFields before trying simulation)</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Now, I am getting negative lift variation, as per the literature, for solid cylinder (see solid.png in attachment). When I introduce porous cylinder instead of solid, the drag variation remains same, but the lift coefficient values (see porous.png in attachment) jump near zero, which is way off the literture value.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">The case that I have attached is at Ri = 0.5 and Re = 40 and the coefficient of lift (average) should be near -1.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">I have also attached the lift coefficient variation.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">What can be the reason for this variation in Cl values and how can I solve it? I have tried almost all variations in putting the Boussinesq approximation into the code, but nothing seems to work out.</span><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><br style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\"><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">Please help me out. Thanks in advance.</span></p><p><span style=\"color: rgb(0, 0, 0); font-family: verdana, geneva, lucida, &quot;lucida grande&quot;, arial, helvetica, sans-serif; font-size: 13.3333px; background-color: rgb(247, 247, 247);\">P.S. For images and case vist&nbsp;</span><span style=\"background-color: rgb(249, 246, 246); font-size: 13.3333px;\"><font color=\"#000000\" face=\"verdana, geneva, lucida, lucida grande, arial, helvetica, sans-serif\">https://www.cfd-online.com/Forums/openfoam-post-processing/191113-error-coefficient-lift-value-porous-media-buoyancy.html</font></span></p>',	'2017-08-02 07:11:23',	'2018-05-20 18:06:32',	220,	0,	''),
(277,	372,	1,	'Can\'t convert old diagram (problem in version) while using To Workspace (xcos)',	'Hi all, I\'m new to Scilab and Xcos and I\'m just facing this problem.<div>\n</div><div>I\'m testing Scilab\'s genetic algorithms in a simple Xcos diagram. I will frequently face this error \"Can\'t convert old diagram (problem in version)\" when retrieving the results from Xcos using To Workspace. Looks like the error occurs in the line where I write \"result = [A.time,A.values];\", being A the vector created by To Workspace. Thing is, this error doesn\'t happen every time, but when I\'m calculating 10 generations of 100 individuals each, it\'s guaranteed that it will happen at least once and the code will stop. Any thoughts on that? Thanks!</div>',	'2017-08-02 11:37:54',	'2018-05-20 18:06:32',	199,	0,	''),
(278,	372,	1,	'Incorrect polynomial operations?',	'Hi, me again. This time I\'m having a problem with polynomial multiplication. I have 9 equations in the form of G = k/(tau*s+1) which I wrote like G(i) = k(i)/(tau(i)*%s+1), where i goes from 1 to 9. Then, I\'m tryng to perform the following calculation: G11 = (G(2)+G(3)*G(6))/(1-G(3)*G(7)). What Scilab gives me is this:\n\n<div>      -0.0019137 - 0.0630427s     </div><div>   -------------------------------------</div><div>   0.0000060 + 0.0515580s + s^2</div><div>\n</div><div>\n</div><div>But this is not correct, the right answer should be\n\n</div><div>\n</div><div><div>               -3.023e012 s^4 - 2.482e011 s^3 - 4.811e009 s^2 - 1.887e006 s - 187          </div><div>-----------------------------------------------------------------------------------------------------------</div><div>4.795e013 s^5 + 4.953e012 s^4 + 1.292e011 s^3 + 6.579e007 s^2  + 1.098e004 s + 0.591  </div></div><div>\n</div><div>which Matlab does correctly, but Scilab does not. Am I missing something here? Thanks in advance.</div><div>\n</div><div>P.S.: I get the correct result if I only multiply G(3)*G(6), but as soon as I add G(2) it wanders off again.</div>',	'2017-08-04 14:31:36',	'2018-05-20 18:06:31',	162,	0,	''),
