(281,	378,	1,	'input problem',	'I just started to use Scilab 6.0.0 and I have the following doubt.<div>I am using the function \"input\" in two subsequent lines, as in the following script.When I run the script in console, if the values of \"x\" and \"y\" are both %pi/2, the expected answer of the program would be \"Infinite\", but it was not. In Scilab 5.5.2 the script run correctly. Does anybody know why?</div><div>sincerely</div><div>Julio</div><div>\n</div><div><pre>function zcalc()\r\n x=input(\"Enter the value of x:\");\r\n y=input(\"Enter the value of y:\");\r\n if abs(cos(y))&lt;1D-15 then\r\n     if abs(sin(x))&lt;1D-15 then\r\n         disp(\"Undetermined\");\r\n     else\r\n         disp(\"Infinite\");\r\n     end           \r\n else z=sin(x)/cos(y);\r\n     disp(z,\"z=\");\r\n     z=return(z);\r\n end\r\nendfunction       </pre></div>',	'2017-08-11 05:00:43',	'2018-05-20 18:06:30',	470,	0,	''),
(282,	302,	4,	'change of volume inside pipe',	'Hello,\nFirst I would like to describe what i am doing.\n<u>Description:</u> There is a pipe closed at bottom and open at top(similar to test tube) with dimensions 0.126 m diameter and 0.5 m height. Inside the pipe there is concrete filled upto 0.124m dia and rest at the internal walls filled with lubricating layer(paste). Now side walls are moved down with a velocity of 0.6679m/s downwards. No dynamic mesh used. It is a static case.\n\nNow my problem is, I believe i have implemented everything fine in openFOAM and simulation ran succesfully. After some some i found the amount of lubricant which was initialised at walls is increasing in quantity and occupying entire cylinder. Concrete is not found. Don\'t know why ?\n\nI couldn\'t attach any case files here. For sharing those Im happy.\n',	'2017-08-11 11:55:39',	'2018-05-20 18:06:29',	200,	0,	''),
