(318,	434,	3,	'error while using thyristor.',	'when i am trying to use a thyristor from esim_power library, things are going fine till netlist generation but kicad to ngspice conversion successful is also displayed. while doing the kicad to ngspice conversion, device modelling for two diodes is blank and so i have added a path there, leading to diode file in device modelling library. for subcircuit tab, i have added the path to scr file in subcircuit user defined library.<div>the .cir.out file is</div><div>\n</div><div><p style=\"margin-bottom: 0px;\">.include scr.sub</p>\r\n<p style=\"margin-bottom: 0px;\">.include userDiode.lib</p>\r\n<p style=\"margin-bottom: 0px;\">v1 net-_t1-pad1_ gnd  dc 100</p>\r\n<p style=\"margin-bottom: 0px;\">x1 gnd net-_v2-pad1_ net-_t1-pad2_ scr</p>\r\n<p style=\"margin-bottom: 0px;\">v2  net-_v2-pad1_ gnd pulse(0.1 10 10m 0 0 10m 20m)</p>\r\n<p style=\"margin-bottom: 0px;\">t1  net-_t1-pad1_ net-_t1-pad2_ two net-_d1-pad2_ 2</p>\r\n<p style=\"margin-bottom: 0px;\">d1 two net-_d1-pad2_ D1N750</p>\r\n<p style=\"margin-bottom: 0px;\">d2 net-_d1-pad2_ net-_d2-pad2_ D1N750</p>\r\n<p style=\"margin-bottom: 0px;\">l1  net-_d2-pad2_ one 1m</p>\r\n<p style=\"margin-bottom: 0px;\">c1  one two 1u</p>\r\n<p style=\"margin-bottom: 0px;\">r1  two one 1k</p>\r\n<p style=\"margin-bottom: 0px;\">* u2  one two plot_v2</p>\r\n<p style=\"margin-bottom: 0px;\">.tran 10e-03 100e-03 0e-03</p>\r\n<p style=\"margin-bottom: 0px;\">\n</p>\r\n<p style=\"margin-bottom: 0px;\">* Control Statements </p>\r\n<p style=\"margin-bottom: 0px;\">.control</p>\r\n<p style=\"margin-bottom: 0px;\">run</p>\r\n<p style=\"margin-bottom: 0px;\">print allv &gt; plot_data_v.txt</p>\r\n<p style=\"margin-bottom: 0px;\">print alli &gt; plot_data_i.txt</p>\r\n<p style=\"margin-bottom: 0px;\">plot v(one,two)</p>\r\n<p style=\"margin-bottom: 0px;\">.endc</p>\r\n<p style=\"margin-bottom: 0px;\">.end</p>\r\n<p style=\"margin-bottom: 0px;\">the error is integer division or modulo by zero</p>