(320,	442,	1,	'The Weierstrass-Mandelbrot curve',	'<p></p><div>Help build the Weierstrass-Mandelbrot Curve function graph</div><div>b = 1.5</div><div>D = 1.8<img align=\"none\" alt=\"\" src=\"https://www.dropbox.com/s/c8ypx3o9wvlyokz/24.png?dl=0\"><br><a href=\"https://www.dropbox.com/s/c8ypx3o9wvlyokz/24.png?dl=0\" title=\"\" target=\"\">https://www.dropbox.com/s/c8ypx3o9wvlyokz/24.png?dl=0</a><br><img src=\"https://www.dropbox.com/s/c8ypx3o9wvlyokz/24.png?dl=0\" alt=\"\" align=\"none\"></div><div><img align=\"none\" alt=\"\" src=\"https://www.dropbox.com/s/c8ypx3o9wvlyokz/24.png?dl=0\"></div><p></p>',	'2017-11-12 06:24:43',	'2018-05-21 00:16:19',	159,	0,	''),
(321,	444,	1,	'problem matrix dimension',	'Hello,<div>\n</div><div>I have a matrix problem with quite a simple code. The point of this code is to create a new vector, similar to a previous one, but with a different dimension.</div><div>\n</div><div>The dimension of the new vectors created is set by a variable value, which I call \"dim\" in my code. I want to create a new vector \"xnew\" which has same values as the vector \"x\" which I created previously in my code.</div><div>\n</div><div>So I create first a zero matrix :</div><div>\n</div><div><div>xnew=zeros(dim,1);</div><div>\n</div><div>Then I copy the values of x (big vector) to xnew (same but smaller) with a loop :</div><div>\n</div><div>for i=1:dim</div><div>    xnew(i,1)=x(i,1);</div><div>end</div></div><div>\n</div><div>Problem : if I display my new vector (xnew), the last line is missing. If I check the size of the matrix \"xnew\", it gives me a line dimension which is one unit less than the variable \"dim\". But if I display this variable \"dim\" at any part of the code, I always have dim which has the good value, but the matrix systematically miss one unit and has a dimension of (dim-1, 1).</div><div>\n</div><div>This is for me very strange, and if I use constant values I don\'t have this problem. Does somebody have a clue of the potential reason of this?</div>',	'2017-11-13 12:17:41',	'2018-05-20 17:58:40',	113,	0,	''),
