(327,	450,	1,	'FIR Filter design',	'How to implement FIR cascade form realization using Scilab?\n',	'2017-12-01 14:40:04',	'2018-05-20 17:55:37',	105,	0,	''),
(328,	425,	3,	'conversion error, unknown component',	'i am using op-amp in my project. i have done the schematic with 0 error but when i converting from <b>kicad-ngspice</b> it shows <b>unknown component lm741</b>.<div>how this problem should be fix...??? </div><div>i have sended a screenshot to the mail. please refer it.</div><div>\n</div><div>thank you.</div>',	'2017-12-02 10:53:53',	'2018-05-20 17:55:02',	147,	0,	''),
(329,	454,	1,	'Steps to install scimax toolbox on Scilab',	'<span style=\"background-color: rgb(255, 255, 255);\">How to install scimax toolbox on Scilab.. </span><font color=\"#726f6f\" face=\"Helvetica Neue, Helvetica, Arial, sans-serif\"><span style=\"font-size: 15px; background-color: rgb(252, 252, 252);\"> \nScilab Version - 6.0.0</span></font><div><font color=\"#726f6f\" face=\"Helvetica Neue, Helvetica, Arial, sans-serif\"><span style=\"font-size: 15px; background-color: rgb(252, 252, 252);\">OS - Ubuntu 17.10</span></font></div>',	'2017-12-06 11:35:56',	'2018-05-20 17:54:26',	158,	0,	''),
(330,	435,	1,	'Problem installing Scilab 6.0 on ubuntu 16.04 LTS',	'Respected Sir / Madam\n                                           I am trying to install scilab 6.0 on ubuntu 16.04 LTS. As soon as I start scilab is crashing. Help in over coming this problem. Your help will be priceless. \n\nThank you\nT.V.Chandra Shekar\n',	'2017-12-06 12:31:13',	'2018-05-20 17:53:49',	201,	0,	''),
(331,	435,	1,	'Problem in visualistion of the output',	'Respected Sir / Madam<div>                                          I am plotting the magnitude and phase response of a transfer function in scilab. I have similar code for the same transfer function in matlab. My outputs in scilab are differing with that of matlab. Please help in this regard for drawing proper inference. I am posting the code I have developed. Your help will be priceless.</div><div>\n</div><div>Yours sincerely</div><div>T.V.Chandra Shekar</div><div>\n</div><div><div>clc;</div><div>clear;</div><div>close;</div><div>\n</div><div>s = %s;</div><div>w = 0:0.01:2*%pi;</div><div>num1 = s^3+ 2*s^2 + 0.9*s + 1;</div><div>den1 = s^3 - 0.9*s + 0.8;</div><div>p = syslin(\'c\',num1,den1);</div><div>disp(p.num);</div><div>\n</div><div>subplot(2,1,1)</div><div>[h] = freq(num1,den1,w);</div><div>plot2d((w/%pi),abs(h));xgrid(color(\"green\"));</div><div>a = gca();</div><div>a.x_location = \"origin\";</div><div>a.y_location = \"origin\";</div><div>\n</div><div>xtitle(\'Frequency Response\',\'f Frequency\',\'Magnitude\');</div><div>subplot(2,1,2)</div><div>plot2d((w/%pi),atan(h));xgrid(color(\"green\"));</div><div>a = gca();</div><div>a.x_location = \"origin\";</div><div>a.y_location = \"origin\";</div><div>\n</div><div>xtitle(\'Phase Response\',\'f Frequency\',\'Phase\');</div></div><div>\n</div><div>\n</div>',	'2017-12-09 03:45:06',	'2018-05-21 01:45:30',	108,	0,	''),
(332,	457,	3,	'unable to use eSim sources',	'hello,i have downloaded eSim in my windows OS,but it is unable to create new project and after making project in KiCad it is unable to use full power sources list like PWM and sine..i think it is not downloaded well please give suggestions',	'2017-12-09 16:17:43',	'2018-05-20 17:52:29',	302,	0,	''),
(333,	425,	3,	'graphical error',	'i have completed my project and converted it to ngspice without any error amd warnings,<div>but nothing has plotted in the simulated graph.</div><div>its blank graph is displayed..!!</div><div>\n</div><div>help me to fix this...</div>',	'2017-12-12 13:15:48',	'2018-05-20 17:51:48',	111,	0,	''),
(334,	458,	3,	'esim installation problem',	'when i click on the esim icon, it opens up till www.BatToExeConverter.com and the closses up. previously i was not having a problem like this.',	'2017-12-13 16:46:50',	'2018-05-20 17:51:05',	459,	1,	''),
(335,	460,	3,	'python plotting error and global label error',	'PYTHON PLOTTING ERROR  <b>\"Error while opening plotting editor. Please look at the console for more details\"</b> appears whenever I opt for simulation.<div>GLOBAL LABEL ERROR   Using global label in schematic shows error in ERC as<b> \"Global label not common to any other global level\"</b></div><div>NGSPICE ERROR  Using command \"plot v(out)\" shows <b> \"no such vector out\" </b>even though I use a global label \'out\' for a node(selecting it as output)</div><div>please give me solutions as soon as possible.</div>',	'2017-12-15 05:54:05',	'2018-05-20 17:50:20',	252,	0,	''),
(336,	435,	1,	'Problem with design of iir lpf filter.',	'Respected Sir / Madam\n                                          I am developing scilab for iir butterworth LPF. Once after designing the filter I am trying to check the filter output. The output does not what I was looking for. Please help me in this regard. I am posting the code as well. Your help will be priceless.\n\nYours sincerely\nT.V.Chandra Shekar\n\n<pre style=\"font-family:Monospaced;font-style:normal;font-size:12.0;\"><span style=\"color:rgb(100,174,100);font-style:italic;\">//Low Pass IIR Butterworth Filter</span>\r\n<span style=\"color:rgb(50,185,185);\">clc</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(50,185,185);\">clear</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(174,92,176);text-decoration:underline;\">close</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n\r\n<span style=\"color:rgb(0,0,0);\">fs</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">8000</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">omegap</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">500</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">omegas</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">2000</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">wp</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(0,0,0);\">omegap</span><span style=\"color:rgb(92,92,92);\">/</span><span style=\"color:rgb(0,0,0);\">fs</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">ws</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(0,0,0);\">omegas</span><span style=\"color:rgb(92,92,92);\">/</span><span style=\"color:rgb(0,0,0);\">fs</span><span style=\"color:rgb(