(355,	467,	10,	'Rigorous Distillation',	'I am trying to simulate a rigorous column distillation for benzene-toluene mixture.But when i specify Reboiler specification as Compound Fraction in product stream (toluene = .985).I get the error that \"Bubble Point method of Wang and Henke doesn\'t support the defined specifications. Please use the IO method for full specification support\".<div>What I understand from this error is that I can\'t specify product composition for Rigorous column distillation and instead I have to specify bottom product molar flow or any other option for Reboiler. But in a video tutorial I have seen the instructor specifying product composition for Reboiler with Wang and Henke method and his simulation works.</div><div>Please if someone can clarify the meaning of error.</div><div>Thank you.</div><div>P.S- I am new to process simulation</div><div>\n</div>',	'2018-01-12 06:01:32',	'2018-05-20 17:32:49',	131,	0,	''),
