(389,	554,	1,	'Alternate instruction in scilab for filtic in matlab',	'<div>Regarding use of filter instruction we have problem . The program runs well if there are no initial conditions. But we are not finding an alternative for instruction filtic ( matlab ) in scilab . Can you please help us. I have attached the codes</div><div><pre style=\"font-family:Monospaced;font-style:normal;font-size:12.0;\"><span style=\"color:rgb(50,185,185);\">clc</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(50,185,185);\">clear</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(100,174,100);font-style:italic;\">// Difference equation is y[n]+3y[n-1]=x[n]+x[n-1]; x[n]=(1/2)^n u[n];y(-1)=2</span>\r\n<span style=\"color:rgb(0,0,0);\">n</span> <span style=\"color:rgb(92,92,92);\">=</span> <span style=\"color:rgb(188,143,143);\">0</span><span style=\"color:rgb(255,170,0);\">:</span><span style=\"color:rgb(188,143,143);\">3</span><span style=\"color:rgb(0,0,0);\">;</span>\r\n<span style=\"color:rgb(0,0,0);\">a</span> <span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\">[</span><span style=\"color:rgb(188,143,143);\">1</span> <span style=\"color:rgb(188,143,143);\">3</span><span style=\"color:rgb(74,85,219);\">]</span><span style=\"color:rgb(0,0,0);\">;</span> <span style=\"color:rgb(100,174,100);font-style:italic;\">//left hand side of difference equation</span>\r\n<span style=\"color:rgb(0,0,0);\">b</span> <span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\">[</span><span style=\"color:rgb(188,143,143);\">1</span> <span style=\"color:rgb(188,143,143);\">1</span><span style=\"color:rgb(74,85,219);\">]</span><span style=\"color:rgb(0,0,0);\">;</span> <span style=\"color:rgb(100,174,100);font-style:italic;\">//right hand side of difference equation</span>\r\n<span style=\"color:rgb(0,0,0);\">yi</span><span style=\"color:rgb(92,92,92);\">=</span><span style=\"color:rgb(74,85,219);\