(417,	544,	1,	'a warning message',	'<p> t=0:0.05:5;</p><p>s=poly(0,\'s\');</p><p>tf=(s+1)/((s-1)*(s+2)*(s+3));</p><p>clf(0);</p><p>xset(\"window\",0);</p><p>show_window();</p><p>plot2d([t\',t\'],[csim(\'step\',t,tf2ss(tf))\',0*t\'])\nWARNING: csim: Input argument #1 is assumed continuous time.</p><p>When I run the above code I get the warning message, but the code runs great. It seems that t is defined OK, what\'s up? \n</p>',	'2018-03-02 21:21:31',	'2018-05-21 10:49:13',	67,	0,	''),
(418,	544,	1,	'rerunning cloud code',	'<p>xinit(\"/Sites/scilab-on-cloud/static/tmp/1520026139.53.png\");\n                                                             !--error 13 \nRedefining permanent variable.\nat line       2 of exec file called by :    \nid8R4YUTwjHzqzoLEmOPnVy75aPcyv.sci\", 2)</p><p>I run a group of code lines in the cloud and execute the code and all is well. However, after getting rid of the graphics page and trying to rerun the code, I get the above error message. And I can so longer run the same group of code lines without an error message! Much different than in Scilab! I have to exit the cloud and reenter it if I want to rerun the same code group: is this the normal behavior?</p>',	'2018-03-02 21:44:29',	'2018-05-20 16:31:37',	69,	0,	''),
(419,	572,	3,	'Not able to start up the schematics.',	'<p>After installing eSim and starting it up. I created a new project named first_1.proj but when I try to start up the schematics the following error shows up in the command prompt</p><div><div><div>Worker Thread Calling Command : eeschema C:\\\\Users\\\\bunty\\\\eSim-Workspace\\\\first_1\\\\first_1.sch</div><div>Traceback (most recent call last):</div></div><div><div>File \"C:\\\\eSim\\\\src\\\\projManagement\\\\Worker.py\", line 36, in run</div><div>self.call_system(self.args)</div><div>File \"C:\\\\eSim\\\\src\\\\projManagement\\\\Worker.py\", line 40, in call_system</div><div>proc = subprocess.Popen(command.split())</div><div>File \"C:\\\\Python27\\\\lib\\\\subprocess.py\", line 710, in __init__</div><div>errread, errwrite)</div><div>File \"C:\\\\Python27\\\\lib\\\\subprocess.py\", line 958, in _execute_child</div><div>startupinfo)</div><div>WindowsError: [Error 2] The system cannot find the file specified</div></div></div><div></div><div><br></div><div></div><div>Will be thankful for your help.</div><div></div><div></div><p></p>',	'2018-03-03 14:56:01',	'2018-05-21 05:53:24',	138,	0,	''),
(420,	544,	1,	'sgrid from definition example',	'<p>H=syslin(\'c\',352*poly(-5,\'s\')/poly([0,0,2000,200,25,1],\'s\',\'c\'));\nclf();evans(H,100);sgrid()</p><p>clf();sgrid(0:0.2:1,[0.2 0.6 1 1.7 2])</p><p>From the sgrid definition there are the following 2 code snippets. The first 2 lines, when copied into the cloud work as expected. The root locus and the sgrid all show up. The last line, however, does nothing: no sgrid at all! Both snippets were copied and pasted into the cloud.</p><p>What\'s up?</p>',	'2018-03-03 17:30:49',	'2018-05-20 16:28:43',	67,	0,	''),
(421,	544,	1,	'what is syms and how does it affect the code',	'<p align=\"LEFT\"><font face=\"CMTT12\">s=%s;</font></p><font face=\"CMTT12\">\r\n</font><font face=\"CMR10\" size=\"3\"><font face=\"CMR10\" size=\"3\"></font></font><p align=\"LEFT\"><font face=\"CMTT12\">syms K T</font></p><font face=\"CMTT12\">\r\n</font><font face=\"CMR10\" size=\"3\"><font face=\"CMR10\" size=\"3\"></font></font><p align=\"LEFT\"><font face=\"CMTT12\">H= </font><font color=\"#ff0000\" face=\"CMTT12\"><font color=\"#ff0000\" face=\"CMTT12\">syslin </font></font><font face=\"CMTT12\">( </font><font face=\"CMR12\">\' c \' </font><font face=\"CMTT12\">,K/(s*(T*s +1) ))</font></p><font face=\"CMTT12\">\r\n</font><font face=\"CMR10\" size=\"3\"><font face=\"CMR10\" size=\"3\"></font></font><p><font color=\"#ff0000\" face=\"CMTT12\"><font color=\"#ff0000\" face=\"CMTT12\">nyquist </font></font><font face=\"CMTT12\">(H)</font></p><p><font face=\"Times New Roman\">When I run this code I get errors complaining about syms, I can\'t find it in the list of functions on the help. I did find an online reference telling me that it is part of the ATOMs addendum to the Scilab environment. Looking at ATOMs I find a whole slew of tools that can be added, and I have no idea which one and whether this is even worth the effort. Maybe if I understood the code a little better I could find a workaround syms. It looks like the original intent of the syms K T line was to define 2 variables of some sort. Then they are used in syslin to define a linear system, which is then used by nyquist. I have also seen this same sort of thing used in evans for a root locus plot.  Can anyone explain how K and T are used in this code to get a nyquist plot?</font></p>',	'2018-03-03 19:20:28',	'2018-05-20 16:27:16',	126,	0,	''),
(422,	425,	3,	'Python plotting missing',	'hello,\nI have simulated Bandpass filter using an op-amp. I am getting well and a good plot in Ngspice plot.\nBut In python plot, I am not getting db plot(plot_db). \nHow can I get db plot in python plot?\n\n',	'2018-03-04 07:03:00',	'2018-05-21 10:34:15',	78,	0,	''),
(423,	544,	1,	'evans code example not working',	'<p>H=syslin(\'c\',352*poly(-5,\'s\')/poly([0,0,2000,200,25,1],\'s\',\'c\'));\nclf();evans(H,100);\nsgrid()</p><p>In the above code the zero is at -5, the poles are at  -20, -2.5+ 9.68i,  -2.5- 9.68i , 0, and 0. Note the 2 imaginary poles.  Which means that I should see 1 zero and 5 poles in the evens plot. When I run the code I see 1 zero and 3 poles all on the real, not imaginary) axis.  So something is screwed up here!  When I run the code I do see an instant flicker of the real evens code, and then this screwed up display with no sgrid at all.  All the other code that I have cut and pasted into Scilab (Routh table, Nyquist and Bode plots) all work with no problems.  I did check the roots of poly(-5,\'s\') and poly([0,0,2000,200,25,1],\'s\',\'c\') and they do show the above mentioned zeros and poles, so it seems that the display is very screwed up. When I run the code in the cloud I get a very nice root locus plot with the 2 complex poles and with the sgrid also plotted!  If anyone can think of why Scilab will not run this code correctly, I will be very grateful.</p>',	'2018-03-04 20:59:30',	'2018-05-20 16:24:21',	111,	0,	''),
(424,	544,	1,	'is the cloud working',	'<p>s=poly(0,\'s\');\nn=2+3*s+4*s^2;\nd=5-s^3;\nh=syslin(\'c\',n/d); \nplzr(h);</p><p>the above code works in Scilab, but not in the cloud. Is the cloud having problems?</p><p>3/4/2018 9:46pm</p>',	'2018-03-05 02:46:30',	'2018-05-20 16:22:53',	58,	0,	''),
