(430,	544,	1,	'Scilab Symbolic Toolbox',	'<ol style=\'list-style: decimal; margin: 0px 0px 1em 1.5em; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; color: rgb(114, 111, 111); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-weight: 300; word-spacing: 0px; vertical-align: baseline; white-space: normal; orphans: 2; widows: 2; background-color: rgb(252, 252, 252); font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Install Maxima. On terminal type sudo apt-get install maxima</li></ol><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">This is the first step to install the Symbolic Toolbox. I can find a windows version of Maxima from Sourceforge.</p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">If I install this, how will Scilab know that it is installed?  sudo is some sort of Linux command, but I am using windows, </p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">so how do I do this step?   Maybe the installer itself puts the tool into Scilab. I don\'t know.  Feedback needed here! Maxima </p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">seems to be some sort  of algebraic equation tool, but was it designed  especially for Scilab so that the installation puts it</p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">into the Scilab tools?  \"On terminal type sudo\" is a Linux command, but I am using windows, so I would have to install </p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">Maxima via windows, not  Linux, and this can not even be done in a Scilab console, unless there is a way that I do not know </p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">about. So how does Maxima get to be part of Scilab? Maybe by the file browser.</p><ol style=\'list-style: decimal; margin: 0px 0px 1em 1.5em; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; color: rgb(114, 111, 111); text-transform: none; text-indent: 0px; letter-spacing: normal; font-family: \"Helvetica Neue\", Helvetica, Arial, sans-serif; font-size: 13px; font-style: normal; font-weight: 300; word-spacing: 0px; vertical-align: baseline; white-space: normal; orphans: 2; widows: 2; background-color: rgb(252, 252, 252); font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\'><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\"><a style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; color: rgb(48, 99, 165); font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; text-decoration: none; vertical-align: baseline;\" href=\"http://scilab.in/scilab_toolbox/overload-1.3.3.tar\">Download overload-1.3.3.tar</a></li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Extract overload-1.3.3</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">On Scilab console, navigate to overload-1.3.3 folder</li><li style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; font-style: inherit; font-weight: inherit; vertical-align: baseline;\">Type exec loader.sce in Scilab console</li></ol><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">These are the next 4 lines of installation instructions: the tar file is a Linux file, not a windows file type.  I can</p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">extract in windows a tar file and hope that when I type in exec loader.sce that the intended results will be </p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">obtained. I also see no way of browsing for a folder in the Scilab console: cut and paste and clearing the </p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">console I can do, but not navigating! I can go to the file browser and find the everload-1.3.3 folder from there.</p><p style=\"margin: 0px; padding: 0px; outline: 0px; border: 0px currentColor; border-image: none; font-family: inherit; font-size: 13px; vertical-align: baseline;\">But how do I exec loader.sce?</p>',	'2018-03-08 23:43:30',	'2018-05-20 16:14:03',	163,	0,	''),
