(432,	544,	12,	'linux and Scilab',	'It seems that Scilab examples don\'t always work when the code being downloaded contains the syms command. After nosing around and posting on the Scilab forum I am directed to the Scilab Symbolic Toolbox at https://scilab.in/scilab-symbolic-toolbox. It also seems very obvious that this set of instructions is directed towards, \"<strong style=\"border: 0px; font-family: &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; font-size: 15px; margin: 0px; outline: 0px; padding: 0px; vertical-align: baseline; color: rgb(114, 111, 111); background-color: rgb(252, 252, 252);\">OS:</strong><span style=\"background-color: rgb(252, 252, 252);\"><font color=\"#726f6f\" face=\"Helvetica Neue, Helvetica, Arial, sans-serif\"><span style=\"font-size: 15px;\"> Ubuntu 14.04\", which is a linux OS. What about those of us that are using windows! There are a lot of us. I would like to see a set of instructions directed towards those of us who are not using linux! I have used a linux OS at work a couple of years ago, but now I am solely using windows 8.1, which is much different than linux. So what about us windows users or are we just stuck without being able to use the Symbolic Toolbox?</span></font></span>',	'2018-03-10 00:15:52',	'2018-05-20 16:11:05',	134,	0,	'Signal Processing Toolbox'),
