(434,	544,	1,	'scilab and linux',	'<p><a href=\"https://scilab.in/scilab-symbolic-toolbox\">https://scilab.in/scilab-symbolic-toolbox</a></p><p>I discussed this before (this is a Linux setup) and looking at the functions mentioned in the toolbox there are the following:  Maxima, overload-1.3.3.tar, and scilab-scimax-2.1.3.tar.  I have found a windows Maxima windows, a SciMax toolbox, and a Overload toolbox.  Looking the above link and these 3 items it looks like if I install Maxima  (done), and install the last 2 toolboxes I might be able to accomplish this task of using syms in the examples using this code.  Will this work? </p><p><a href=\"http://forge.scilab.org/index.php/p/overload/\">http://forge.scilab.org/index.php/p/overload/</a></p><p><a href=\"https://forge.scilab.org/index.php/p/scimax/\">https://forge.scilab.org/index.php/p/scimax/</a></p><p>These are the links to the overload and scimax toolboxes that I found.</p>',	'2018-03-11 16:32:56',	'2018-05-20 16:08:08',	109,	0,	''),
