(446,	544,	1,	'call_scilab help file questions',	'<p><a href=\"https://help.scilab.org/doc/5.3.3/en_US/compile_and_run_call_scilab.html\">https://help.scilab.org/doc/5.3.3/en_US/compile_and_run_call_scilab.html</a></p><span lang=\"EN\"><p>This shows makefiles where PATH_SCILAB is defined as the path to where Scilab is installed. So far, so good. But then there are other paths defined to directories that don\'t exist in the installation that I downloaded! What\'s up?  Looking again at these makefiles there are lines with pathways to directories that don\'t even exist! For instance:</p><pre class=\"scilabcode\" style=\"width: 813px; height: 62px; color: rgb(51, 51, 51); text-transform: none; text-indent: 0px; letter-spacing: normal; font-style: normal; font-weight: 400; margin-top: 0px; margin-bottom: 0px; word-spacing: 0px; -ms-overflow-x: auto; -ms-word-wrap: break-word; orphans: 2; widows: 2; font-variant-ligatures: normal; font-variant-caps: normal; -webkit-text-stroke-width: 0px; text-decoration-style: initial; text-decoration-color: initial;\"><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">SCILAB_CFLAGS</span> <span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">=</span> <span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">-</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">I$</span><span class=\"scilabopenclose\" style=\"color: rgb(74, 85, 219); font-style: normal;\">(</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">PATH_SCILAB</span><span class=\"scilabopenclose\" style=\"color: rgb(74, 85, 219); font-style: normal;\">)</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">modules</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">core</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">includes</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span> <span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">-</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">I$</span><span class=\"scilabopenclose\" style=\"color: rgb(74, 85, 219); font-style: normal;\">(</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">PATH_SCILAB</span><span class=\"scilabopenclose\" style=\"color: rgb(74, 85, 219); font-style: normal;\">)</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">modules</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">call_scilab</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span><span class=\"scilabid\" style=\"color: rgb(0, 0, 0); font-style: normal;\">includes</span><span class=\"scilaboperator\" style=\"color: rgb(92, 92, 92); font-style: normal;\">/</span></pre><p>I don\'t see any /modules directory of anything like /modules/call_scilab/includes/ so what the heck are these makefiles even talking about?</p><p>I know from my c and c++ programming experience that if I go to compile a group of files the compiler will know to look first in the same directory as the source code for the makefile. So where should the makefile that they are talking about in this link be located and what is the compiler that is being used? Is it the call_scilab function that does the compiling and working with the makefile? Then where should the makefile be located to work with this function?</p><p>And, looking at these make files, one is for source code and the other is for binary file. All I see in this tool download is the source code. Maybe the binary files that they are referring to are the .sce or .sci files. I don\'t know.   Being a c++ programer I know the difference between .c, .h, &amp; .o &amp; .exe files. Maybe it would be a lot simpler if there was a tutorial on how to compile Scilab toolboxes, but I haven\'t found one yet. If there is one please let me know. These are just a few of the questions that I have about this call_scilab help file.</p></span>',	'2018-03-16 06:10:23',	'2018-05-20 15:56:20',	51,	0,	''),
